INSERT INTO `OBJECTS` VALUES (104146,'cup','Cup, handled: of rectangular plan, cast, off-white opaque glass.  Carved:  Rect\'rised Shou char.',6182,0,'',' 1900','Qing dynasty (1644-1911)',' 1801','N4701','Eastern Art','',''),(104147,'bottle','tear-shaped; lip and ft-Os.  Opaque white glass and royal blue overlay.  Carved shou medallions, 2 monster masks and rings.',6175,0,'',' 1900','Qing dynasty (1644-1911)',' 1801','N4712','Eastern Art','',''),(106059,'bottle','bottle ovoid, on ft-O.  White glass, opaque, and green streak.  2 simian heads.',6176,0,'',' 1900','Qing dynasty (1644-1911)',' 1801','N4716','Eastern Art','',''),(160593,'plaque','Replica of Fb6604, an Apollo plaque. Inscribed D.A.POL DECIMUS.',7758,0,'',' ','',' ','Cast43','British Archaeology','Apollo Plaque replica',''),(123054,'coffee pot & cover','Tapered cylindrical body with moulding around base and top; hinged cushion-domed lid with pedestal-vase finial; \'s\'-scroll spout, the lower half heavily fluted, leaf scroll above mouth; scrolled wooden handle pinned into silver sockets, the lower one scrolled, the upper with leaf.\n\n\nscratch weight under base: \'oz.30=2=0\'.',4429,13076,'\\London\\ (assayed in London)',' ','',' 1737-1738','G3716','Applied Art','',''),(123055,'teapot & cover','Inverted pear shape on round moulded foot; spout curves up from mid-way up body, leaf moulding on base. Turned wood handle pinned into silver sockets, the upper one scrolled under.  Lid domed in centre, hinged at back; bud finial.\nChased decoration around top and on lid: scrolls, single & paired, on matted ground; scroll border on lid, matted on dome.\n\n\nEngraved under base:  \' M T \'.',4429,13076,'\\London\\ (assayed in London)',' ','',' 1743-1744','G3717','Applied Art','',''),(123056,'sugar caster','Octagonal baluster form on convex-moulded base; rounded collar at base of swelling baluster, step-moulded top with rounded rim. Domed octagonal cap secured to body by two lugs; vase finial above applied floret.\nPanels of body flat-chased and engraved at top & base with alternate cross-hatched panels within border and radiating lines crossed by vermicular dotted lines, all on matted ground; cross-hatching and vermicular motifs on base.  Facets of cap pierced with stylised flower vase on alternate cross-hatched and matted grounds.\nEngraved in centre of one panel: bent arm holding sabre.',4429,13076,'\\London\\ (assayed in London)',' ','',' 1712-1713','G3718','Applied Art','',''),(123065,'tea jar','Inverted pear shape on circular domed foot with pierced flower/scroll border, scale pattern.  Domed cover.\nEmbossed and chased decoration: gadroons alternating with flower swags; band of flowers & leaves around centre, chased ditto around neck with scalloped, matted border.  Central plain cartouche in rococo scroll border extending over gadrooning; opposite, basket of flowers.  Cover has gadrooned edge and gadrooning on dome with four leaf swags; flat flower finial.',4270,13076,'\\London\\ (assayed in London)',' ','',' 1758-1759','G3725.a','Applied Art','',''),(123067,'jug, milk','Helmet-shaped; reeded loop handle\nRouletted decoration above foot -  scallops & lozenges - and below reeded rim - chevrons, leaves.\n\n\nEngraved below lip:  \' RT \'  [script] within leaf/flower garland.',4270,13076,'\\London\\ (assayed in London)',' ','',' 1802-1803','G3726','Applied Art','',''),(123077,'snuff box','Straight-sided elliptical form, three-quarters of top hinged to form lid.\nBright-cut engraving: rouletting around base, sides and top; husk border, scroll and leaf above ad below, two flower sprays either side of shaped octaonal central plaque engraved   \' IP \' [script].\nInterior gilded.',4393,13076,'\\London\\ (assayed in London)',' ','',' 1792-1793','G3735','Applied Art','',''),(106057,'brush pot','brush-pot,cylr,glass,crimson overlay on snowstorm/white.  Carved: 4 feline dragons with 3-fid tails, 2 spouting clouds and chars.  For sun and moon.',6174,0,'',' 1900','Qing dynasty (1644-1