ology','lentoid \'New Year\' flask',''),(84037,'grinder','A stone with two channels on opposite sides of the stone which is otherwise rounded with concentric rings from borings/grinding vessels.',1752,0,'',' ','',' ','H3632','Foreign Archaeology','vessel grinder',''),(83278,'stela','Top portion of a rectangular stela with two ears facing each other and an insciption inbetween them. Below is a figure in an adoring pose facing right (broken).\nTranslation: \'Lord of Behdet [a name of Horus]\'',1770,7739,'Temple of Ptah',' -1295','New Kingdom',' -1550','H2218.a','Foreign Archaeology','hearing ear stela',''),(79525,'pillar','Three slightly rounded pieces of stone which fit together. The top half has parallel line decoration, with columns of hieroglyphs, in sunk relief. Inscribed cartouche of Rameses II. One large piece with hieroglyphs including a bull, ankh, etc, 1 medium piece and one small piece. Now stuck together.',1752,0,'',' -1213','New Kingdom',' -1279','H649','Foreign Archaeology','pillar',''),(84643,'statue','Block statue of a man with his knees drawn up to his chest. There are two women on each side of him and a column of hieroglyphs running down his front. The front bottom is missing and part of his head is damaged. Translation (Dodson, Aidan): \'The revered one before Ptah-Sokar, Nefertemhotpe\'.',2126,7739,'palace of Apries',' -1295','New Kingdom',' -1550','H395','Foreign Archaeology','granite block statue',''),(83243,'figurine','Torso of a seated man wearing a medium-sleeved garment and a beaded collar. He wears an elaborate wig with diadem. The figure is finely carved and on the back is a rectangular block with columns of hieroglyphs, on the right of the plaque there is a hand behind the figure\'s shoulder. It is broken on a diagonal through the negative space to just below their right elbow.\nTranslation: A royal offering to Ptah, the Gr\nTwo Lands, ka? […] Ptah […]\n(Dodson, Aidan)',2126,7739,'Temple of Ptah',' -1186','New Kingdom',' -1550','H403','For