 helped build the great cities, and it was thought that they ensured the protection of the cities\' inhabitants. \nThe deity carries the container of a ritual substance, perhaps water or pollen, which is linked with rituals of purification or fertility.  \nThere is a band of writing running across the relief. This text was the same or very similar on each relief and is therefore called the Standard Inscription. The Standard Inscription begins by tracing Ashur-nasir-pal II\'s lineage back three generations and recounts his military victories, defines the boundaries of his empire, tells how he founded Kalhu, and built the palace. \nOriginally the relief would have been brightly painted and displayed in the King\'s palace to reinforce his legitimacy as ruler.',3823,2,'Palace of Ashurnasirpal II',' -878','Babylon',' -880','H794','Foreign Archaeology','Assyrian reliefs',''),(146118,'relief','Large relief showing two priests. \nOriginally the relief would have been brightly painted and displayed in the King\'s palace to reinforce his legitimacy as ruler.\nThere is a band of writing running across it. This text was the same or very similar on each relief and is therefore called the Standard Inscription. The Standard Inscription begins by tracing Ashur-nasir-pal II\'s lineage back three generations and recounts his military victories, defines the boundaries of his empire, tells how he founded Kalhu, and built the palace.',3823,2,'Palace of Ashurnasirpal II',' -878','Babylon',' -880','H796','Foreign Archaeology','Assyrian reliefs',''),(122165,'salt, trencher','Rectangular with cut corners.\nEngraved \' I.D.S \'.',4385,1355,'',' ','',' 1720-1740','Na2315','Applied Art','',''),(121668,'cup, 2-handled: \\\'christening\\\'','Guernsey \'christening\' cup.  Moulded foot, cup rounded at base, straight-sided with an everted rim.  Two cast beaded scroll handles.\nHammer marks visible.\nEngraved under base:  \'MLS\'.',4387,1355,'',' ','',' 1790','Na2318','Applied Art','',''),(75116,'ice scratched boulder','',526,6428,'near Colwyn Bay',' ','',' ','Cb5543','Palaeontology','',''),(87167,'figurine','\'La Catrina\'; green glitter skeleton with a handbag and green dress, and a green feather in the hat. The skeleton has a cigarette in its mouth, a painted white face and black features. Clay and paper mache figure. \nMade for the Day of the Dead celebrations. La Catrina personifies death and represents a high society woman.',7758,8688,'Mercado de Artesanias, Balderas',' ','',' 2005','Ea12815','Ethnography','clay and paper mache figure',''),(62011,'Fossil','',526,7474,'Marsh lane Pit,',' ','',' ','Cb5177','Palaeontology','',''),(81402,'bottle','A pot made from white clay. It has a ring base and a bulbous body. The neck is very narrow and flares to a plain rim with a handle.',1752,7731,'H5-P469',' ','',' ','H5173','Foreign Archaeology','bottle',''),(81338,'amulet','A bright blue faience figure of a striding woman with a lion\'s head. She wears a long, tight dress with her arms by the side. She has a sun disc on her head with a ureaus (cobra). There is a back pilaster (pierced) and she stands on a base.',7758,7731,'H6-83, Saqqara',' ','Second Intermediate Period - New Kingdom',' 1650-1295 BC - 15th Dynasty - 16th Dynasty - 17th Dynasty - 18th Dynasty (early)','Ha7565','Foreign Archaeology','Sekhmet amulet',''),(84661,'coffin','Wooden cat coffin. Seated figure of a cat on a base. The ears are missing, as is part of the base, most of the paint has gone, leaving only some areas with black and red lines. Some detail on the tail remains. Contains a small mummified cat.',1770,7731,'tomb',' ','',' 1886-11-04','H2622','Foreign Archaeology','Bastet cat coffin',''),(83235,'figurine','Wooden Osiris on throne figurine. A mummified figure on a block throne with feet rest and back pillar (hollow). The figure probably has his arms crossed and holding a crook and flail, but the wood is too worn to be certain. He wears a beard and the atef crown (conical with a feather on either side). There are traces of white paint on the figure which is generally worn and decayed.',1752,0,'',' ','',' ','H5169','Foreign Archaeology','Osiris figurine',''),(83006,'dish','A small red dish with a flat base and straight sides. The clay has small black dots on it. \'Sakkara H5-P500\' and arabic numerals are written on the side of the pot.',1742,7731,'H5-P5400 (?)',' ','',' ','H5177','Foreign Archaeology','dish',''),(83635,'furniture fitting','A butterfly shaped cramp- piece of wood (one wedge is wider than the other) for fixing long planks together. Painted white and badly cracked.',1752,7731,'H5-624 (?)',' ','',' ','H5193','Foreign Archaeology','butterfly cramp furniture fitting',''),(86798,'figurine','A seated woman in a long dress with a horned sun disc on her head. She has a naked child on her lap and is suckling him to her left breast. There are tangs under her feet and bottom.',1752,0,'',' ','',' ','H5194','Foreign Archaeology','Isis and Horus figurine',''),(83559,'jug','Dark grey clay jug with hollow ring foot, a pear shaped bottom section with a long thin neck. The mouth  is flared with a plain rim and there is a handle going from a moulded double line on the neck to the shoulder. There is a sticker with the number \'7\' on the main body of the jug. The jug leans to one side and there is a chip in the base.  The shape is that of an opium poppy seed head.',1742,7731,'above grave 3506',' -1295','First Intermediate Period - Middle Kingdom - Second Intermediate P',' -2055','H5162','Foreign Archaeology','jug',''),(82975,'jug','A cream coloured jug with a flat base with evidence of wheel turning. The main body has a high shoulder and a narrow flared neck with a plain which has a spout formed in the clay. There is a handle from the rim to the top of the shoulder.',1742,7731,'above grave 3506',' -1295','First Intermediate Period - Middle Kingdom - Second Intermediate P',' -2055','H5163','Foreign Archaeology','jug',''),(83378,'dish','A round dish with a small ring base. IT has been decorated with red slip (which is worn more on the outside than the inside). There is a black band painted around the rim inside and outside. The rim is broken in two places and two pieces have been stuck back on.',1742,7731,'above grave 3507',' -1295','Second Intermediate Period - New Kingdom',' -1650','Ha5228','Foreign Archaeology','dish',''),(83397,'jar','A jar made from dark red clay with white slip painted on the outside and the inside of the neck. There is a black line painted around the rim. The paint has worn away in places. The pot has a flat  bottom and a biconical body with a flared neck and round rim. There is a chip missing from the rim.',1752,7731,'above grave 3506',' -1295','First Intermediate Period - Middle Kingdom - Second Intermediate P',' -2055','H5165','Foreign Archaeology','jar',''),(84031,'dish','Rounded red ware dish with black slip rim. It has a small flat base and the outside shows concentric circles: evidence of a wheel-thrown pot. The rim has two small chips and one large chip and crack. The black rim has worn away in some areas.',1859,7731,'above grave 3507',' -1295','Second Intermediate Period - New Kingdom (early)',' -2055','Ha5229','Foreign Archaeology','dish',''),(86557,'figurine','The seated figure of a woman in a long, plain dress. She has a naked child on her lap and a horned sun disc on her head. Her hair has incised decoration. The base on which the feet sit is hollow and has a tang coming out of it. The statue is chipped.',1859,0,'',' ','',' 1970-11-04','Ha7133','Foreign Archaeology','Isis and Horus (Harpocrates) figurine',''),(86989,'votive box','A plain metal rectangular box with a cornice at the top and a ridge around the bottom. There is a three-dimensional hawk on top of the box with incised decoration on the feet, wings and head. One end of the box is missing and about a fifth of the sides are gone.',1770,0,'',' ','',' 1970-11-04','Ha7134','Foreign Archaeology','hawk votive box',''),(86750,'figurine','The figure of a bird with large splayed feet, \'s\' shaped neck and long, curved beak.',1770,0,'',' ','',' 1970-11-04','Ha7136','Foreign Archaeology','ibis figurine',''),(83848,'figurine','A matt gold-coloured statue of Osiris as a mummified man standing on a (modern) hollow base. He features and regalia have incised decoration.  He holds a cook and flail in his hands, he wears a false beard, a beaded collar and the atef crown (a conical crown with a plume either side, and a uraeus (cobra) at the base, this example has curled ram\'s horns at the base). There are two lines of incised decoration coming from the base of the crown at the back.',1770,7731,'cache 6',' ','',' ','H5168','Foreign Archaeology','Osiris figurine',''),(122295,'\\\'Clear & Yellow Star Flowers\\\'','Base: roughly oval clear glass formed from a gather, rounded base, slight depression in top in which sit two lamp-worked spiky flowers, one clear, one opaque yellow soda glass.\n\n\nTwo spare flowers supplied.\n\n\nStored in own cylindrical box.',4474,11936,'',' ','',' 01/2005','Na2320','Applied Art','',''),(138518,'aircraft','Full scale near replica of the Bristol Biplane or Boxkite, one of three built from the original drawings by Miles and Co for the 1964 film \'Those Magnificent Men In Their Flying Machines\', where it featured as the Phoenix Flyer. The mock-up engine was replaced with a real Gnome rotary engine in the early 1980s, but this is still the wrong type for the aircraft (it should have a pusher engine and prop)',3794,14580,'',' 1964','',' 1964','J439','Industrial and Maritime History','Bristol Boxkite',''),(122702,'flower holder: vase','Baluster shape with flared neck, small-scalloped rim, flat base.\nAll-over gold crackle lustre over dark blue-green glaze, glaze extends inside rim for 35mm.',4240,12639,'Sunflower Pottery',' ','',' 1900-1905','G1034','Applied Art','',''),(121578,'trial sample','',4255,12639,'Sunflower Pottery',' ','',' ','G1156','Applied Art','',''),(121579,'tria