chelor\').',4263,12496,'Castle Green',' ','',' 1773-1778','G560','Applied Art','',''),(122582,'figure: milkmaid','red shawl',4263,12496,'',' ','',' 1773-1778','G565','Applied Art','',''),(122602,'medallion','Oval, arms of Fox',4279,12496,'',' ','',' ','G586','Applied Art','',''),(123021,'tureen, sauce  & cover','gilt shell handles and pineapple finial; sepia festoons of husks, classical urns',4246,12496,'',' ','',' 1773-1778','G3544','Applied Art','',''),(125724,'coffee pot & cover','Baluster shape on foot rim; border of gilt diaper and scrolls; polychrome flowers and gilt sprigs.',4334,12496,'',' ','',' 1773-1778','N6964','Applied Art','',''),(125725,'jug','Baluster shape on short spreading foot rim; old man mask-head lip; moulded loop handle with central rounded rib.\nPainted in coloured enamels (pinks and green) and gilding: gilt rim; gilt scroll border with dotted filling above shaded pink scale border with ssymmetrical bottom edge; similar border around bottom of body above gilt scroll border on foot. Between, gilt wavy spiral lines overpainted with green flower-and-leaf spirals in opposite direction; one green leaf on upper scale border. Elaborated gilt detailling on handle and around terminals; mask-head has painted features and beard.',4334,12496,'',' ','',' 1773-1778','N6965','Applied Art','',''),(125726,'sugar jar & cover & stand','Ogee-shaped jar on footrim, convex cover with flower-head finial, saucer-type stand with up-curved sides and no well.\nClive service.  Gilt dentil rim; gilt band interrupted by alternate puce scroll motifs and flower sprigs from which depend flower and leaf festoons, scattered green leaves; on jar, gilt line above foot rim.  In centre of stand and interrupting gilt band on jar, a lozenge-shaped crest with gilt scrolls and, across centre, three gilt stars on a black band.',4655,12496,'',' ','',' 1773-1778','N6966','Applied Art','',''),(125728,'mug','Straight-sided cylindrical with very slight taper and slightly everted rim; broad flat footrim; moulded loop handle with central rounded rib.\nPainted in coloured enamels (orange-red, yellow, green, blue, pink, purple) and richly gilded. Flower spray with rose, auricula, lily, etc,; on reverse, two crossed branches with yellow-centred purple flowers and a leafy branch with two orange flowers; three leaf sprigs.  Gilded borders at top and bottom: asymmetrical scroll-edged with variety of fillings: (top) dots, over-crossed diagonal lattice, triple dots, cracked ice, dotted circles, lattice-&-dot; (bottom) lattice-&-dot, vermicular, diagonal stripes, dots, dotted circles, triple dots. Gilt dentil rim inside, gilt scrolls on and within handle and single gilt leaves.\n\n\nFlower spray has misfired.',4334,12496,'',' ','',' 1773-1778','N6967','Applied Art','',''),(125729,'dish, saucer','Dish form on wedge-shaped footrim.\nPainted in coloured enamels (orange-red, pink, yellow, green, blue, turquoise, purple) and gilding.  Pink-scale border with Vitruvian-scroll inside edge; the scales rectangular with gilt oval centre; border edged in gilt; a floral pendant springs from each scroll (five in total), all different;  five two-leaf sprigs.\nLinear glazr fault near base of one pendant.\nDerived from a Chelsea pattern.',4334,12496,'',' ','',' 1773-1778','N6968.i','Applied Art','',''),(125730,'dish, saucer','Dish form on wedge-shaped footrim.\nPainted in coloured enamels (orange-red, pink, yellow, green, blue, turquoise, purple) and gilding.  Pink-scale border with Vitruvian-scroll inside edge; the scales rectangular with gilt oval centre; border edged in gilt; a floral pendant springs from each scroll (five in total), all different (and different from those on N6968.1);  five two-leaf sprigs.\n\n\nDerived from a Chelsea pattern.',4334,12496,'',' ','',' 1773-1778','N6968.ii','Applied Art','',''),(125731,'bowl & cover & stand','2-handled bowl; gilt dentil and broad tooled gold band entwined with blue ribbon supporting classical medallions and trophies of arms',4655,12496,'',' ','',' 1773-1778','N6969','Applied Art','',''),(125732,'cup: coffee can &  saucer','Can: cylindrical with moulded auricular handle.  Saucer: deep sloping sides.\nDeep band of ornament:alternate sepia husk-draped urns and classical busts within gilt scroll cartouches; mid-green borders; in centre of saucer a camaieu quiver, bow and arrows;  inside can and outside saucer, a gilt dentil rim with arrowheads; gilt detailing on handle, gilt line around rim and base of can and around outside base of saucer.',4655,12496,'',' ','',' 1773-1778','N6970','Applied Art','',''),(125733,'jug','Baluster shape on foot rim, mask-head lip, stap handle with central channel.  Gilt dentil rim above broad gilt band between two gilt lines and green husk line from which dependtwo gilt ovals containing puce camaieu classical heads on pale green ground and a gilt circle surrounding husk wreath which encircles upper handle terminal; another gilt surround aound lower half of lip contains initials and date \'J B // 1773\'.  From these gilt circles are suspended flower festoons, alternately long and short; three flower sprays and leaf sprigs on lower part of body; gilt leaf meander above footrim; broad gilt band between two gilt lines on footrim; two gilt bands and edge lines on handle.  Lip in form of old bearded man, naturalistically painted.',4655,12496,'',' ','',' 1773','N6971','Applied Art','',''),(125734,'coffee cup & saucer','Burke service',4655,12496,'',' ','',' 1773-1778','N6972','Applied Art','',''),(125735,'sugar bowl','Chough service',4655,12496,'',' ','',' 1773-1778','N6973','Applied Art','',''),(125736,'sugar bowl & cover','Gainsborough service: gilt dentil; tooled gold band entwined alternately with green laurel and polychrome flowers.',4267,12496,'',' ','',' 1773-1778','N6974','Applied Art','',''),(125737,'cup, tea, & saucer','RS service',4655,12496,'',' ','',' 1773-1778','N6975','Applied Art','',''),(121282,'bowl','Bowl with slightly everted rim, on tall wedge-shaped footrim.\nPainted in coloured enamels (orange-red, yellow, green, blue, purple) and gilding: pale yellow ground reserving three shaped purple-scroll-edged cartouches with dotted lattice filling, from which spring small flower and leaf sprigs ; two flower and one leaf sprigs, 12 single leaves; flower spray inside bowl: two yellow roses,3 orange flowers amid leaves and purple scrolls. Elaborate gilt bord\n\n\nLight sanding inside.',4334,12496,'',' ','',' 1773-1778','N6976.a','Applied Art','',''),(121302,'bowl','Bowl with slightly everted rim, on tall wedge-shaped footrim.\nPainted in coloured enamels (orange-red, yellow, green, blue, purple) and gilding: pale yellow ground reserving three shaped purple-scroll-edged cartouches with dotted lattice filling, from which spring small flower and leaf sprigs ; two flower and one leaf sprigs, 12 single leaves; flower spray inside bowl: two yellow roses,3 orange flowers amid leaves and purple scrolls. Elaborate gilt border on footrim: dotted lattice with scroll lower edge. Gilt rim edge, red dentil inside above gilt leafy scroll border.',4334,12496,'',' ','',' 1773-1778','N6976.b','Applied Art','',''),(125740,'dish','Lozenge shape with deep sloping and shaped sides. Gilt dentil rim from which depend polychrome flower festoons; in centre a floral spray with large dark pink tulip-type flower, two flower sprigs and two leaf ditto; edge of base outlined in gilt and, on outside, gilt line above foot rim.\n\'S\'-shaped support under base.',4655,12496,'',' ','',' 1773-1778','N6977.i','Applied Art','',''),(125742,'cup: coffee can & saucer','gilt dentil suspending palm fronds in gold with wreaths of roses containing stars, linked by polychrome festoons.',4655,12496,'',' ','',' 1773-1778','N6978','Applied Art','',''),(125743,'cup, tea, & saucer','Bowl-form cup with slightly everted rim, on wedge-shaped footrim; plain loop handle. Dish-form saucer on wedge-shaped footrim.\nPainted in coloured enamels (orange-red, yellow, green, blue, pink) and gilding.  Cup: fine gilt line inside rim, gilt rim edge; gilt border of shell \'C\'-scrolls with fine lattice filling; all-over gilt vertical lines with slight spiralling, overpainted with flower spray with central orange flower, two blue & yellow and one pink flowers; five leaf sprigs and one loose pink petal; blue flower spray inside; gilt dentil around foot; gilt detailing on handle. Saucer has same border and gilt lines, flower spray in centre.\n\n\nCircular indentation in decoration on saucer.',4334,12496,'',' ','',' 1773-1778','N6979','Applied Art','',''),(125744,'cup: teabowl & saucer','\'Botanical\' service.',4334,12496,'',' ','',' 1773-1778','N6980.i','Applied Art','',''),(125745,'cup: teabowl & saucer','\'Botanical\' service.',4334,12496,'',' ','',' 1773-1778','N6980.ii','Applied Art','',''),(125746,'cup, tea, & saucer','gilt dentil and border of knot motifs and trellis-diaper pierced with quatrefoils in orange; polychrome sprays',4334,12496,'',' ','',' 1773-1778','N6981','Applied Art','',''),(125747,'jug: cream ewer','Boat-shaped with two broad lips and two moulded square-section handles; scroll-moulded pedestal base below moulded stiff acanthus.\nInside, gilt dentil rim and line of green husks between gilt lines; gilt flower head in centre and sprig below one lip.  Outside, band og intersecting gilt circles between two green leaf meanders within gilt lines; acanthus painted in two shades of green; gilt leaf meander; gilt scroll detailing on base and handles.\nTwo iron spots inside.',4655,12496,'',' ','',' 1773-1778','N6982','Applied Art','',''),(125749,'cup, tea, & saucer','scroll border; vertical gilt lines emblazoned with polychrome flower spray.',4334,12496,'',' ','',' 1773-1778','N6984','Applied Art','',''),(125750,'coffee cup & saucer','Plumer service',4655,12496,'',' ','',' 1773-1778','N6985','Applied Art','',''),(125751,'coffee cup & saucer','Leinster service',4655,12496,'',' ','',' 1773-1778','N6986','Applied Art','',''),(125752,'jug, mi