ped in pairs separated by single; steep curvature; rim flange moulded with floral meander.\nMottled glaze in shades of green, yellow, brown, pale and dark blue-grey.  Back mottled in brown only.\nThree stilt marks in well.',4240,11948,'',' ','',' 1750','Na263','Applied Art','',''),(126294,'figure: \\\'Britannia\\\'','Seated figure, right arm raised and holding metal trident, left hand holds oval silver shield resting on ground; she wears silver helmet and breastplate, purple-pink dress with blue spots and border design, looped over her right shoulder, red and green cloak over left shoulder, red and yellow drapery around waist and sandals.  On her right, a seated lion; flower and gress-strewn rocky ground.',4240,11948,'',' ','',' 1820','N8249','Applied Art','',''),(125865,'bust: Lord Clive','Head and shoulders turned slightly to his right, on moulded socle.  Male figure with ................ wig, uniform double-breasted jacket with high collar and stock, sash and star-shaped order.\nBlue-tinted glaze has pooled heavily in places; base uneven.',4240,11948,'',' ','',' 1780-1790','N7156','Applied Art','',''),(125227,'mug','Straight-sided cylindrical with squared handle.\nTransfer-printed in brown and overpainted in red and green: Railway scene:  steam locomotive named \'JAGO\' pulling one open ?tender with three men, two closed carriages with passengers at the windows and luggage on top and part of an open carriage on which is a (horse)carriage and two men; Alpine background of mountains, trees, church and chalet.  Inside rim, Gothic lambrequin border; on handle, simple design of circles within a band (badly applied).  Quality of decoration generally poor.',4240,11948,'',' ','',' 1850','N5517','Applied Art','',''),(178176,'bear jug','figure of a bear',9375,11948,'',' 1780','',' 1760','72/100','Applied Art','',''),(120750,'jug','Squat bulbous body with wide cylindrical neck; generous protruding lip with scalloped bottom edge, \'S\'-scroll handle with feathered moulding, foliate thumbrest and  inner and outer spurs above lower terminal.\nApplied slips decoration: broad band around body with white figures on lavender ground (clockwise from handle): figure playing lyre under a tree, 4 cupids driving a goat, figure playing lyre under tree, grieving figure by urn, 3 cupids, one riding a lion, figure by an obelisk; strapwork design around neck.   Gilt band on rim, lines above foot and above & below central band; gilt detailing on lip and handle.\nInscribed in gilt below lip: \'John Green // Bristol. // 1814\'',6228,11948,'',' 1814','',' 1814','G272','Applied Art','',''),(120471,'cup: coffee can','Straight-sided cylindrical, upright loop handle with thumbpiece.\nSponged green ground reserving two rectangles outlined in puce and each crudely painted with flower spray; sprig in between.  Dark puce rim, line inside rim and detailing on handle.',4206,11948,'',' ','',' 1845','G235','Applied Art','',''),(120579,'cup: coffee can','Straight-sided cylindrical, upright loop handle with thumbpiece.\nHand-painted with two different flower sprays in red, pink, yellow, green, blue, purple.  Dark puce rim, line inside rim and line above base, detailing on handle.',4206,11948,'',' ','',' 1845','G340','Applied Art','',''),(122635,'tea jar','Opaque-white glass.',4493,11948,'South Staffordshire',' ','',' ','G651','Applied Art','',''),(123311,'cup, footed','',4558,11948,'',' ','',' 1830','N15','Applied Art','',''),(124202,'teapot & cover','brown glaze',4270,11948,'',' ','',' 1760','N3301','Applied Art','',''),(124410,'tool, potter\\\'s','a \'backer\' (dish profile); traditionally used by Robert Brunt, head dish maker at the Bristol Pottery\n\n\nincised inscription: \'Peter Baddaley // Burslem January 13th /40 //Warrented \'\non reverse: \' Honi soit qui mal y pence \'',4576,11948,'',' ','',' 1800-1899','N3724','Applied Art','',''),(124411,'tool, potter\\\'s','\'pitcher tool\' for shaping inside of pie dishes\n\nincised inscription: \' J.Satterley Oct 21/14 deep // Wm Causly // 1875 \'',4576,11948,'Staffordshire (probably)',' ','',' 1875, dated','N3726','Applied Art','',''),(124807,'salt','Flattened bowl with convex sides raised on three paw feet; narrow rim moulding.  Mottled brown tortoiseshell glaze.',4396,11948,'',' ','',' 1750-1770','N4512','Applied Art','',''),(128616,'decanter label','Shaped crescent form. White enamel ground printed in red and  overpainted in colours with a design of two cupids, one holding a banner bearing the legend \'CLARET\', the other holding aloft a helmet; in the background, two rows of tents on left, vines on right. Metal chain loop at top.\nDesign after Ravenet.',4426,11948,'South Staffordshire',' ','',' 1755-1800','N7406','Applied Art','',''),(127018,'jug: \\\'Fair Hebe\\\'','',4671,11948,'',' ','',' ','Na264','Applied Art','',''),(123770,'teapot & cover','Squat pear shape, spirally gadrooned, on four moulded feet, projecting shoulder, \'s\' spout with acanthus leaf and high double-scroll handle with acanthus leaf thumb rest; gadrooned rim.  Cover domed, flowerhead finial on moulded leaves. [Berthoud 1909]\nBand of 4 gilt-edged scalloped arcades on upper part of body; within each arch a 2-flower spray below lemon ground (each spray a rose + a tulip, clover, purple ?, orange chrysanthemum).  Between arches, dark underglaze blue ground scattered with gilt dots and with four gilt-edged flowerhead reserves with gilt leaves.  Gilt leaf meander on flat of shoulder, flowerhead between anthemion on spout with all-over dots, detailing on handle and feet; spout outlined in gilt, gilt line below rim and around edge of shoulder.\nCover with two 2-flower sprays in long oval reserve on blue ground as pot with two gilt  flowerheads; gilt rim & detailing on finial.',4270,11948,'',' ','',' 1835','N2076','Applied Art','',''),(122936,'money box','brown spots',4405,11948,'Staffordshire (probably)',' 1760','',' 1740','G2928','Applied Art','',''),(123495,'cup, tea, & saucer','Wide bowl-shaped cup on spreading footrim; double scroll handle.  Deep saucer with no central indentation.  Printed and painted in puce lustre and overpainted in turquoise, yellow and green.\nCup: two scenes: boy seated under bush offers bunch of flowers to standing girl wearing high-waisted dress and feathered hat; hills in background, flowers and leaves in foreground;  standing girl wearing coat with cape and holding flower bunch in landscape of flowering shrubs, the roof of a house appearing above a rise, flower basket front left.  Inside, a turquoise band between thick and thin lustre lines with \'bellflowers\' depending from lower one.\nSaucer: central scene: youth wearing cap on right offers flowers to girl seated on rise below arching flowering tree; she wears hat with 2 large feathers and has baket of flowers and fruit over right arm; hills in background, rose branch across foreground.  Below rim, turquoise & lustre bands as inside cup.',4240,11948,'',' ','',' 1830-1840','N1148','Applied Art','',''),(124679,'cup, tea, & saucer','harbour scene',4627,12017,'',' ','',' 1750','N4112','Applied Art','',''),(146441,'bowl','Shallow clay tripod bowl with hand-built hollow feet in the shape of an animal head (coyote? deer? pig? dog?). Burnished red surface with band of white painted scroll decoration and white slip on animal heads.',6228,0,'',' ','',' ','Ea8101','Ethnography','',''),(149596,'dish','Large oval dish. Argyllite. Inlaid with ivory decoration.  Heavily carved figures of two women, one at each end and between them are two figures of dog-like animals.',7758,905,'Queen Charlotte Island',' ','',' ','Ea11501','Ethnography','argyllite dish',''),(126263,'punch bowl','Painted in blue, red, green, yellow on off-white glaze.  Exterior: six shaped panels containing stylised floral motifs separated by columnar panels with scroll pattern and oval tops.',4524,12496,'Bristol (probably)',' ','',' 1739','N8194','Applied Art','',''),(83561,'jar','Cylindrical cream coloured jar. Broken into three large pi