rm tapering in from a circular base to a triangular top.\nPink semi-opaque glass overlaid with green-brown and brown. Etched.\nRelief decoration of river landscape: tall tree and 3 bushes in foreground, water, then shadowy trees on far bank.',3826,12027,'',' 1902','',' 1898','N7010','Applied Art','',''),(125945,'flower holder: vase','Cameo glass.\nTall vase on rounded circular foot; body curves out from narrow base and tapers out to wide point at one-third of height, then in to long neck with flared rim.\nClear glass streaked with amber and overlaid with purple-brown and brown glass.  Mottled purple-brown effect around flared rim.  Etched and cut.\nRelief decoration: a freesia-type plant with tall flowering stems, heavy leaves, grass.',3826,12027,'',' 1907','',' 1903','N7459','Applied Art','',''),(125944,'flower holder: vase','Cameo glass.\nDepressed globular body below a tall cylindrical neck tapering in towards top.\nWhite semi-opaque glass with a pink blush below rim and above base, overlaid with purple and green glass.  Etched.\nRelief decoration: two flower clusters separated by two leaves all supported on a sinuous stem rising above three leaves on the body.',3826,12027,'',' 1910','',' 1895','N7458','Applied Art','',''),(125018,'scent bottle','Cylindrical green glass bottle with clear neck and stopper. Relief design of leaves and flowers against matt acid-etched ground; design partly gilded, white enamel details on body. Angular finial to stopper.',4620,12027,'',' ','',' 1890','N4842','Applied Art','',''),(127520,'jar & cover','',4395,1788,'',' ','',' 1988','Na1152','Applied Art','',''),(126036,'bottle ticket','Bowed rectangle with cut corners, engraved line inside edge; engraved \' SHERRY \'; suspension chain.',4426,1788,'',' ','',' 1816-1817','N7719','Applied Art','',''),(8903,'Bush pig','',294,0,'',' ','',' ','Aa521','Biology','Bush pig',''),(150473,'plaque','Bronze Apollo plaque; inscribed D.A.POL DECIMUS. Romano-British.',7758,10271,'From floor of later improved shrine',' ','Romano - British',' ','Fb6604','British Archaeology','Apollo plaque',''),(62442,'Fossil','',526,0,'',' ','',' ','Cb5161','Palaeontology','',''),(124243,'urn, 2-handled, & cover','white relief figures on green',4559,11888,'',' ','',' ','N3381','Applied Art','',''),(125041,'teapot & cover','Depressed globular body with short slightly \'S\'-scrolled spout and square-topped handle with tight scroll at bottom; slightly-domed cover with ball knop.  Painted polychrome floral decoration: large and small paeony/chrysanthemum sprays in yellow and pink.',4270,11888,'',' ','',' 1800-1810','N4912','Applied Art','',''),(125124,'bin label','\'Port\' painted in black',4344,11888,'',' ','',' ','N5225','Applied Art','',''),(125125,'bin label','\'Sherry\' painted in black',4344,11888,'',' ','',' ','N5226','Applied Art','',''),(127179,'teapot & cover','glazed yellow ware; osier moulding, wheatsheaf finial, acanthus-moulded handle',4270,11888,'',' ','',' 1817','Na595','Applied Art','',''),(127180,'jug, milk','glazed yellow ware; osier-moulded',4270,11888,'',' ','',' 1817','Na596','Applied Art','',''),(123447,'beverage warmer','',4568,11888,'',' 1830','',' 1815','N515.i','Applied Art','',''),(8747,'Nightjar','',101,3855,'Failand, Bristol, west',' ','',' 1906','A833','Biology','Nightjar','[ST 5271]'),(126811,'plate','Vitreous earthenware, \'Blue Scroll\' pattern',4670,12496,'',' ','',' 1967-1972','N9261','Applied Art','',''),(83920,'human remains','Mummified human adult female. Her title was \"Lady of the House, Neskhons\". The bandages are in a herring bone pattern across her chest, horizontal across her abdomen and legs and diagonal across her lower legs. Hole at the thorax.',1772,0,'',' -600','Third Intermediate Period (?)',' -650','H5062.3','Foreign Archaeology','female mummy of the Lady of the House Neskhons',''),(83748,'figurine','Red pottery figure of a mummified man with arms on his chest holding a crook and flail. His false beard is broken and he wears an atef crown (conical with a plume either side). His face is modelled and part of his foot is missing. He lies in a rectangular coffin with no lid.',1889,7742,'Wadi Qubbanet el-Qirud (Valley of the Tombs of the Monkeys)',' -1069','New Kingdom',' -1295','H1716','Foreign Archaeology','Osiris figurine in coffin',''),(84929,'funerary cone','A cone of red clay (white in come places) with raised hieroglyphs, stamped on the bottom. There are four rows of hieroglyphs. It is chipped in one place. \nTranslation:\nThe prince UTH (?) prophet of Amun\'s scribe of the Temple of Amun. Chief (?) of the prophets in the temple of the king, Mentaemhat.',1835,7742,'TT34 (Tomb of Montuemhat) (?)- although the catalogue card/register records: \"From the palace of Thutmose I (18th Dynasty). 25th Dynasty (?).\"',' -656','Late Period',' -747','H2368','Foreign Archaeology','funerary cone',''),(83564,'stela','A creamy-yellow rectangular stele with a rounded top. The figures are incised and an places are in shallow relief. It shows a seated man and woman (with a daughter stood in front of her) in front of food offerings. The man is holding a lotus.\nTranslation:\nA royal offering to Osiris, Lord of Busiris, the Great God, Lord of Abydos, that he may give invocation offerings, bread, beer, oxen, fowl, to the ka of Meru.\n(Dodson, Aidan)',2126,7742,'Qurna',' -1550','Second Intermediate Period',' -1650','H3570','Foreign Archaeology','stela of Meru',''),(84930,'funerary cone','A pottery cone, dark red and black stamped, raised hieroglyphs on the base. There are four rows of hieroglyphs, and it is chipped in three places.',1835,7742,'Tomb of Pabasa, TT279. Necropolis of Asasif, just outside the entrance to Hatshepsut\'s temple at Deir el Bahari.',' -610','Late Period',' -664','H5119','Foreign Archaeology','funerary cone',''),(83873,'food','A roughly oval shaped dom-palm nut with brown smooth outer casing and fibrous inner section. The fruit rattles.',1742,7742,'grave',' ','',' ','Ha5415','Foreign Archaeology','dom-palm nut',''),(84018,'food','A rolled piece of bread, which has been dried and is severly crack. Dark brown with some light brown and white areas.',1742,7742,'grave',' ','',' ','Ha5463','Foreign Archaeology','bread',''),(83617,'shabti','Mummiform figurine with painted inscription. Pale green matt faience. Carrying hoes and basket. Inscribed \' The Osiris, Nespahenuttawi.\'  (Dodson 2006)',1741,7742,'Ramasseum (?)/ Ramesseum (?)',' ','Third Intermediate Period',' 945-715 BC - 22nd Dynasty','Ha6999','Foreign Archaeology','shabti',''),(83691,'paint','Three stones of paint pigment, one blue and two red.',1752,7742,'grave',' ','',' ','Ha5990','Foreign Archaeology','paint stones',''),(206487,'print','Copy of 2 Belzoni prints merged together. \'Section of the tomb of Psam/uthis in Thebes, discovered and opened by Belzoni in 1818\'. Fourteen copies of the frescoes are depicted, with a plan of the tomb of Pharaoh Sety I.',1772,7742,'Valley of the Kings, Sety I\'s Tomb, grave KV17',' 1820','',' 1817','1615.TET','Foreign Archaeology','COPY of Belzoni prints',''),(120073,'wall relief','A flat piece of carved stone  with a column of raised hieroglyphs. The animals are facing right and some blue, red and black paint remains on the object.\nText from the Book of the Divine Cow (identified by Prof Hornung)',1772,7742,'Sety I\'s Tomb, grave KV17, Valley of the Kings, Sety I\'s Tomb, grave KV17',' -1279','New Kingdom',' -1294','Ha7929','Foreign Archaeology','',''),(83749,'canopic jar (false)','Pale yellow-brown carved jar with baboon shaped head with eyes, nose and mouth painted in black. There is an incised line around its \'neck\'. It is all one piece, and is solid.',1772,0,'',' -30','Ptolemaic Period',' -332','H2872','Foreign Archaeology','Hapy canopic jar (false)',''),(84921,'bead network','A modern network of tubular faience beads in various shades of blue and green. They are strung in a diamond pattern with round and disc beads (various colours) at the junctions. There are approximately 1500 tubular beads and 850 ring beads.',1772,7742,'From an intrusive burial in tomb 7 in the temple of Nebhepetre Mentuhotep., Deir el Bahari',' -1050','Third Intermediate Period',' -1050','Ha7386.1040','Foreign Archaeology','bead network',''),(85362,'wall relief','A raised relief carving of a hippopotamus with its mouth open in foliage. It has remains of red and yellow paint on it.',1770,7742,'mortuary temple of Mentuhotep II (?), Deir el Bahari',' -2004','Middle Kingdom (?)',' -2055','H419','Foreign Archaeology','wall relief',''),(83642,'foundation deposit','A collection of 6 ears in various sizes, glazed pottery and faience. Foundation deposits.',1770,7742,'Temple of Ptah. Qurneh., Qurna',' -1186','New Kingdom',' -1295','H1097','Foreign Archaeology','ears foundation deposit',''),(84645,'wall relief','Shallow bas relief of the head and shoulder of a man with a bow or driving cattle with a stick. Above is a register of five-point stars painted in blue, the man\'s skin is red-brown and the bow/stick is brown. The edges are broken and some of the surface is chipped.',1742,7742,'mortuary temple of Mentuhotep II, Deir el Bahari',' -945','Third Intermediate Period',' -1069','H421','Foreign Archaeology','wall relief',''),(83982,'coffin','The coffin lid is made of black painted wood and mummiform in shape. There is gilt decoration around the neck and heiroglyphs running down the centre of the lid, but these are barely visible and illegible. No other decoration is visible, leaving the dark wood visible. The top has been scratched. There is a small crack around the neck area and one on the left side too. The feet are cracked and some of the wood is missing. There is a small crack on the left hand side up the leg.',2041,7742,'Qurna, Dra Abu el Naga',' -900','Third Intermediate Period',' -930','H638.b','Foreign Archaeology','coffin lid',''),(84894,'coffin','The coffin has straight sides and is made from wood. It is black with faint painting on the sides. There are six rectangular pegs for attaching it to the lid; there should be eight pegs.',2041,7742,'Qurna, Dra Abu el Naga',' -900','Third Intermediate Period',' -930','H638.c','Foreign Archaeology','coffin base',''),(84051,'razor','A gold coloured flat piece of metal, a tapered rectangular shape with acurved point at one end. A curved wooden handle with a rounded protruding end is attached by three metal rivets.',1742,0,'',' -1295','New Kingdom',' -1550','H2884','Foreign Archaeology','razor',''),(83101,'shabti','Mummiform figurines. Mostly pale brown and grey clay. Roughly moulded. Whole and parts of shabtis. 29 complete or almost complete shabtis and 11 fragments.',2041,7742,'Qurna, Dra Abu el Naga',' -900','Third Intermediate Period',' -930','H3115','Foreign Archaeology','shabti',''),(78578,'shabti','Mummiform figurine with inscriptions. Deep blue shiny faience. Inscribed in purple ink with Third Prophet of Amun Pa. (awaiting final view from Aidan!) Carrying hoes and basket.',1742,7742,'Deir el Bahari',' -945','Third Intermediate Period',' -1069','H3160','Foreign Archaeology','shabti',''),(81135,'flower','3 lotus flowers, dried,  two are charred or covered in bitumen, the other is not, with darker outer petals or sepals, and pale inner petals.',2041,7742,'Qurna, Dra Abu el Naga',' -715','Late Period',' -945','H3896.1','Foreign Archaeology','Nymphaea lotus (Nelumbian speciosa)',''),(83644,'kohl pot','Grey stone pot with flat bottom and two baboons with outstretched arms carved in relief on the sides. It has a flat rim and there are traces of black kohl on the inside.',1742,7742,'Luxor (Thebes)',' -1795','Middle Kingdom',' -1985','H4201','Foreign Archaeology','kohl pot',''),(81136,'shabti box','Tall box made from short wooden planks.',2041,7742,'Qurna, Dra Abu el Naga',' -715','Third Intermediate Period',' -945','Ha5640','Foreign Archaeology','shabti box',''),(85278,'shabti box','Shabti box.  Wooden plank construction,with pegged joints.  Black surface.',2041,7742,'Qurna, Dra Abu el Naga',' -715','Third Intermediate Period',' -945','Ha5641','Foreign Archaeology','shabti box',''),(86000,'shabti','4 shabti fragments + other small pieces. Grey clay.',2041,7742,'Qurna, Dra Abu el Naga',' -715','Late Period',' -945','Ha7396','Foreign Archaeology','shabti',''),(84624,'tomb model','Striding female figure (which leans foward) with a knee-length white garment which goes over the left shoulder. Both arms are missing and would have been attached using pegs (the holes are present in the shoulder). Her skin is yellow and the short wig has been painted brown. The facial features are black and white. The feet taper to a squares point. The paint has worn away in some areas.',1835,7742,'Deir el Bahari, grave of a princess, Deir el Bahari',' -1985','Middle Kingdom',' -2055','H382.b','Foreign Archaeology','tomb model (striding figurine)',''),(83637,'sketch','A limestone fragment with sketches on it.  There is a man with one arm out which was originally drawn in red and then finalised in black. There is also a bird in black (originally in red, mostly rubbed out now) and one very rough sketch of a bird.',1752,7742,'mortuary temple, Deir el Bahari',' -1295','New Kingdom (?)',' -1550','H424','Foreign Archaeology','bird and man sketch',''),(83690,'cornice (furniture?)','A row of uraei (cobras) with sundiscs on a backboard. The uraei are painted in red green and black, the sundiscs are red, pink and black and the backboard is pink with black spots. There are four drilled holes for attaching it to ?a piece of furniture?',1752,0,'',' -1069','New Kingdom',' -1186','H434','Foreign Archaeology','uraei cornice',''),(83333,'figurine','Standing figure of a naked woman with head and feet missing. Her arms are by her side and the breasts are made from cones of clay applied on top of the base. There is an impressed dot for a belly button, and below this is a row of dots which go all around the body. Below this on the front is an incised triangle.',1859,7742,'grave B19, Qurna, Qurna',' -1985','Middle Kingdom',' -2055','H468','Foreign Archaeology','female fertility figurine',''),(83874,'stela','Stele of Inamun Nayesnebu. Creamy-white stone stele, rectangular with a curved top. There are nine columns of carved hieroglyphs above a depiction of the deceased standing in front of an offering tale and pouring a libation to the mummified human-headed god Osiris who holds a flail and a sceptre. The top part of the stele has a winged sun disc with two uraeii (cobras).\n\nTranslation:\nSpeech of Osiris, Chief of Justice, lord of Abydos, that he may give food offerings to the ka.  A royal gift to Osiris that he may give unguent, alabaster, clothing, bread and beer, oxen and fowl for the Osiris Inamennayesneb, the daughter of the beloved of the god, the Wardrobe Master of Min, Ankhefenamun; her mother Payestjauemdunun.',1885,0,'',' -525','Late Period',' -664','H506','Foreign Archaeology','stela of Inamun Nayesnebu',''),(83687,'hoe','Two pieces of wood bound together by rope. One piece is a lead or oar blade shaped and broken at the handle. The other piece a roughly cylindrical handle, again broken and also split, held together by string and wire.',1835,7742,'Qurna',' -1295','New Kingdom',' -1550','H1706','Foreign Archaeology','hoe',''),(84021,'chisel','Rectangular metal chisel with curved blade, set into a bulbous wooden handle. The wood is generally smooth, although knots are visible and there is a small crack along the grain down one side.',1752,0,'',' -1295','New Kingdom',' -1550','H1708','Foreign Archaeology','chisel',''),(83785,'funerary cone','A cone of red clay with a text of hieroglyphs stamped on the bottom.\n\n\nTranslation (of name only):\n\'Rameses, Son of Thes Mashti, treasurer of King Taharkan\'.',1835,0,'',' -664','Late Period',' -690','H2359','Foreign Archaeology','funerary cone',''),(83786,'funerary cone','A cone of red clay with a text of hieroglyphs stamped on the bottom. The point of the cone is missing.\n\n\nTranslation (of name only):\n\'Rameses, Son of Thes Mashti, treasurer of King Taharkan\'. (Taharqa).',1835,0,'',' -664','Late Period',' -690','H2361','Foreign Archaeology','funerary cone',''),(84048,'spinning top','A roughly circular peg with a conical bottom and a flat point.',1885,0,'',' 395','Roman Period (?)',' -30','H2435','Foreign Archaeology','peg top',''),(84693,'necklace','A string of very fine blue cylinder beads.',1752,7742,'grave A14, Qurna, Qurna',' -1985','Middle Kingdom',' -2055','H3402','Foreign Archaeology','faience necklace',''),(84913,'coffin','The lid of a coffin, anthropomorphic with painted decoration and block feet. The wig is painted black and a beaded collar is painted on around the neck and chest. The paint is in poor condition.',1885,0,'',' -550','Late Period',' -720','Ha6140.2','Foreign Archaeology','coffin lid',''),(79510,'food','A (modern) box of wheat with some fragments of plaster and other debris.',1742,7742,'grave',' ','',' ','Ha6025.1','Foreign Archaeology','wheat',''),(86249,'coffin','Outer \'white coffin\' base of lady Taay or Tay. Tall outer coffin with a plain inside and faded painted decoration on the outside. The decoration consists of columns of hieroglyphs and profile of gods and men. There are rectangular holes for attaching the lid by wooden pegs. The coffin\'s top slopes down towards the feet where it is damaged. Trough only.',1886,0,'',' -1480','New Kingdom',' -1520','H630.1','Foreign Archaeology','outer white coffin base of lady Taay or Tay',''),(83692,'headrest','Wooden headrest with flat base and curved rest for the head, the same width as the base. The base and neck are all one piece and has an integral square peg into which the rest sits.',1752,0,'',' ','',' 1891-11-04','H4149','Foreign Archaeology','headrest',''),(83649,'stick','A slightly curved piece of wood with one straight end and one splayed and curved end. The cross-section of the object is oval.',1742,0,'',' ','',' ','H4015','Foreign Archaeology','throwstick',''),(78747,'shabti','A mummiform figurine with inscription. Deep blue shiny faience. Carrying hoes and basket.\n\n\nInscribed \'Sehedj, the Osiris, the God\'s Wife, Maatkare.\' (Dodson 2004)',1741,7742,'Grave TT320, Deir el Bahari',' ','Third Intermediate Period',' 1039-991 BC - 21st Dynasty - Psusennes I','H4046','Foreign Archaeology','shabti',''),(83751,'headrest','Dark wooden headrest made in 2 parts. The top is curved, with chipped ends and a tapering neck underneath and attached to the base by a hole for the square peg. The base has a flat bottom and a tall neck with square peg. There are a few old woodworm holes, especially in the top part.',1742,0,'',' -1650','Old Kingdom - First Intermediate Period - Middle Kingdom',' -2686','H4150','Foreign Archaeology','headrest',''),(84459,'axe','Bell shaped axe head with curved blade, attached to a straight wooden handle (original) by leather thonging. The handle has a flared bottom end.',1835,0,'',' -1186','New Kingdom (?)',' -1295','H4014','Foreign Archaeology','battle axe',''),(84652,'shabti','Mummiform figure with deep blue glaze. The arms are crossed across the chest, holding a painted hoe in each hand and a basket over the right shoulder. They have a long dark blue wig with possibly a uraeus (cobra) moulded on the hairline, there is an inscription in (painted) hieroglyphs down the front of the figure.',1752,7742,'royal cache (?), Deir el Bahari?, Deir el Bahari',' -945','Third Intermediate Period',' -1069','H4045','Foreign Archaeology','shabti',''),(83011,'figurine','A carved figure of a mummified man on a separate rectangular base. Mortice and tenon joint fits the two parts together.  It is painted black. Hole in the top of the head for missing headdress.  Beard broken off.',2041,7742,'Qurna, Dra Abu el Naga',' -715','Third Intermediate Period',' -945','H429','Foreign Archaeology','Ptah-Sokar-Osiris figurine',''),(84915,'human remains','A human male mummified adult (unwrapped). The man was called Djed-Khonsu-iu-ankh. Most of the bandages are missing and his stomach has caved in.  The stomach cavity was filled with mud, the skin is broken off in places.  The chest cavity has collapsed. The neck shows wrinkles where the bandages squeezed the flesh. The head is angled back, with the mouth open. The fingers were individually wrapped. The mummified body has been unwrapped, though the last layers of bandages remain in places where they were stuck with resin. The feet were broken off and not unwrapped: they lie at the bottom of the case.\nThe tissue is smooth and very dark.  The body was damaged (? post-unwrapping) around the stomach and hips, and the pelvic bone is partially visible.\nOld fragments of glass were discovered amongst the bandaging (from time of unwrapping?) (15/04/2008).',1772,0,'',' -550','Late Period',' -625','H5074.3','Foreign Archaeology','unwrapped male mummy of Djed-Khonsu-iu-ankh',''),(84893,'human remains','An adult human body; mummified & wrapped in linen bandages. He is wrapped in wide, pale strips of linen with thin beige bands around the torso and legs. X-rays of the mummified body show that it is the body of a man, about 5\'6\" tall, who died at the age of about 39. His bones and teeth are in good condition and there is nothing to suggest the cause of his death.',2041,7742,'Qurna, Dra Abu el Naga',' -900','Third Intermediate Period',' -930','H638.a','Foreign Archaeology','adult mummy',''),(84917,'coffin','The base of a coffin. Inscribed with hieroglyphs inside. The shoulders of the coffin have been enlarged to fit the body. Stained [with resin?] between the shoulders.',1886,0,'',' -640','Late Period',' -675','H4555.2','Foreign Archaeology','coffin case of Inamun Nayesnebu',''),(79566,'coffin','An anthropomorphic wooden coffin lid. It is painted to look like it has long, dark hair and the face is painted white-cream. The feet are on a block. There are red and cream columns of hieroglyphs interspersed with the profiles of figures. The columns run down the coffin, and along the sides. There are beaded collars painted around the chest. The owner of the coffin was called Inamun Nayesnebu.',1886,0,'',' -640','Late Period',' -675','H4555.1','Foreign Archaeology','coffin lid of Inamun Nayesnebu',''),(83972,'coffin','An anthropomorphic wooden coffin lid. It has long, striped hair painted in green, yellow and red and a red-brown face. There are columns and rows of hieroglyphs on the torso and legs. There are stripes around the edge, and columns on the feet. There are pegs which hang down from the lid to guide it into the base.',1886,0,'',' -675','Third Intermediate Period - Late Period',' -710','H4556.1','Foreign Archaeology','coffin lid of Payankhnedjemben',''),(83639,'stela','Rectangular wooden stele with rounded top. Decorated on one side. At the top there is a winged sundisc (blue, red, green) with uraei (red and yellow) and eyes (red, blue, black). Below this there are five (5) short vertical columns of hieroglyphs (black writing on a yellow background with green column dividers). The scene which takes up the bottom two thirds of the stele shows a seated mummiform bird-headed god (white, green, gold, red and blue) with sun disc (white, black and red) being given offering by the tomb owner (who wears the leopard skin of a priest - yellow, black, white and red-brown skin). A table of offerings stands between them. The paint is chipped and there are cracks along the grain of the wood especially near the edges of the stele.\n\n\nTranslation:\nSpeech of Re-Harakhty, chief of the Gods, may he give\nfood offerings to the ka of the Osiris, the Great Priest of\nAmun in Karnak, one truly precise and regular in observance of the\nhouse of Amun,  Pedimut, son of Hori true of voice\n(Dodson, Aidan)',1835,7742,'grave in the Ramesseum',' -747','Third Intermediate Period - Late Period',' -1069','H4586','Foreign Archaeology','stela of Hor',''),(83688,'coffin fitting','Clenched right hand with thumb sticking out. The hand has a flat back and was fixed to the coffin by two pegs, there are two drilled holes in the hand. The carved part of the hand has been painted cream with red details, some paint is missing.',1752,0,'',' ','',' ','H2439','Foreign Archaeology','carved hand coffin fitting',''),(83513,'scarab','Translucent red piece stone carved in the shape of a scarab beetle with a flat bottom and a hole through the centre from head to tail. There are wide cross hatched lines on the base of the scarab.',1752,0,'',' ','',' ','H4912','Foreign Archaeology','scarab',''),(146451,'bowl','Bowl with painted decoration.',6228,0,'',' ','',' ','E5861','Ethnography','',''),(8933,'Pale-throated sloth','',94,0,'',' ','',' ','Aa769','Biology','Pale-throated sloth',''),(1705,'Paradoxical Frog Tadpole','',94,0,'',' ','',' ','Aa3198','Biology','Paradoxical Frog Tadpole',''),(1706,'Paradoxical Frog Tadpole','',94,0,'',' ','',' ','Aa3199','Biology','Paradoxical Frog Tadpole',''),(25172,'Fossil','',526,1945,'Pensford Colliery, 1,900 ft below',' ','',' ','Cb4024','Palaeontology','',''),(146141,'stamp','Terracotta paint stamp.',3475,0,'',' ','',' ','E5080','Ethnography','',''),(122912,'paperweight','faceted weight with scattered millefiori canes on blue & white jasper ground',4532,11963,'Baccarat (perhaps)',' ','',' 1845-1899','G2486','Applied Art','',''),(25022,'Fossil','',526,6298,'Llanfawr Quarry, Llandrindod Wells',' ','',' ','Cb4816','Palaeontology','',''),(25017,'Fossil','',526,6298,'Llanfawr Quarry,',' ','',' ','Cb5058','Palaeontology','',''),(25018,'Fossil','',526,6298,'Llanfawr Quarry',' ','',' ','Cb5059','Palaeontology','',''),(79947,'vessel, vessel lid','This is the fitting lid of a powder Corinthian pyxis, wrongly associated with a flanged flat lid. It has a cylindrical shape with rimmed top. The upper surface has incised thin concentric circular ridges around the outside and a small button sape in the centre. . The outside is painted with a black and red geometric pattern, of triangles, wavy lines, vertical lines, and bands. The upper surface is decorated with dotted and red and black floral motifs in the centre. the inside is  reserved.\nThe other lid associated with it is a Corinthian flat lid with flange underneath.. The top has a large circular knob in the centre. The outside is decorated with a raised circular and symbol shape pattern on the handle, and a black and red concentric circle pattern on the top.',6228,0,'',' -574','',' -616','H1205.A&B','Foreign Archaeology','Corinthian powder pyxis lid',''),(146150,'figurine','Figurine.',3475,0,'',' ','',' ','E4924','Ethnography','',''),(79711,'statue','Large granite statue. Grey/ pink stone with black marbelling. Carving of the head and shoulders of a woman (the Syrian goddess Anat). She wears an atef crown (conical crown flanked by a feather on each side). The feathers have incised line decoration and the right-hand feather\'s edge is damaged. There is an inscription on the back of the statue.',1902,8128,'Ruins of the Temple of Bubastis',' -1186','New Kingdom',' -1295','H798','Foreign Archaeology','Anat statue',''),(32353,'Haematite Kidney ore','',526,375,'?Queensland',' ','',' ','Da5189','Palaeontology','',''),(34263,'Molybdenite','',526,375,'New South Wales',' ','',' ','Da5915','Palaeontology','',''),(9252,'Rock Dove','',101,0,'',' ','',' 1867-1924 (circa)','Aa2567','Biology','Rock Dove',''),(157705,'table decoration','Pot of flowers table decoration. Made from the lower part of a 340ml. \"Black Label beer\" can with plastic flowers arranged inside. The flowers are made from various soft drink labels- \"Sprite\", \"Fanta\" etc.',7758,0,'',' 1993','',' 1993','Eb302','Ethnography','',''),(25112,'Fossil','',526,14598,'old quarry, nr Llangoven, 4 mls SW of Monmouth',' ','',' ','Cb5107','Palaeontology','','462066'),(154253,'lamp','Oil lamp made from tin cans and an old light bulb.',7758,0,'',' ','',' 1990-11-04','Ea12507','Ethnography','',''),(32361,'Fossil','',526,0,'',' ','',' ','Da8317','Palaeontology','',''),(34308,'Native Carbon, Graphite','',526,9909,'Madurogoda',' ','',' ','Da9258','Palaeontology','',''),(92669,'axehead, polished','Mottled-grey polished flint axehead, pointed butt and trapezoid outline with curved cutting edge. \'1911\' written on body of axehead.',7758,9593,'River Thames',' ','',' ','FT6683','British Archaeology','',''),(127649,'tea jar','Of rectangular straight-sided section, the ends bowed with concave corners; serpentine shoulders and short cylindrical neck; flat base.\nSides moulded with relief figures, overpainted in coloured enamels: on one side, a \'Macaroni\' with blue hat perched on tall hair-do; he wears lilac coat, yellow waistcoat and brown breeches, a sword and holds a stick with blue tassel; his conventionally-dressed footman with yellow coat, brown waistcoat, blue breeches and holding tricorn hat is at his right elbow.  On other side, a fashionably dressed lady in brown dress, yellow petticoat and side ringlets, holding bunch of flowers either stands in front of tree or sports green feathers in her headdress; her maidservant in blue skirt at her left elbow.  On ends, stylised leaf meander and corner details, similar detailing at base of neck.  Concave corners painted yellow, all edges detailed in blue.',4240,12198,'',' ','',' 1790','Na1358.i','Applied Art','',''),(122610,'coffee pot & cover','Rotund baluster shape on pedestal foot, plain loop handle, upright \'S\' spout.  High-domed cover rising from narrow edge surround,  knob finial.\nOverglaze-painted in red, pink, green, blue. On each side, a flower spray within a circular garland of four rose heads alternating with four 2-flower-&-4-leaf sprays.  Pink diaper trellis border above hatched inverted triangles; blue line around foot, blue detailing on spout and handle.  Cover has blue line inside edge with inverted pink trellis border, six leaf sprigs and blue detailing on finial.',4240,12198,'',' ','',' 1790','G596','Applied Art','',''),(150477,'Fossil','Head and most of postcrannial skeleton