lied Art','',''),(124586,'jug, cream','Baluster shape sparrow-beak jug with plain loop handle with groove down centre.\nPrinted in black and overpainted in red, yellow, green, blue, purple, brown and gilding: to left of handle, seated Chinese figure in green robe drinks at a table on which stands vase of flowers, standing figure in blue and purple robe stands behind, a large vase of flowers on the floor;  to right of handle, Chinese figure with fan in front of willow in vase,  and another figure holding tray of cups, a child clutching ?her legs;  under lip, a vase of scrolls on a tall table.  Inside rim, red line above scalloped line with dots below.',4240,12082,'',' ','',' 1760','N4004','Applied Art','',''),(126275,'teapot & cover','Wide-shouldered body tapering down to narrow base with flat footrim, the top curving in to rudimentary \'neck\'; eight-faceted spout, moulded high-loop handle.  Cover low-domed from flat border; flower finial with two leaves.  Pierced with five holes for spout strainer.\nPainted in underglaze blue with \'The Thrush\' pattern: three birds perched on forked branch rising from tree stump, grassy hillocks below; opposite five main plus other flying birds, two more on spout, four on cover with other rudimentary birds.',4240,12082,'',' ','',' 1760','N8230','Applied Art','',''),(124563,'mug','Straight-sided cylindrical with slight flare to base;  moulded loop handle with three ridges.\nOverglaze black transfer print: King of Prussia: to left of handle, a cherub holds out garland to a male head and shoulders in armour with ermine lined cloak, body turned to his right, face turned forward, left arm points to  military trophy of gun barrel, drum and flags inscribed \'Reisberg/Prague/Collin\', \'Welham/Rossbach/Breslaw\', \'Neumark/Lissa/Breslaw\'.  On other side of trophy, a flying angel blowing two trumpets.',4240,12082,'',' ','',' 1757','N3980','Applied Art','',''),(125030,'saucer','impressed pattern, underglaze blue',4372,12082,'',' ','',' 1765','N4888','Applied Art','',''),(120470,'plate','Circular plate with sloped flange and shallow well.\nPainted in onglaze enamels and gilding:\nArmorial;  in well, coat of arms: shield divided vertically, in left half 2 red chevrons on gold [Or, two chevronels gules];  in right half, three owls on black diagonal band [Argent, on a bend sable three owls of the field]; lion and griffin supporters both with blue collars with three gilt crescents [Supporters, Dexter a lion or, gorged with a collar and having a line reflexed over the back azure, the collar charged with three crescents of the first; sinister, a griffin, wings elevated argent beaked and membered azure collared and lined as the dexter]; crest of lion and pillar emerging from coronet [Crest, A lion rampant proper, supporting a column or]; motto: \' PREST POUR MON PAIS \'.\nGilt border: overlapping lozenges, alternate ones enclosing a trefoil and three dots; hatching.',4206,12082,'',' ','',' 1807','G234','Applied Art','',''),(120625,'sauceboat','scroll work & basket design',4269,12082,'',' ','',' 1770','G445','Applied Art','',''),(122928,'vase & cover','',4372,12082,'',' ','',' 1755','G2746','Applied Art','',''),(123326,'cup, tea, & saucer','',4292,12082,'',' ','',' 1807-1813','N41','Applied Art','',''),(123339,'cup, tea, & saucer','green edge',4269,12082,'',' ','',' 1770','N66','Applied Art','',''),(123340,'cup, tea, & saucer','Ogee form, spirally fluted; plain handle with small in-curl above base.\nPainted in underglaze blue and gilt. Band of gilt deep leaf festoons with swags between, depending from leaf scroll border with pendant dots within each festoon; above each swag, a blue area cross-hatched & dotted in gilt. Gilt & blue garter-type star in centre of saucer & inside cup. Gilt rims, band around foot, detailing on handle and scalloped circle around centre of saucer; inside cup a narrow border of gilt conjoined arcs with downward trefoil at each junction.',4429,12082,'',' ','',' 1785-1800','N67','Applie