,12026,'',' ','',' 1902','N6955','Applied Art','',''),(84673,'palette','Flat grey and beige palette, rhomboid shape with a dip in the centre of one side where the grinding has taken place.',1742,8226,'El Kab (?)',' -3100','Pre-dynastic Period',' -5500','H4217','Foreign Archaeology','rhomboid palette',''),(83655,'kohl pot','High shouldered vase with flat base and a lip at the rim and around the base. The lid consists of a circular washer with a hole in the centre which has a rim that fits into the top of the vase. The lid proper is circular and slightly domed and has a raised portion in the centre which fits into the washer. The inside of the vase is coated in black powder (kohl).',1752,0,'',' -1795','Middle Kingdom',' -1985','H1614','Foreign Archaeology','kohl pot',''),(153486,'water pot','Plastic water pot. Blue and white striped pattern over the body, with a yellow lid.',7758,0,'',' ','',' ','Ea12460','Ethnography','',''),(125359,'mustard pot','Straight-sided cylindrical with reeding around base and rim; reeded scroll handle with pendant below upper join; barely-domed cover with three incised lines around edge; hinged above handle, an upright round thumb-piece by which to open it; spoon slot. Large circular piece cut out from base.\nPlain cylindrical blue glass liner.\nEngraved opposite handle: \' WEH \'.',4385,13472,'(assayed in Newcastle-on-Tyne)',' ','',' 1800','N5869','Applied Art','',''),(122609,'scent flask','Opaque-white glass with enamelled decoration.  Flattened double-gourd shape on uneven base with rough pontil mark.\nEnamelled decoration: on one face, a bouquet of flowers - rose, daffodil etc - tiedwith purple ribbon; on opposite face, inscription \'M*Davidson\' in black within surround of yellow scrolls at left, green leaves in centre, blue scrolls and rays at right; purple detailing around mouth.',4493,13472,'',' ','',' 1780','G593','Applied Art','',''),(74971,'Fossil','',526,12037,'South Limburg',' ','',' ','Cb5600','Palaeontology','',''),(125085,'tile picture','Panel of tiles making up picture of flower vase painted in manganese purple.',4236,12037,'',' ','',' ','N5046','Applied Art','',''),(25036,'Fossil','',526,6306,'Pencerrig, nr. Builth',' ','',' ','Cb5063','Palaeontology','',''),(9058,'Thylacine','',290,0,'',' ','',' 1867-1924 (circa)','Aa1637','Biology','Thylacine',''),(124479,'decanter label','In form of a vine leaf with stalk; matted surface, the veins polished. Suspension chain attached to scrolling tendrils at top corners. Pierced in arc: \' MADEIRA\'.',4426,11972,'',' ','',' 1828-1829','N7079','Applied Art','',''),(127377,'coaster','Straight-sided with everted rim and base moulding around a turned wood base. Heavily embossed with foliate scrolls and flowers.',4391,11972,'',' ','',' 1819-1820','Na929','Applied Art','',''),(122372,'casket, \\\'Freedom\\\'','Electro-gilded.\n\n\n\n\n\n\nInscription: \' Presented to // The Hon.Andrew Fisher, // by the // LORD MAYOR ALDERMEN & BURGESSES // of the CITY OF BRISTOL // on his admission as // Honorary Freeman // OF THE CITY // June 7th 1911 \'',4476,11972,'',' ','',' 1911','Na1759','Applied Art','',''),(121678,'salver','Circular with bold egg-and-tongue border, raised on ? shell-scroll feet.\nEngraved inscription in various scripts in centre, within a foliate-scroll surround:\n\' Presented // by // Henry Haffey Esqre of Bath // to // Mr Joseph Walter Masey of Bristol. // As a small acknowledgement for his // disinterested and correct conduct // during a Period of Ten Years // as his Agent in Bristol // 10th Novr 1827. \'',4387,11972,'',' ','',' 1827-1828','Na1781','Applied Art','',''),(125299,'spoon, soup','\'Studio\' pattern: round, shallow polished bowl; stem tapered out to rounded end and with textured finish.\n\n\nIn original box with brown card slip cover; box black with green interior; exterior printed \'viners STUDIO\' \'6 SOUP SPOONS\' and \'STUDIO 18/8 STAINLESS STEEL DESIGNED BY GERALD BENNEY, DES., R.C.A. // VINERS OF SHEFFIELD, ENGLAND\'',4396,11972,'',' 1966','',' 1964','Na2335.1','Applied Art','',''),(125296,'spoon, serving','',4396,11972,'',' ','',' 1960','NX1244','Applied Art','',''),(121798,'mug','Baluster shape on circular pedestal foot with moulded edge; double-scroll handle with leaf thumbrest.',4396,11972,'',' ','',' 2005','NX1245','Applied Art','',''),(126017,'basket','Circular, with shaped edge and deep centre well, on circular scalloped foot.  Cast swing handle with scrolls and leaves and plain oval at centre top.  Sides of basket pierced and heavily embossed with cast ornament: scrolls, flowers, shells, vine leaves and grapes, diapering, all on various matted grounds. Bottom of well plain.',4656,11972,'',' ','',' 1835-1836','N7698','Applied Art','',''),(126032,'teapot & cover','Depressed globular form on shaped circular pedestal foot; at the top, a concave neck with projecting leaf collar below a convex shoulder. \'S\'-curved spout; squared-section loop handle with anthemion thumb-rest, the upper terminal tight-scrolled; ivory collars.  Cover hinged above handle, domed in centre, flower knop.\nAll-over chased decoration: flowers & leaves below knop; flowers, leaves, vine leaves, grapes on shoulder; flower/scroll meander on matted ground on body. Flowers/scrolls on spout, scalloped border around base of spout.\nScrolled cartouche in centre of one side with a piece of silver soldered over a ?monogram.',4270,11972,'',' ','',' 1823-1824','N7709','Applied Art','',''),(120574,'plate','Circular plate with gadrooned rim.\nUnderglaze blue printed, overpainted in red and gilt.  Central medallion of Edward VII in naval uniform, inscribed below \'KING EDWARD VII, receiving the Address at the Council House\' , laurel branches above, the whole encircled by \'OPENING OF THE \"ROYAL EDWARD\" DOCK AVONMOUTH BY THEIR MAJESTIES.JULY 9TH 1908\'.  Border design of 12 cartouches reserved on ground design incorporating rose, thistle, shamrock: at top \'ER / VII\' below crown, at bottom Royal arms and motto; rest bear arms of Commonwealth countries, clockwise from top: \'AUSTRALIA\', \'NEW ZEALAND\', \'INDIA\', \'CEYLON\', \'BURMAH\', \'WEST INDIES\', \'HONG KONG\', \'AFRICA\', \'GIBRALTAR\', \'CANADA\',  NZ, Burma, HK, Gib, surmounted by Union Jack.',4206,11839,'',' ','',' 1908','G327','Applied Art','',''),(91086,'brooch, Greek spectacle','Bronze Greek spectacle brooch with four spirals of thin circular bronze.',7758,0,'',' ','',' ','FT1085','British Archaeology','',''),(64030,'Fossil','',526,6372,'cast of specimen from Charnwood Forest',' ','',' ','Cb5012','Palaeontology','',''),(62441,'Fossil','',526,6372,'cast of specimen from Charnwood Forest',' ','',' ','Cb5013','Palaeontology','',''),(83728,'tomb model','A squatting male figure. His arms are proportionately very long and are attached by pegs with a hole drilled in the palm for holding something. One arm is now detached. The paint is coming off in many areas, and the figure has a white base coat, with red-brown skin, white clothing, a black wig and facial features apart from the eyes which are black and white. There is a hole in the base for attaching the figure to a base.\n\n\nNow on sailing boat H4595.',1765,2836,'grave 275',' ','Middle Kingdom',' 2055-1795 BC - 11th Dynasty - 12th Dynasty','Ha7374.1','Foreign Archaeology','tomb model (human figurine)',''),(79641,'walking stick','A stick with a flat ends. There is a metal band one third of the way along. Originally covered with bark which has traces of decoration - only small pieces of bark remain.',1898,0,'',' 1795','Middle Kingdom',' 1985','H1633','Foreign Archaeology','walking stick',''),(86355,'animal remains','Mummified cat in three colour tone linen wrappings with different textures which are arranged alternately around the body, the head has painted features with black depicting the eyes and mouth, and the forehead has a painted pattern of dots and stripes in black and red, the ears are modelled in linen. The skeleton inside fills the mummy bundle completely and is intact and fully articulated.',1770,0,'',' -332','Middle Kingdom',' -747','Ha6357','Foreign Archaeology','cat mummy',''),(82590,'bow (weapon)','A carved wood bow with a circular cross-section and tapered ends. It is almost straight.',1742,0,'',' -1795','Middle Kingdom',' -1985','H1631','Foreign Archaeology','bow',''),(83508,'tomb model','A model of a sailing boat, with curved bottom, curled stern (broken) and point prow. There are currently four standing figures with one leg in front of the other, one standing with legs together and one kneeling. The photograph (University of Liverpool B.507) indicates that there were originally two kneeling figures, one holding the oar or rudder. There are also two poles. The boat and figures are mainly painted in red-brown and cream with some black detail.',1742,2836,'Grave 275a, Tomb of Tchay',' -1985','Middle Kingdom',' -2055','H4595','Foreign Archaeology','sailing boat (tomb model)',''),(83514,'tomb model','This tomb group is attached by pegs to a wooden base which is in two parts, one plank is longer than the other.\nCurrently there are four figures attached to the base. One is leaning over a vat (roughly hollowed cylinder) and would have held a stick to stir it with. Another is leaning forwards; one is standing nearby. The fourth is kneeling and should be facing the pile of loaves which are being cooked over a fire (it looks like a brown pine cone). In addition there is a loose item, straight with curved ends and two indents and drilled holes, which is unlikely to be part of this model. With this is a standing man, feet together, a red beer vat with white top and two quern stones, rectangular with a notch on the top.',1742,2836,'grave 275a',' -1985','Middle Kingdom (early)',' -2055','H4596','Foreign Archaeology','brewery and bakery tomb model',''),(84034,'tomb model','Standing male figure with long white kilt. The legs are separate below the knee, but the feet are missing. The arms are attached separately and they hold a white cylindrical object with black bands around it (possibly a bucket). His skin is red-brown and his short wig is painted black. His eyes have been painted in black and white.',1835,2836,'grave 275',' -1795','Middle Kingdom',' -2055','H4598','Foreign Archaeology','granary worker model',''),(84429,'tomb model','Striding figure with kegs missing below the knees. The arms are attached by wooden pegs, the right arm is missing and the left hand has a drilled hole in the palm. He wears a long white kilt with a triangular pleat at the front. His skin is pale red and there are three folds of fat modelled on his belly as well as pectoral muscles. The face is finely carved and painted. At the top of his head there are remains of a yellow cap or wig with black spots.',1835,2836,'grave 188',' -1650','Middle Kingdom',' -2055','H4599','Foreign Archaeology','tomb model (servant figurine)',''),(83609,'figurine','Standing or striding tomb figure, with separate legs below the knee-length kilt. The arms and legs are broken off at the bottom of each. The figure has a cream undercoat with a white painted kilt, red-brown skin and a black short wig and black facial features. The upper torso especially has dark accretions and much of the red paint appears uneven.',1835,0,'',' -1795','Middle Kingdom',' -2055','H4603','Foreign Archaeology','standing human tomb figurine',''),(84028,'awl','Rectangular body which tapers to a square end (which would have been in a wooden handle), and tapers to a splayed point for making holes.',1752,0,'',' -1295','New Kingdom',' -1550','H1683','Foreign Archaeology','awl/ drill',''),(83001,'shabti','Mummiform figurine with traces of black and brown painted inscription. Pale green matt faience, now mostly pale brown. Carrying hoes and basket. Slender shabti. Inscription almost illegible (Dodson 2006)',1741,0,'',' ','Third Intermediate Period',' 1069-715 BC - 21st Dynasty - 22nd Dynasty','Ha6868','Foreign Archaeology','shabti',''),(74996,'Fossil','',526,7645,'Snowdon Quarry',' ','',' ','Cb3423','Palaeontology','',''),(80229,'figurine','Pale orange clay figurine; Boetian. Moulded into the form of a figure with a large beak like face and a small plumed headress. It holds two short pointed wing- like arms to each side, and has a long robe. It has lined black painted decoration and wears a black painted necklace.',7758,7905,'Boeotia',' -549','',' -576','Ha7486','Foreign Archaeology','boeotian figurine',''),(85863,'bottle','Attic red figure clay squat lekythos with a circular base, squat body and a funnel shaped opening with a small looped handle on one side. It has a black glaze apart from a sphinx, a crouching animal figure with a tail and wings and the head of a woman. Below it is a thin dot and semicircle frieze.',6228,0,'',' -399','',' -401','H809','Foreign Archaeology','Attic red figure lekythos',''),(79912,'vase (miniature)','16 miniature vessels: \n13 have  a cup shape with high pedestal base. One of these has traces of a handle on one side.\n2 are of a shallow bowl shape with a 2 small handles\nOne is a jug shaped with an almost cylindrical body and a large ribbon handle with two triangular projections on either side.\nThe other has a situla shape, a basket with arching handle.',6228,7905,'Eleusis',' ','',' ','H922','Foreign Archaeology','vase (miniature)',''),(125798,'scent bottle, miniature','clear glass, trailed white; on one side a heart & \'A B\'; on other side \'Jan.17 1818\'',4484,0,'',' ','',' 1818, dated','N7069','Applied Art','',''),(86603,'vase','Ornate apulian red-figure clay loutrophoros vase. Black glaze with red/brown and white and orange painted decoration. It has a circular pedestal type base (pale orange clay colour) leading into a large barrel shaped body widening at either end. It has a tall neck leading into a wide disc shape opening. There are 2 ornate scrolled handles looped on either side, along the length of the neck. Each handles have 2 projections at each ends and a circular decoration. The top circles show the head and neck of a woman in white.\nThe whle body is covered with intense decoration, apart from the base. The body is split into two scenes (top and bottom) split by friezes of repeated palmette, scrolls, floral, dots, meander pattern, and semi circles and dots repeated.The bottom scene depicts (on one side) a woman seated within a naiskos. The woman is seated on a small column and holds a fan in one hand and rests on the other hand, dressed in a robe. She is flanked on either side by two women seated, holding different objects - a box, mirror shaped object, etc. They are both robed and have white painted details, flanked on either side by large palmettes and scrolls.\nThe other side is not visible from the cabinet.\nThe top of the body is decorated with scrolls and palmettes in red on one side. The other side shows the head and neck of a woman in the centre surrounded by circles, whirls scrolls and floral motifs.\nThe neck has various bands of decoration. Central is a feather shape repeated in rows. Others are friezes of semicircles, dots, circles, lines, leaves, with white and orange painted decoration. The handles have a black and white wave patterns on either side. Rim around top has a repeated geometric white painted pattern.\nThe lid has a circular bottom, with a rim underneath to fit into the top of the vase. It has a black glaze and has a tall knob in the centre (left the clay colour). On the outside of the lid there is a wave and dot frieze around the edges. The scene depicted include a male, nude youth, seated and winged holding a circular mirror type object in his hand, and a 2 women on either side, clad in robes.. These figures are interspersed between dots, floral crosses, a box, with a bit of white painted decoration.',6228,7935,'',' -300','',' -330','Fa562','Foreign Archaeology','loutrophoros',''),(25086,'Fossil','',526,6327,'Ogwel Quarry,',' ','',' ','Cb3721','Palaeontology','sponge',''),(25094,'Fossil','',526,6327,'Woolborough Quarry.',' ','',' ','Cb3723','Palaeontology','',''),(25091,'Fossil','',526,6329,'near',' ','',' ','Cb3523','Palaeontology','',''),(121791,'plate','Circular plate, Britton shape F.\nPainted in manganese purple on an off-white glaze: manganese powder ground reserving central hexagon and, on flange and well side, three lozenge and three carnation reserves. Central hexagon inscribed: \' 1 // When thou sit // down to meat // 1739 \'. Lozenge at top of plate inscribed \' L // B C //1739 \'; other two lozenges contain flower sprig. Red-brown rim edge.',4407,12496,'',' ','',' 1739','G170.1','Applied Art','',''),(121812,'plate','Circular plate, Britton shape F.\nPainted in manganese purple on an off-white glaze: manganese powder ground reserving central hexagon and, on flange and well side, three lozenge and three carnation reserves. Central hexagon inscribed: \' 2 // Give thanks // before thou eat // 1739 \'. Lozenge at top of plate inscribed \' L // B C //1739 \'; other two lozenges contain flower sprig. Red-brown rim edge.',4407,12496,'',' ','',' 1739','G170.2','Applied Art','',''),(121789,'cup: tea bowl','Tapered sides rounded into short foot. Decorated in manganese purple and blue on an off-white glaze: four hexagonal reserves on a powdered manganese ground, each containing a single flower stem.',4407,12496,'',' ','',' 1740-1770','G1179','Applied Art','',''),(121790,'waster','Pile of plates which collapsed in the kiln and fused together; traces of blue mimosa decoration.',4407,11819,'\\Wincanton\\ (made at Bristol or Wincanton)',' 1750','',' 1735','G2613','Applied Art','',''),(124069,'dish','Britton shape I. Painted in blue, red, green on off-white glaze: in centre a pagoda behind a chinoiserie fence, tall trees on right; wide border comprising blue ground reserving eight round panels each containing a Chinese temple and a ?flagstaff. Greyish glaze on back.',4407,11819,'\\Wincanton\\ (made at Bristol or Wincanton)',' 1750','',' 1735','N3157','Applied Art','',''),(121857,'vase','Ovoid shape with short neck above rounded shoulder. Painted in blue on a white glaze: five horizontal bands painted with mimosa sprays, the bands delineated by double lines; Chinese scrolls on neck.',4407,12496,'',' ','',' 1740-1760','N3755','Applied Art','',''),(121811,'dish','Circular dish, Britton shape I.\nPainted in manganese purple on pale bluish glaze with a pink tinge on back: rim-to-rim scene of a man and woman in a landscape, woman with back to viewer and right arm pointing; tall sponged-foliage tree on left, smaller ditto in right mid-ground;  hills and two buildings in background, ground flora in foreground.',4407,11819,'\\Wincanton\\ (made at Bristol or Wincanton)',' 1750','',' 1735','N3875','Applied Art','',''),(127197,'plate','Masons\' arms',4407,11819,'',' ','',' 1737, dated','Na626','Applied Art','',''),(83273,'spindle','2 spindle whorls.\nLarger whorl is circular and has a hole drilled in the centre, it is flat on one side and rounded on the other. There is a crack which runs through the hole.\nThe smaller is rounded on both sides with a hole in the centre. There are several cracks and one portion is chipped and covered in white.',1752,0,'',' -525','Late Period',' -664','H1373','Foreign Archaeology','spindle whorls',''),(86552,'votive box','A metal box with a twined snake on the top. One short side has a hole in it which has been blocked up with metal.',1770,0,'',' -30','Ptolemaic Period',' 332','H1071.1','Foreign Archaeology','snake votive box',''),(83689,'palette (artists)','A roughly rectangular piece of stone with six parallel indentations on one side and a single large one on the opposite side. Cream-buff in colour.',1752,0,'',' 200','Roman Period',' 101','H924','Foreign Archaeology','artist\'s palette',''),(79422,'spindle whorl','A smooth black pebble with a hole drilled through it (off-centre) and a groove running from the hole to the edge of the stone.',1752,0,'',' -600','Late Period',' -600','H1113','Foreign Archaeology','spindle whorl',''),(34304,'Native Gold','',526,7466,'Ashanti',' ','',' ','Da5181','Palaeontology','',''),(34282,'Bauxite, pisolitic','',526,7466,'Ashanti',' ','',' ','Da5359','Palaeontology','',''),(32357,'Psilomelane','',526,7466,'Tarquah',' ','',' ','Da8195','Palaeontology','',''),(122360,'casket','Rectangular casket on four bracket feet with scroll spandrels; moulded base with shell motifs. Domed lid hinged at back, corner acroteria. At each corner an engaged pillar wound with leaves. Semi-circular panel on front & back, an arch at each side over a Tudor rose and tied leaf stem; on front panel a raised design of winged figure with leaves instead of legs holding 2 scroll stems, flowers and leaves on matted ground; on back panel, inscription. Ends have shell at top, leaves either side within arch; frieze of alternate rosettes and triple lines. Acanthus leaves on top. Surmounted by a moulded pedestal on which stand the arms of Bristol supported by dolphins. Monogram HA twice on lid, \'1899\' at one end; a crest and \'FORTIS IN ARDUIS\' opposite. Engraved inscription:\n\'THIS CASKET // presented to Sit Herbert Ashman Kt // contains a copy of the Letters Patent under the Great Seal of the United Kingdom // CONFERRING THE TITLE OF LORD MAYOR // ON THE CHIEF MAGISTRATE OF THE CITY OF BRISTOL // and an extract from the proceedings of // THE COUNCIL OF THE CITY AND COUNTY OF BRISTOL ON THE 13th JUNE 1899\'.\nInterior lined with pleated and quilted blue silk. Contains rolled illuminated parchment.',4476,12250,'(assayed in Birmingham)',' ','',' 1899-1900','G2208','Applied Art','',''),(126211,'thimble and scent phial','',4393,12250,'',' ','',' 1823-1824','N8107','Applied Art','',''),(126673,'vinaigrette','round with suspension loop; flowers around edge; inside, a pierced, hinged flap enclosing sponge',4393,12250,'',' ','',' 1818','N8957','Applied Art','',''),(122371,'teapot','',4396,12250,'',' 1960','',' 1955','Na2336','Applied Art','',''),(74749,'Fossil','',526,6855,'near',' ','',' ','Cb3882','Palaeontology','',''),(120590,'cup, tea, & saucer','overglaze transfer-printed in black with oriental landscapes',4237,12496,'Temple Back',' ','',' 1840','G355','Applied Art','',''),(134420,'gypsy caravan','Gypsy caravan; horse drawn and used as mobile home; sloping walls and wheels outside a body of beaded tongue-and-groove matchboard and chamfered ribs; decoratively carved exterior; gilding used in conjunction with red, green and yellow paint; interior is elaborately carved as well with a horse\'s head motif positioned over the bed space; the most typical fittings in the Dunton \'Reading\' are the \'Angel\' lamp - named after the cherub motif on the bracket - and the \'Hostess\' stove, compact and enclosed to prevent ash blowing everywhere when the doors are open; cupboards, drawers, beds, seats etc. are designed and fitted for economy of space.',3788,14620,'',' ','',' 1900 (circa)','T8904','Social History','\'Reading\' waggon',''),(126726,'coffee pot & cover','Short cylindrical neck curving into elongated bulbous body which tapers down to base;  projecting semi-circular lip applied to rim; strap handle with centre ridge and thumb piece.\nShiny blue-black glaze with lighter streaks over brown glaze which stands alone on bottom quarter;  sgraffito decoration; 2 lines around shoulders and at base of blue area; between these, three pairs of vertical fish-shaped motifs and one each side of handle, a rough oval in the spaces between these groups.\nCover: domed from sloped surround; strap loop handle with centre ridge; vent hole beneath handle.  Glazed brown inside, blue over brown outside; deep flange clear of glaze on outside.',4240,11940,'',' ','',' 1950','N9027','Applied Art','',''),(25092,'Fossil','',526,5583,'18 mile Creek, Erie Co.',' ','',' ','Cb5098','Palaeontology','',''),(25076,'Fossil','',526,5583,'18 mile Creek, Erie County',' ','',' ','Cb5101','Palaeontology','lampshell',''),(25077,'Fossil','',526,5583,'18 mile Creek, Erie County',' ','',' ','Cb51