gy','bowl',''),(84186,'bowl','A dark red burnished oval bowl with pale slip in a geometric pattern. Part of the bowl is cracked and part of the rim is missing.',1752,7795,'grave B127, Amra (el-) (?)',' -3100','Pre-dynastic Period',' -5500','H715','Foreign Archaeology','bowl',''),(124355,'bowl','Straight-sided black glass bowl with opaque red glass rim and cylindrical foot.  Exterior has lustred finish giving purple-brown colour. Fine air bubbles.  Foot roughly finished.',4588,12002,'',' ','',' 1930','N3545','Applied Art','',''),(124360,'bowl','Wide shallow bowl on flared folded  green foot; bowl  spirally- striped with green and grey-mauve latticinio .                 \nPontil mark beneath foot.',4588,12002,'',' ','',' 1930','N3550','Applied Art','',''),(124362,'candle holder: candlestick','Spirally-striped in green and grey-mauve latticino pattern.  Tulip-shaped nozzle on bowl-shaped drip-pan attached by green spool knop to hollow stem joined by green annular knop to flat foot. Pontil mark.',4588,12002,'',' ','',' 1930','N3552','Applied Art','',''),(78759,'bead','Small number of garnet and turquoise etc. The other beads are made up of a variety of different greens. There are eight garnet beads at each end, and six other beads including the turquoise in the middle. The beads are all different shapes, the middle ones being pointed, whereas the outer ones are flat and round.',2041,7779,'Grave U25',' -3100','Pre-dynastic Period',' -5500','H3367','Foreign Archaeology','bead',''),(83742,'kohl pot','Oval white alabaster bowl with flat base and a long spout. There is a lug in the shape of a trefoil opposite the spout. There is a solid black residue in the base of the bowl, with some stuck to the sides as well.',2041,7779,'grave W38',' -2354','Middle Kingdom',' -2494','H246.1','Foreign Archaeology','spouted kohl pot',''),(83745,'scarab','Crudely modelled scarab with a few lines of incised decoration and a hole drilled through its length. It is pale blue with white inclusions.\nThe base is flat and has a curved incised border with two eyes (of Horus) and eyebrows in the centre with a papyrus sceptre (youth).',2041,7779,'grave W38',' -1795','Middle Kingdom',' -1985','H1141.1','Foreign Archaeology','scarab',''),(83746,'scarab','Crudely modelled scarab with a few lines of incised decoration and a hole drilled through its length.  It is bright medium blue.\nThe base is flat and has a symmetrical scroll pattern.',2041,7779,'grave W38',' -1795','Middle Kingdom',' -1985','H1141.2','Foreign Archaeology','scarab',''),(83747,'scarab','Crudely modelled scarab with a few lines of incised decoration and a hole drilled through its length. It is cream and blue in colour.\nThe base is flat and has a symmetrical scroll pattern with two nefer signs (beauty) in the centre.',2041,7779,'grave W38',' -1795','Middle Kingdom',' -1985','H1141.3','Foreign Archaeology','scarab',''),(83832,'kohl stick','Cream ivory kohl stick with tapering handle and bulbous end. At the base of the bulbous end are 8 parallel grooves around the shaft, the end has 5. All grooves have traces of a black inlay.',2041,7779,'grave W38',' -1795','Middle Kingdom',' -1985','H1356','Foreign Archaeology','kohl stick',''),(83744,'amulet','Bright blue-green amulet in the shape of a cat with a woman\'s head. There is a hole drilled through the cat\'s neck for suspension.',2041,7779,'grave W38',' -1795','Middle Kingdom',' -1985','H3380','Foreign Archaeology','sphinx amulet',''),(83387,'jar','A pale red clay jar with a flat bottom, high shoulders, a short vertical neck with a bevelled rim. Inside the jar is an intergral clay strainer with large holes punched in it. The rim is chipped and two small pieces are with the jar.',1859,0,'',' -3100','Pre-dynastic Period (late)',' -5500','H562','Foreign Archaeology','jar',''),(79651,'jar','A burnished red clay jar with a black top and a flat base.',1859,7779,'grave R130',' -3100','Pre-dynastic Period',' -5500','H672','Foreign Archaeology','black topped vase',''),(9583,'Gyr Falcon','',101,0,'',' ','',' 1902','Aa4555','Biology','Gyrfalcon',''),(74880,'Fossil','',526,7571,'Bearfield',' ','',' ','Cb3985','Palaeontology','',''),(127155,'cup: coffee can & saucer','CAN: straight-sided cylindrical but tapering out slightly to rim; loop handle of rounded section with reverse scroll at base.\nDecorated with gilding and bat-printed landscape in shades of grey to indicates perspective:  landscape, from left wind-blown trees on promontory, man with flag over shoulder walking towards trees from mill house with wheel, a smaller building behind, tree; foreground knoll separated from scene by water, more water and hills in background.  Gilt band and line below rim, gilt band above base, gilt foliate stem and outlining on handle.\n\n\nSAUCER: circular with sloped flange and wide well.\nGilt band and line inside rim, gilt line within well.',4240,11851,'',' ','',' 1810','Na498','Applied Art','',''),(123308,'teapot, \\\'Cadogan\\\'','In form of peach-shaped Chinese wine vessel, filled through hole in base of pedestal foot; plain loop handle and upright \'S\' spout; two applied peach leaf and flower decorations, one entwining top of handle, the other embracing centre of spout.\nDark brown shiny glaze.',4240,11851,'',' ','',' 1830','N11','Applied Art','',''),(123538,'coffee pot & cover','engine-turned',4576,11851,'',' ','',' ','N1397','Applied Art','',''),(121557,'coffee pot & cover','White earthenware body covered all-over with shiny dark olive-green glaze. Tall cylindrical body, plain squared-top handle, long gently-curved spout; cover flat at edges, curving up to ball knop. Body covered with rows of relief-moulded motifs, mostly circular, 8 to a full row.\n\n\n\'Totem\' design',4270,11851,'',' ','',' 1963-1975','Na1814','Applied Art','',''),(128482,'figure: Hannah More','unglazed; seated figure of elderly lady in lace cap',4558,11851,'',' ','',' 1835','NX881','Applied Art','',''),(25016,'Fossil','',526,6297,'Hartfell, near',' ','',' ','Cb2985','Palaeontology','',''),(122774,'dish','underglaze-blue transfer-printed with flower and husk border; view up the River Avon with Old Hotwell House on left bank, limekiln in foreground.',4243,12496,'Temple Back',' ','',' 1830','G1893','Applied Art','',''),(83695,'amulet','Two amulets, one is standing, with arms by his side and the sidelock of youth. The other is striding with his left foot forward and one finger in his mouth, also with the sidelock of youth, he stands on a base and has a back pillar. Both have a hole behind the neck for suspension.',1885,0,'',' -1295','New Kingdom',' -1550','H1031','Foreign Archaeology','Harpocrates (Horus as a child) amulet',''),(84651,'amulet','Square blue-green bead with oval cross-section and an eye (one left and one right) impressed on each side. There is an uneven hole through the amulet for suspension.',1752,8016,'south side of the sanctuary',' -664','Late Period (?)',' -747','H2077','Foreign Archaeology','wadjet (eye of Horus) amulet',''),(80605,'finger ring','Green glazed finger ring, in the form of two joined together. The double bezil shows Isis on one half and Nephthys on the other.',1765,8016,'Tell Farum',' -399','New Kingdom',' -404','H3178','Foreign Archaeology','Isis finger ring',''),(84722,'amulet','Grey right eye outline with applied black decoration delinitating the eye and eyebrow, the back is plain. There is a hole horizontally through the centre.',1752,0,'',' -340','New Kingdom - Third Intermediate Period - Late Period',' -1186','H3439','Foreign Archaeology','wadjet (eye of Horus) amulet',''),(83451,'jar','A cream-beige coloured pot with a round base and sides. The neck is flared and is wavy.',1752,0,'',' -525','Late Period',' -664','Ha5266','Foreign Archaeology','jar',''),(82494,'mould','A pottery mould with a cone shaped back and a flat disc inset with a hole pierced through it. Chipped.\n\n\nDISC BEAD MOULD',1752,0,'',' -30','Ptolemaic Period',' -332','H2072','Foreign Archaeology','mould',''),(84691,'amulet','Bright blue amulet of a right eye (of Horus, wedjat) with dark blue pupil and a brown eyebrow. The back is plain and there is a hole horizontally through the piece. Glazed.',1752,0,'',' -340','New Kingdom - Third Intermediate Period - Late Period',' -1186','H3449','Foreign Archaeology','wadjet (eye of Horus) amulet',''),(123568,'flower holder: vase','Inverted baluster shape with short, tapering neck.\nPainted in blue on a white glaze.  Four tall shaped panels with scalloped outines containing floral vines from tubs; between them four smaller rococo-shaped panels containing sailing ships, two of the frames adorned with military trophies; all reserved on a ground of whorls extending from base of neck to 8cm from base, the lower edge in a wave pattern.',4411,12166,'Liverpool (probably)',' 1770','',' 1750','N7820','Applied Art','',''),(125835,'tile','Square with chamfered edges.\nTransfer-printed in red: The Sailor\'s Farewell: sailor comforts a sorrowing girl and points to sailing ship, rowing boat and group of departing comrades on his leftt.  (reversed version of N3276) Leaf-scroll border.',4240,12166,'',' ','',' 1765-1775','N7135','Applied Art','',''),(124188,'tile','Square with chamfered edges.\nTransfer-printed in grey-black: The Sailor\'s Farewell: sailor comforts a sorrowing girl and points to sailing ship, rowing boat and group of departing comrades on his right.  (reversed version of N3275) Leaf-scroll border.',4240,12166,'',' ','',' 1765-1775','N3276','Applied Art','',''),(121817,'mug','Cylindrical body flaring out slightly to base; plain strap handle with curled lower terminal. Painted in blue on a pale blue glaze: chinoiserie island with moored sailing boat, house, rocks, trees; mirrored-scroll border below rim.',4411,12166,'Liverpool (probably)',' ','',' 1750-1770','G1441','Applied Art','',''),(121823,'jug','Baluster form on short flared foot,  \'?\'-form handle of B section with out-curled lower terminal, pointed lip in rim extending down neck of jug in graceful curve.  Painted in Fazackerley colours: blue, yellow, red, green, manganese purple on a pale bluish glaze: a band of flowers, buds and leaves around widest part of body;  bud spray below rim on either side of handle; outer face of handle solid blue.  Inscribed above shoulder: \' William    Rowland // 17  63 \'.',4411,12166,'',' ','',' 1763','G173','Applied Art','',''),(121068,'tile','Greyish glaze. Painted in manganese purple with two goat, one standing with back to viewer, the other lying down.',4318,12166,'',' ','',' 1750-1770','G1483.1','Applied Art','',''),(121815,'bowl','Hemispherical bowl on short footring. Painted in blue with yellow and red details on an off-white glaze.  Inside, a sailing ship with red ensign at stern, union flag at bow and pennant from top mast; border of blue-ground trellis and reserved floral motifs. Outside, two floral vines springing from rocks below a similar border.  Inscribed below ship:        \' SUCCESS TO THE LIVLEY OF - // EMSWORTH ROBART - // RANDELL MASTER \'',4411,12166,'Liverpool (probably)',' ','',' 1747-1755','G2115','Applied Art','',''),(121822,'barber\\\'s bowl','Hemispherical bowl with broad flange in \'bottom\' edge of which is a rounded cut-out for customer\'s neck; small rounded depression in flange at left side; pierced at top with two holes for suspension.\nPainted in blue on a pale blue glaze: chinoiseries - bamboo, peony and willow plants springing from a hollow rock and spilling onto flange. Inscribed on flange at top: \'SIR YOUR QUARTER\'S UP\'.',4411,12166,'Liverpool (probably)',' ','',' 1720-1740','G2141','Applied Art','',''),(121794,'tile','Square tile with cut-back sides. .. Painted in .... with a butterfly and two sketchy insects. Butterfly\'s lower wings lappet-edged.',4318,12166,'Liverpool (probably)',' ','',' 1750-1780','G2369.4','Applied Art','',''),(128764,'tile','painted in polychrome with a butterfly: upper wings yellow and blue, lower wings with serrated edge; two flying insects b