3270','Applied Art','',''),(124184,'tile','Square.  Transfer-printed with woman churning',4319,12166,'',' ','',' 1765-1775','N3272','Applied Art','',''),(124193,'tile','Square.  Transfer-printed: Aesop\'s Fable: The boar and the ass',4319,12166,'',' ','',' 1770-1780','N3281','Applied Art','',''),(124194,'tile','Square.  Transfer-printed: Aesop\'s Fable:  The Fox and the ass',4319,12166,'',' ','',' 1770-1780','N3282','Applied Art','',''),(124609,'cup, tea, & saucer','underglaze-blue painted with chinoiseries',4372,12166,'',' ','',' 1755','N4027','Applied Art','',''),(121935,'bottle, water','Sugar-loaf form with sloped shoulder below a narrow neck with chamfered rim. Painted in blue on a white glaze: chinoiserie flowers: large flower with sgraffito-veined lily-type leaves, stiff-stemmed small daisy flowers. Two different trellis bands around neck.',4411,12496,'',' ','',' 1750-1760','N5544','Applied Art','',''),(125365,'plate','Britton shape \'F\'.  Painted in blue, grey-green, yellow, manganese and white on pale blue glaze with violet tinge.   Faint bianco-sopra-bianco border, Britton type F - round pine-cone between wispy branches with trefoil leaves and 6-petalled flower heads; in centre, a delicately drawn scene of a figure sitting under a tree with buildings beyond, within narrow border of lozenge & flower motifs.\nThree small stilt marks under rim edge.',4522,12496,'',' 1770','',' 1755','N5877','Applied Art','',''),(125440,'coffee pot (no cover)','Baluster-shaped body on foot ring; crabstock \'S\'-spout and handle at right angles to each other.\nPainted in smudged blue on a pale bluish glaze: standing man holding ?stick, in garden with fence and tree, willow overhanging from tall rock on right; in angle between handle and spout, a Chinaman seated on a bank.',4411,12166,'Liverpool (probably)',' 1770','',' 1750','N6392','Applied Art','',''),(121827,'plate','Britton shape F. Painted in blue, green, yellow and manganese on a greyish-blue glaze with figures in a landscape: man doffs his hat to a lady seated by a gate which is flanked by two tall trees outlined in mg and washed over partly in mg and partly in yellow and green.',4412,12166,'\\Liverpool\\ (probably)',' ','',' 1760','N6444','Applied Art','',''),(125576,'sauceboat','Oval bowl with shaped rim and thrusting lip, plain handle; on \'pleated\' foot rim. A silver shape.\nPainted in blue on a pale blue glaze: shepherd playing pipe to two sheep on one side, house and trees by stream, castle beyond, on other; handle painted blue; inside, a bunch of flowers, four rows of wave pattern up lip, triangle-motif border.',4411,12166,'Liverpool (perhaps)',' 1760','',' 1740','N6658','Applied Art','',''),(122200,'dish','Britton shape H. Painted in blue on a pale bluish glaze with The Eight Horses of King Mu: eight horses prancing in a field; in background a central tree trunk between two ranges of hills; fringed canopy above tree, three birds in flight. On flange, five repeats of triple rocks/stumps sprouting new leaves and tendrils.\nBrown rim edge.\nUnderrim markings: concentric circles.',4416,12166,'Liverpool (probably)',' 1770','',' 1750','N6771','Applied Art','',''),(86600,'lamp','Pale brown clay oil lamp with a globular body with a circular hole in the centre, high curving sides with a groove at the junction with the  curving rim. Raised base and  long tapering flat-topped nozzle. Black glaze decoration mostly worn, traces on base.',0,8675,'Tomb near Corinth.',' -249','',' 376','H5016','Foreign Archaeology','oil lamp',''),(126271,'plate','Circular plate with eight-scalloped edge, sloped rim and deep well; four alternate rim sections have moulded flower spray with tendrils.\nPainted in underglaze blue with chinoiserie scene of two owls, one perched on willow tree, the other on fretwork fence all grouped on right; bridge to hollow rock with tree on left; flying insect; rocks on foreground, one looking like man in boat; all within lozenge fretwork border. On plain rim sections a narrow version of same border continued as simple line on moulded sections.\nBlue slightly blurred all over, well border below scene very blurred.',4372,12166,'',' 1765','',' 1756','N8227','Applied Art','',''),(121934,'plate','Circular plate, Britton shape F with footrim.  Painted in blue on a pale bluish glaze. Madder brown rim edge.  In centre, a coat-of-arms with ornate scroll mantling: dexter, Or three roses gules; sinister, Ermine three cat-a-mountain passant regardant; surmounted by a helm and crest of an embowed arm holding a rose. On flange, three extended motifs of  peonies with leaves and grass.\nInscribed on back: \'Rosco // Bristol\'.',4411,12166,'Liverpool (probably)',' ','',' 1755-1770','N8806','Applied Art','',''),(121840,'plate','Britton shape F.  Painted in blue and white on glossy white glaze, the back greyish.  Rim-to-rim scene:man in rowing boat; shore on left  with a pagoda and spires; on bottom and right flange,  grassy humps, a bird perched in a tree whose flowering branches reach across plate.\nInscribed above boat: \' Thomas Sarson // 1749 \'.',4413,12166,'Liverpool (perhaps)',' ','',' 1749, dated','G753','Applied Art','',''),(124022,'tile','Square tile.  Transfer-printed in red with \'The Tithe Pig\'.',4318,12166,'',' ','',' ','N3106','Applied Art','',''),(124024,'tile','Square tile.  Transfer-printed in black, overpainted in green with Apollo and lyre within an oval.',4318,12166,'',' ','',' 1770-1780','N3116','Applied Art','',''),(126848,'teapot & cover','Elongated globular form with plain spout and loop handle.  High-domed cover from flat surround, knob finial.\nP inted in underglaze blue and over-painted in iron red with all-over flower and leaf design, hatched leaves, gilt detailing.  Blue scroll border with two diaper cartouches; red line above foot, flower spray on spour, Chinese scrolls and graduated lines on handle.  Similar floral design and scroll border on cover, flower head painted on knob.',4240,11842,'',' ','',' 1770','N9476','App