t of the body and the bottom of the neck. The rim is stright lines. The is a dried block inside the jar (barley mash).',1859,0,'',' -1295','New Kingdom',' -1550','H306','Foreign Archaeology','beer jar',''),(83669,'kohl pot','Wooden kohl tube with two cylindrical tubes carved out of the same piece of wood with a smaller hole in between them for a kohl stick (or a hinge for a lid). One tube has black residue (kohl).',1742,0,'',' -1295','New Kingdom',' -1550','H963','Foreign Archaeology','double kohl pot',''),(83948,'mirror','An oval metal mirror with short tang for attaching the handle. The surface is bronze coloured and has a slight texture. The handle is made from wood. The handle is made in two pieces: the part for holding which is convex with a flat bottom and an integral tang (broken) and the part near the reflective surface splays out (broken).',1742,0,'',' -1295','New Kingdom',' -1550','H387','Foreign Archaeology','mirror',''),(83908,'offering platter','An offering platter in the shape of a house, only one upright wall remains. In the centre of the plan is a round hearth with four ox heads, bread vegetables and other object modelled in clay scattered around the floor. There are some pieces of furniture around the edge of the room, one table has four jars on it. Originally the object would have had one opening.',1742,7740,'grave 60',' -1795','Middle Kingdom',' -1985','H480','Foreign Archaeology','offering platter',''),(83676,'figurine','Standing figure of a woman who leans slightly to her left from the waist upwards. Her feet and toes have been carved, and she has a band of green above her ankles. Beneath her feet is a projection, perhaps for attaching her to a base. She wears a long dress and has no arms. Her long wig is painted in balck and her facial features have been carved. A little white paint remains on the body. She was broken at he waist and repaired.',1835,7740,'grave 133',' -1795','Middle Kingdom',' -1985','H373','Foreign Archaeology','human figurine',''),(84600,'axe','A semi circle of metal with a tapered blade and a straight edge with nine holes for attaching a handle. The edges of the object have many small cracks in them.',1835,0,'',' -1795','First Intermediate Period - Middle Kingdom',' -2160','H1054','Foreign Archaeology','axe head',''),(84345,'castanet','Pair of ivory clappers. Two curved arms with incised hands and wrists. There is a hole at the top of the arm for joining them together. The material is cracked, and has flaked off in some parts.',1835,7740,'Tomb Y39',' -1295','New Kingdom',' -1550','H1370','Foreign Archaeology','castanets (arm wands)',''),(83986,'cup','A buff coloured cup with a straight neck, flat rim and rounded base. The top of the neck has uneven black decoration. The inside of the cup is black with  buff accretions. Part of the rim is missing, and some has been repaired.',1752,0,'',' -1550','Second Intermediate Period',' -1650','H300','Foreign Archaeology','\'pan grave\' cup',''),(84599,'bead','A collection of beads of various shades of red and orange, most are rounded and one is much larger than the rest and oval.',1752,0,'',' -2181','Old Kingdom (?)',' -2345','H1274','Foreign Archaeology','beads',''),(146438,'pot','Grey earthenware storage pot with stippled pattern.',6228,3367,'Pemba Island, Tanzania',' ','',' ','Ea8055','Ethnography','',''),(24995,'Fossil','',526,6279,'road cutting 60 yds S. of Doverte Brook',' ','',' ','Cb5025','Palaeontology','brachiopod',''),(25000,'flaggy sandstone','',526,6279,'Doverte Brook, c 120 yds. S.15 E of the Independent Chapel',' ','',' ','Cb5032','Palaeontology','',''),(120660,'figure group: two putti with goat','on high scroll base detailed in lake; polychrome bocage',4263,12606,'',' ','',' 1769-1773','G511.i','Applied Art','',''),(123392,'cup, coffee','underglaze-blue-painted',4271,12606,'',' ','',' 1768-1773','N319','Applied Art','',''),(125228,'cup, coffee','plain loop handle; painted underglaze-blue flower sprays and diaper band inside rim',42