, strainer from neck of pitcher; earthenware, incised; Egyptian, from Fustat; date uncertain, perhaps Ayyubid dynasty (1171-1250). This is the \"common pottery of Islam\", the Egyptians were particularly skilled in the design of these filters.',7027,7782,'Fustat',' 1250','',' 1171','N8137.026','Eastern Art','',''),(86215,'shabti','Mummiform figurine with vague painted inscription. Pale green ? (patch on back), matt faience now creme coloured. Inscribed with name of \'Henttawi.\' Carrying hoes and basket. Limited details.',1741,0,'',' ','Third Intermediate Period',' 945-715 BC - 22nd Dynasty','Ha6538','Foreign Archaeology','shabti',''),(78723,'shabti','Mummiform figurine with painted inscription. Pale green matt faience, now grey. Carrying hoes. Flat feet. Back rather flat and dips in middle. Inscribed with hieroglyphic name of  \'Djeddjhutiusankh\'.',1741,0,'',' ','Third Intermediate Period',' 1069-747 BC - 21st Dynasty - 22nd Dynasty - 23rd Dynasty - 24th Dynasty','Ha6542','Foreign Archaeology','shabti',''),(161222,'sherd','Sherd, from wall perhaps of deep basin; terracotta; incised through white slip under lead glaze coloured with iron, and locally painted in slips coloured tan with iron and dark bornw with manganese, with writing in the thuluth style of naskhi calligraphy; Egyptian, from Fustat; Mamluk dynasties, 1250-1516. The thuluth style, in which Egyptians excelled, was used from the magnificently illustrated Qur\'ans and inlaid brassware of the same period.',7027,7782,'Fustat',' 1516','',' 1250','N8137.\"10\"','Eastern Art','',''),(161221,'sherd','Sherd, from wall perhaps of footed chalice; terra cotta; incised through white slip under lead glaze coloured with iron, and locally painted in slip coloured with manganese, with blazon of the Sultan\'s Cup-bearer and writing in naskhi calligraphy; Egyptian, from Fustat; Mamluk dynasties, 1250-1516. The Mamluks, being slaves imported from the Black Sea area, had no aristocracy, but the blazons of their civil and military offices created a form of heraldry and were frequently used in decorative arts.',7027,7782,'Fustat',' 1516','',' 1250','N8137.123','Eastern Art','',''),(83380,'jar','A red clay pot with a rounded base and sides. The neck is straight with a plain rim. There are two handles made from flat strips of clay from the rim to the shoulder of the pot. There is a large section missing from the neck.',1752,7782,'Egypt (?)',' ','',' ','Ha5271','Foreign Archaeology','jar',''),(83648,'brush','A branch of wavy twigs, close together, so it could have been used as a brush.',1859,0,'',' ','',' ','Ha5625','Foreign Archaeology','brush',''),(80795,'amulet mould','An amulet mould: figure of Nefertum (front half, with two channels at headdress height.\n\nEGYPT GALLERY',1752,0,'',' ','',' ','H1787.05','Foreign Archaeology','Nefertum amulet mould',''),(84063,'coffin fitting','Tapering beard with curl at the end and a tang for attaching it to the coffin. Traces of bright blue paint remain.',1752,0,'',' ','',' ','H4673','Foreign Archaeology','beard coffin fitting',''),(83004,'dish','Red polished dish with rounded base and inset rim.',1859,0,'',' -2181','Old Kingdom',' -2686','H1574','Foreign Archaeology','',''),(84020,'scarab','Heart scarab beetle amulet with 11 rows of inscribed hieroglyphs on the base. It contains Chapter 30b of the Book of the Dead. The scarab has incised detail on the wing case and feathering on its legs. Some damage to the edge of the base.',1772,0,'',' ','',' ','H4782','Foreign Archaeology','heart scarab',''),(78604,'shabti','Mummiform figurine with inscriptions. Pale green matt faience, now drab brown. Inscribed with name of \'Iry, true of  voice\'. Carrying hoes and basket.',1742,0,'',' -715','Third Intermediate Period',' -1069','H2346','Foreign Archaeology','shabti',''),(83926,'scarab','Dark green carved heart scarab with incised decoration and a flat bottom with the 30th chapter of the Book of the Dead incised in hieroglyphs. It is requesting the heart not to turn against the deceased at the Weighing of the Heart.',1772,0,'',' -1295','New Kingdom',' -1550','H2537','Foreign Archaeology','scarab (heart)',''),(83666,'coffin fitting','Rectangular wooden label for attachment to a mummified body. Greek writing on one side in black paint. There is a hole drilled in the top for suspension.',1772,0,'',' 400','Roman Period - Byzantine Period',' 400','H1753','Foreign Archaeology','mummy label',''),(83399,'jar','A buff coloured biconical pot with a long straight neck, wide flat rim and a ring base. There is a handle from the shoulder of the pot to below the base. Around the base of the neck are 3 horizontal lines, the outer are black and the middle is red. From the bottom  black line are vertical lines, either two together or three (where the middle line is thicker and has rectangular gaps in it).',6228,7782,'grave D17 A',' ','New Kingdom',' 1550-1295 BC - 18th Dynasty','H301','Foreign Archaeology','jar',''),(81514,'textile','A piece of textile from the border of a tapestry. It shows two heads framed in a running foliage scroll. The wide central band, in shades of cream with black, is given a more definite outline with the two bands of running foliage scroll set against black.',1752,0,'',' 600','Roman Period - Byzantine Period (?)',' 600','H4235','Foreign Archaeology','Coptic textile',''),(86991,'arrow','A long arrow head with two barbs and a long tang. The tang and the arrowhead has a diamond cross-section.',1835,7782,'Memphis (?)',' ','',' ','E2554','Foreign Archaeology','arrowhead',''),(83797,'tweezers','A pair of silver coloured tweezers formed out of one piece of flat metal. The points are rounded, and the top forms a loop.',1772,7782,'Bahnasa (el-) (Oxyrhynchus)',' 395','Roman Period',' -30','H928','Foreign Archaeology','tweezers',''),(80462,'toy','Toy horse made from reddish clay. Hole on the face, probably to attach a thread. Simple design. No facial features.',1752,7782,'Serabit el-Khadim, Sinai Peninsula',' 395','',' -30','H369','Foreign Archaeology','toy horse',''),(83820,'statue','A smooth black carving of a clenched fist, broken, three fingers are visible.',1752,0,'',' ','',' ','H402','Foreign Archaeology','statue (hand)',''),(86211,'shabti','mummiform figurine with inscription. Terracotta clay with black painted inscription.\n\n\nInscribed \'the Osiris, Paynebmose.\' (Dodson 2004)',1742,0,'',' -1186','New Kingdom',' -1295','H996','Foreign Archaeology','shabti',''),(83704,'axe','Rounded axe head with one flared, flat side for attaching a handle. The piece tapers to the blade which is cracked and chipped opposite the flat edge.',1752,0,'',' -2181','Old Kingdom',' -2345','H1604','Foreign Archaeology','axe head',''),(82166,'ostracon','A piece of stone with red hieratic writing on both sides.\n\n\nTranslation:',1835,0,'',' ','',' ','H1756','Foreign Archaeology','ostracon',''),(83845,'figurine','A figure of Isis as a woman, seated with her feet on a base, holding a child (Horus) on her lap. Horus is naked and wears a ureaus (cobra) and the sidelock of youth. Isis wears a long dress and holds her breast to suckle Horus. She has a long wig and a horned sun disc with uraeus. There is a tang beneath her feet and there are remains of gold leaf which would have covered the statue.',1859,0,'',' ','',' ','H1767','Foreign Archaeology','Isis and Horus (Harpocrates) figurine',''),(78739,'shabti','Mummiform figurine. Shiny turquoise faience. Carrying hoes.  Darker blue headdress. Bearded. Pilaster at back.\n\n\nUninscribed (Dodson 2004)',1741,0,'',' ','Late Period',' 390-343 BC - 30th Dynasty','H1771','Foreign Archaeology','shabti',''),(84366,'vessel','Four fragments of pale and dark green glazed pottery. One is a rim piece with a duck, a plant and a repeating pattern. Another rim piece shows a duck. One piece shows a repeating pattern,\nand the last has the same pattern with a part of a flower in the centre.\none showing a border of leaves (H1786b),\none with part of a building (?) (perhaps part of a pectoral) (H1786d)\nand one with a floral pattern, lotus or papyrus flowers (?) (Roman?) (H1786c).',1752,0,'',' 395','Roman Period',' -30','H1786','Foreign Archaeology','pottery sherds',''),(78984,'amulet mould','An amulet mould: oval with ankh.',1752,0,'',' ','',' ','H1787.01','Foreign Archaeology','ankh amulet mould',''),(78985,'amulet mould','An oval amulet mould with papyrus and lotus flower.',1752,0,'',' ','',' ','H1787.02','Foreign Archaeology','lotus flower amulet mould',''),(78986,'amulet mould','A wadjet (Horus) eye amulet mould.',1752,0,'',' ','',' ','H1787.03','Foreign Archaeology','wadjet (eye of Horus) amulet mould',''),(80873,'amulet mould','An amulet mould: aegis of Bast. Plus one cast of the aegis of Bast.',1752,0,'',' ','',' ','H1787.04','Foreign Archaeology','aegis of Bast amulet mould',''),(83527,'flask','Lentoid \'New Year\' flask. A beige jar with a round body and small neck with flared rim. It is oval in cross-section and has a band around the jar, starting at the neck. There are two incised inscriptions on this band. The upper part of the body has \'bead-collar\' incised decoration. There is a baboon  with one hand at its mouth on either side of the neck.\nTranslation:\n\'May Ptah open a good year for (her) lord\' ie owner\n\'May Amun open a good year for (her) lord\'',1752,7782,'Tell Hisn (Heliopolis)',' -525','Late Period',' -664','H1972','Foreign Archaeology','',''),(86314,'bead (necklace)','Faience beads strung (modern string) as a necklace.  Mostly ball and disc beads alternating.  Odd conical, ring and square-cut beads.  Some glass beads.  Size of ball beads varies.  Colour ranges from white, through greens to dark blue.',1752,7782,'Sinai Peninsula',' ','',' ','H2141.c','Foreign Archaeology','beads',''),(84687,'relief','A piece of fine relief from the bottom right hand corner of a tablet or stele. It shows an altar with papyrus stems and flowers, with birds (geese?) bound to the stem. To the left of the altar there is a part of person (arm). There is a border to the right and bottom, the piece is damaged in the corner.',1752,7782,'Tell Hisn (Heliopolis)',' -1186','',' -1295','H2419','Foreign Archaeology','carved relief (tablet or stele)',''),(83696,'amulet','Dark cream flat circular bead with bevelled edge. Depiction of Bes\'s head and plumed headdress on one side, and a wadjet, eye of Horus, on the reverse.',1885,0,'',' ','',' ','H2466','Foreign Archaeology','Bes and wadjet bead amulet',''),(83524,'funerary cone','A red cylindrical funerary cone (the point is broken off, revealing a black core). The bottom has raised hieroglyphs in rows. The top half of the cone has a rounded point.\nTranslation: \'The servant of Osiris, the priest and scribe of the treasury of Amun, the son of the scribe of the treasury, Nebu.\'',1835,0,'',' ','',' 2014-11-04','H2878','Foreign Archaeology','funerary cone of Nebu',''),(78650,'shabti','mummiform figurine. Turquoise shiny faience. Bearded. Pilaster at back. Not inscribed.',1741,0,'',' ','Late Period',' 380-343 BC - 30th Dynasty','H2910','Foreign Archaeology','shabti',''),(83996,'finger ring','Circular ring with flat bezil in the shape of a wadjet or Horus eye. It is bright blue.',1770,0,'',' ','',' 2014-11-04','H2990','Foreign Archaeology','wedjat (eye of Horus) finger ring',''),(83955,'scarab','Carved black stone in the shape of a scarab beetle with the legs carved and a nodule on its belly with a hole running through it from side to side. Part of the base is broken.',1752,0,'',' ','',' 2014-11-04','H2998','Foreign Archaeology','scarab',''),(83511,'scarab','Translucent red piece stone carved in the shape of a scarab beetle with a flat bottom and a hole through the centre from head to tail. There are cross hatched lines on the base of the scarab.',1752,0,'',' ','',' 2014-11-04','H3000.1','Foreign Archaeology','scarab',''),(83512,'scarab','Translucent red piece stone carved in the shape of a scarab beetle with a flat bottom and a hole through the centre from head to tail.',1772,0,'',' ','',' 2014-11-04','H3000.2','Foreign Archaeology','scarab',''),(83645,'model','Pottery model of a bed or couch with headboard and raised area in the centre of the bed at the feet end. The model is painted, in red, white and black, although some has flaked off. The base of the bed is red with white cross-hatching and a black border. One of the four legs is missing.',1742,0,'',' ','',' 2014-11-04','H3039','Foreign Archaeology','bed/couch model',''),(82180,'ostracon','A fragment of cream limestone with black Coptic writing on one side and on part of the other side.',1835,0,'',' ','',' 2014-11-04','H3041','Foreign Archaeology','ostracon',''),(86142,'shabti','Mummiform figurine. Pale blue shiny faience. Carrying hoes and basket. Bearded. Pilaster at back.',1741,0,'',' ','Late Period',' 747-332 BC - 25th Dynasty - 26th Dynasty - 27th Dynasty - 28th Dynasty - 29th Dynasty - 30th Dynasty','H3119','Foreign Archaeology','shabti',''),(86141,'shabti','Mummiform figurine. Pale blue matt faience. Carrying hoes and basket. Bearded. Pilaster at back.',1741,0,'',' ','Late Period',' 747-332 BC - 25th Dynasty - 26th Dynasty - 27th Dynasty - 28th Dynasty - 29th Dynasty - 30th Dynasty','H3120','Foreign Archaeology','shabti',''),(83404,'shrine','A piece of cream stone, trapezium shaped in vertical cross section, square in horizontal. On the front there is a bass relief of Ptah, a mummiform man with false beard and short wig. He holds a sceptre in his hands in front of him.\n\n\nTranslation: Left side\n[Pta]h to Nebka, the Good God, Ruler of Eternity, he gives joy\n\n\nFront, top and left\nPtah, lord of the Two Lands, upon baeauty […] great […] Lord […]\n\n\nFront left\nPtah […] Great God, Lord of the Sky, beloved […] Re […]\n\n\nLeft side\n[…] Neb […]\n(Dodson, Aidan)',1770,7782,'Memphis (?)',' ','',' ','H3127','Foreign Archaeology','Ptah shrine',''),(84364,'jar','Fragment from the top of a glazed vessel. The rim is grey with a brown line and underneath this on 