',' ','',' ','Ha5406','Foreign Archaeology','jar',''),(83665,'amulet','Striding figure of Anubis (man with a jackal\'s head), with his left foot forward. Dark green faience. He stands on a base with a base pillar. He wears a short kilt (incised) and has a long incised wig. The ears are damaged. There is a hole in the back for suspension.',1772,0,'',' ','',' ','Ha5678','Foreign Archaeology','Anubis amulet',''),(79563,'figurine','A seated bronze figure of a woman in a long dress, holding a naked male child on her lap with her left hand and her left breast with her right hand. She has a long wig and a uraeus (cobra) on her forehead with a horned sun disc on her head. Her feet are on a base with a tang beneath it; there is also a tang below her bottom.',1859,0,'',' ','',' ','Ha5687','Foreign Archaeology','Isis and Horus figurine',''),(83374,'shabti','Mummiform figurine with painted inscription. Bright shiny blue faience. Carrying hoes and basket. Inscribed \' The Osiris,  Djedkhonsiu [fankh].\' (Dodson 2006)',1741,0,'',' ','Third Intermediate Period',' 1069-945 BC - 21st Dynasty','Ha5789','Foreign Archaeology','shabti',''),(83550,'shabti','Mummiform figurine. Pale green matt faience, now cream. Carrying hoes and basket.',1741,0,'',' ','Third Intermediate Period',' 1069-945 BC - 21st Dynasty','Ha5858','Foreign Archaeology','shabti',''),(84646,'wall relief','Sunk relief carving of a figure in a pleated garment with arms up. There are the remains of some hieroglyphs above the figure. The sides of the piece are broken and some of the carving is chipped.',1752,0,'',' ','',' ','Ha6037','Foreign Archaeology','wall relief',''),(83995,'amulet','A naked seated figure with his feet on a base and arms by his side. He wears an uraeus on his head and the sidelock of youth.',1885,7782,'Egypt (?)',' ','',' ','Ha6041','Foreign Archaeology','Harpocrates (Horus as a child) amulet',''),(83272,'figurine','Seated cat with tail wrapped around the right of her paws. The ears, eyes, nose and mouth have been roughly modelled. There are two tangs beneath its feet, the rear one is broken.',1752,7782,'Egypt (?)',' ','',' ','Ha6048','Foreign Archaeology','cat figurine',''),(84602,'figurine','Seated figure of the goddess Isis, with her feet on a base with a square tang. She holds the child Horus on her knee with one arm, the other arm holds her breast to suckle Horus. She wears a long wig which is incised and a horned sun disc with uraeus (cobra). The tip of one of the horns is missing. Horus is naked and has the sidelock of youth and a ureaus.',1770,7782,'Egypt (?)',' ','',' ','Ha6049','Foreign Archaeology','Isis and Horus as a child (Harpokrates) figurine',''),(84049,'tomb model','Standing human figure, the feet are missing, and one arm detached. The remaining arm has an unusual white angular end- it could well be linked to butchery (large knife). His flesh is painted dark red, with facial features and short wig painted in black.',1742,0,'',' -1850','',' -2250','Ha6079','Foreign Archaeology','tomb model (butcher? figurine)',''),(84019,'amulets','Four flat amulets of the sons of Ra holding a staff or sceptre, incised on one side with holes top and bottom at the back:\nDuamutef, jackal head in blue faience, facing right,\nImsety, human head in blue faience, facing right,\nQebhsenuef, hawk head in cream faience, facing left,\nHapy, baboon head in cream faience, facing left.',1772,0,'',' ','',' ','Ha6090','Foreign Archaeology','four (4) sons of Ra amulets',''),(84506,'net sinker','A roughly rectangular piece of cream stone with two circles incised at 90 degrees to each other so that the weight could be attached to a net.',1835,0,'',' ','',' ','Ha6108','Foreign Archaeology','',''),(79292,'amulet','This is a bronze (now dark blue) figure moulded in the form of Anubis semi-knelt on a thin rectangular base. He holds his arms out, bent at the elbows either side, as if holding something. He has roughly moulded facial features and pointed ears.There is a loop at the back which is pierced.',1770,0,'',' ','',' ','Ha6147','Foreign Archaeology','Anubis amulet',''),(86369,'figurine','Bronze (now black) figure of a shrew with an elongated snout and small rounded roughly moulded ears on each side. It stands, with a long tail. The tail is joined to the back of a rectangular base.',1770,0,'',' -30','',' -747','Ha6160','Foreign Archaeology','shrew mouse figurine',''),(86384,'figurine','A copper alloy figure of the goddess Maat, squatting on a rectangular base, in profile. It has roughly moulded female details and has a feather attached to the top of her head. The base is hollow, and there is a thin stump on the base for attachment.',1770,0,'',' ','',' ','Ha6162','Foreign Archaeology','Maat figurine',''),(83629,'amulet','Seated figure of Horus with his feet on a base. His arms are by his side, and he is naked. He wears the double crown and has a sidelock of youth. There is a ring on the back for suspending the amulet.',1885,0,'',' ','',' ','Ha6167','Foreign Archaeology','Harpocrates (Horus as a child) amulet',''),(84016,'figurine','Seated figure of Isis holding Horus on her lap, one hand is holding her breast to suckle him. She wears a long wig with incised decoration and a horned sun disc with ureaus. Horus has the sidelock of youth and a uraeus. Her feet rest on a base with a tang, and there is also a tang underneath her bottom (broken) for fixing the figure to a stand. It is corroded.',1885,0,'',' ','',' ','Ha6169','Foreign Archaeology','Isis and Horus as a child (Harpokrates) figurine',''),(79591,'amulet','This is a pale green shiny faience amulet moulded in the form of Isis, sitting on a throne with Horus on her lap. It is roughly mouded and she wears a wide crown on her head. There is a thin pilaster at the back which is pierced near the neck. It has a rectangular base.',1885,0,'',' ','',' ','Ha6186.7','Foreign Archaeology','Isis and Horus amulet',''),(82427,'amulet','Three figures standing on walled flat back moulded in the form of Isis, Nebhat and Horus. Green matt faience. moulded in low relief. Pierced through loop at top for suspension. Small rectangular base.',1885,0,'',' ','',' ','Ha6207.2','Foreign Archaeology','Isis, Horus and Nephthys amulet',''),(79959,'amulet','A triad amulet with a backboard and base. Isis is on the left with a throne headdress, Horus is in the middle with the sidelock of youth, and Nephthys is on the right with a column headdress, they all hold hands. This is pale green in colour, with brown discolouration on the base and brown accretions in the moulded area. The loop on the back is grooved.',1752,0,'',' ','',' ','Ha6208.1','Foreign Archaeology','Isis, Horus and Nephthys amulets',''),(79960,'amulet','A triad amulet with a backboard and base. Isis is on the left with a throne headdress, Horus is in the middle with the sidelock of youth, and Nephthys is on the right with a column headdress, they all hold hands. This is pale blue-green in colour, with an orange-brown back and brown accretions in the moulded area. The loop on the back is grooved.',1752,0,'',' ','',' ','Ha6208.2','Foreign Archaeology','Isis, Horus and Nephthys amulet',''),(79864,'amulets','Three amulets of the triad with a backboard and base. Isis is on the left with a throne headdress, Horus is in the middle with the sidelock of youth, and Nephthys is on the right with a column headdress, they all hold hands. This amulet is mostly brown with some green areas. All have a loop on the back for suspension.',1752,0,'',' ','',' ','Ha6208.3','Foreign Archaeology','Isis, Horus and Nephthys amulets',''),(83949,'amulet','Black amulet with flat rectangular base, plain column and wide, slightly curved part for resting the head.',1742,0,'',' ','',' ','Ha6222.1','Foreign Archaeology','urs (headrest) amulet',''),(83950,'amulet','Black amulet with flat rectangular base, plain column and wide, slightly curved part for resting the head.',1742,0,'',' ','',' ','Ha6222.2','Foreign Archaeology','urs (headrest) amulet',''),(8