tion. Turquoise shiny faience. Inscribed for \' The God\'s Father of Amun, Nesypaqashuti.\' (Dodson 2005) Carrying hoes and basket. Flat back.',1741,0,'',' ','Third Intermediate Period',' 1069-945 BC - 21st Dynasty','Ha6859','Foreign Archaeology','shabti',''),(83591,'shabti','Mummiform figurine with painted inscription. Blue shiny faience. Carrying hoes and basket. inscribed \'Sehedj, The Osiris, M[...] nub ? (Dodson 2006).',1741,0,'',' ','Third Intermediate Period',' 1069-945 BC - 21st Dynasty','Ha6863','Foreign Archaeology','shabti',''),(84603,'dice','Three ivory or bone dice, all roughly cubes and have dots incised (circles with dots in the centre). All opposite sides add up to 7. Two are clockwise (A and B), and one is an anti-clockwise die (C) (looking at the arrangement of 1, 2 and 3).',1742,0,'',' ','',' ','Ha6886','Foreign Archaeology','dice',''),(86253,'shabti','Mummiform figurine. Matt faience now white. Carrying hoes and basket on the back of one shoulder.  Crude details.',1741,0,'',' ','Third Intermediate Period',' 1069-747 BC - 21st Dynasty - 22nd Dynasty - 23rd Dynasty - 24th Dynasty','Ha6912','Foreign Archaeology','shabti',''),(79666,'amulet','This is a mint green shiny faince amulet moulded in the form of the eye of Horus. It is thin with a moulded and fretted design on one both sides. It is tabular and pierced lengthways.',1770,0,'',' ','',' ','Ha6940','Foreign Archaeology','wadjet (eye of Horus) amulet',''),(83516,'loom','An oval stone bead with four curved protrusions and a hole lengthways through it. The stone is white with a red inclusions and the base is flat.',1752,0,'',' ','',' ','Ha6955','Foreign Archaeology','shuttle',''),(86243,'shabti','Mummiform figurine with painted inscription on panel at front. Wooden with black, yellow, red, blue and white slip. Yellow face. Large yellow collar. No arms or hands. Detailed features. Inscribed \' Sehedj, the Osiris, Khaemwaset.\' (Dodson 2005)',1741,0,'',' -1186','New Kingdom',' -1295','Ha6996','Foreign Archaeology','shabti',''),(86323,'shabti','Mummiform figurine. Green matt faience. Carrying hoe,flail and basket. Bearded. Pilaster at back.',1741,0,'',' ','Late Period',' 747-332 BC - 25th Dynasty - 26th Dynasty - 27th Dynasty - 28th Dynasty - 29th Dynasty - 30th Dynasty','Ha7010','Foreign Archaeology','shabti',''),(84475,'amulet','2 amulets of taweret, both depict a pregnant hippo with an incised backboard. One is made from shiny faience and is broken below the belly. The other is matt, and complete the base for the feet. Both have a hole behind the neck for suspension.',1859,0,'',' ','',' ','Ha7012','Foreign Archaeology','Taweret amulet',''),(83364,'shabti','Mummiform figurine with inscription down front? Blue shiny faience.Carrying incised hoes, and painted basket on back. Arms crossed on chest.',1741,0,'',' ','',' ','Ha7296','Foreign Archaeology','shabti',''),(85298,'ostracon','A two-tone piece of red clay pot sherd with black Demotic writing on one side. There are 7 lines of larger writing and 2 lines of smaller writing, probably another hand. It has four sides.',1835,0,'',' ','',' ','Ha7381','Foreign Archaeology','ostracon',''),(83976,'spindle (?)','A circular piece of wood with a flat bottom and domed top, it has a hole with a broken pin in it through the centre of the object. There is a cracked substance stuck to parts of the object.',1752,0,'',' ','',' ','Ha7549','Foreign Archaeology','spindle whorl (?)',''),(84608,'necklace','Green and brown tubular beads with round black beads and strung with five (5) bright blue bell-shaped flowers (with four petals).',1752,0,'',' ','',' ','Ha7567','Foreign Archaeology','beads',''),(83809,'scarab','Brown and black carved scarab with incised decoration and a flat bottom with the 64 chapter of the Book of the Dead incised in hieroglyphs. It is chipped and worn.',1889,0,'',' -1295','New Kingdom',' -1550','H2558','Foreign Archaeology','scarab (heart)',''),(81002,'amulet','A piece of brown and white horizontally striped stone carved in the shape of a squat man. The eyes are partially drilled and one has an irregular, green inlaid eye.',1770,0,'',' -3100','Pre-dynastic Period',' -5500','H1439','Foreign Archaeology','Ptah-Sokar (?) amulet',''),(82029,'finger ring','A pale green faience ring with a \'U\' shaped shank and an oval bezil with a raised ankh taking up the whole bezil. The bezil is chipped.',1770,0,'',' -1336','New Kingdom',' -1352','H1704','Foreign Archaeology','ankh finger ring',''),(84674,'comb','Wooden comb with large plain handle and 7 teeth of varying lengths with gaps the same width inbetween them.',1742,0,'',' -3100','Pre-dynastic Period (early)',' -5500','H1532','Foreign Archaeology','comb',''),(85159,'scarab (winged)','Flat based amulet with naturalistic carving on one side. Pale green matt faience. Uninscribed. pierced lengthways and widthways (one hole blocked). 3 pieces. \nWith 2 wings detached. One pale green matt faience, one darker sea green shiny faience. Each pierced with four holes on back, and four holes on side for sewing to mummification bandages. Holes blocked with plaster on darker one.',1772,0,'',' ','',' ','Ha6089','Foreign Archaeology','scarab (winged)',''),(79565,'human remains','The body of a mummified human child. The head is missing, as well as the chest which has filling. The bandaging has been unwrapped, although there is no record of when this happened or any findings from it. The chest cavity may have been opened as part of the unwrapping, or it may have been damaged since. The head and right foot are missing.\nThe age of the child is estimated at about 20 months from the diaphysical length (130mm) of an upsided tibia. The radiographs show Harris lines at the lower end of each femur, both ends of the tibiae and lower ends of the fibulae. These are stress indicators, implying periods of nutritional deficiency or childhood illness where development was affected.',1885,0,'',' -550','Late Period',' -720','Ha6140.1','Foreign Archaeology','child mummy with missing head',''),(83834,'cartonnage (mummy trappings)','Hollow cartonnage foot piece for a mummified body. Red feet are painted on the top, with white sandal t-bar, and red, yellow and green decoration are the sides and bottom. It is broken at the open end, and cracked at the bottom.',1772,0,'',' -30','Ptolemaic Period',' -305','H539','Foreign Archaeology','',''),(78533,'shabti','mummiform figurine with inscriptions. Pale green matt faience.\nInscribed \'the Osiris, singer of Amun, Djedmut\' (Dodson).\nCarrying hoes and basket',1741,7782,'Egypt (?)',' ','Third Intermediate Period',' 1069-945 BC - 21st Dynasty','H3062','Foreign Archaeology','shabti',''),(79964,'statuette','A piece of black and white carved stone with a pink band down the right side. It is the head of a man (Pharaoh Tutankhamun) wearing a nemes headdress with a uraeus (cobra) at the front (its head is missing). The left hand side of the face remains, broken diagonally across his eye. Most of his headdress is missing too.',1835,0,'',' -3302','New Kingdom',' -1323','H5153','Foreign Archaeology','statuette (possibly from a triad)',''),(83847,'statue','A carved wooden figure of a standing woman with her arms by her side (made separately). She wears a long dress and a long wig which is painted black like her facial features and nipple covers. There are balck rings around her ankles. The body and dress is painted yellow, and has rubbed off in parts. There are two holes in her feet for attaching to the base with dowels.\n\nFigure: Ha 6080\nBase: H 2922',1889,0,'',' -1795','Middle Kingdom',' -1985','Ha6080','Foreign Archaeology','Ka statue',''),(83739,'scarab (heart)','Black carved scarab with inscribed decoration on the top and a flat bottom with incised hieroglyphs from the Book of the Dead on the bottom. There is a hole drilled through the scarab\'s jaws.\n\n\nThe inscription on this example is a confusion of chapters 26 and 27 and reads as follows:\n\'The speech: My heart is in me in the house of hearts; my heart is in me in the house of hearts. Hail to thee my heart! Hail to thee my besek.\'',1772,0,'',' -1295','New Kingdom',' -1550','H1152','Foreign Archaeology','scarab (heart)',''),(83932,'canopic jar','Pale stone jar with a flat bottom and shallow pear shape. The rim is flat to hold the lid. There is \'Duamutef\' painted in black hieroglyphs down one side.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2633.1','Foreign Archaeology','Duamutef canopic jar base',''),(83826,'canopic jar','Pale stone canopic jar lid carved in the shape of a jackal\'s head with black painted decoration.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2633.2','Foreign Archaeology','Duamutef canopic jar lid',''),(83827,'canopic jar','Pale stone jar with a flat bottom and shallow pear shape. The rim is flat to hold the lid. There is \'Imsety\' painted in black hieroglyphs down one side.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2634.1','Foreign Archaeology','Imsety canopic jar base',''),(83828,'canopic jar','Pale stone canopic jar lid carved in the shape of a man\'s head with black painted decoration.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2634.2','Foreign Archaeology','Imsety canopic jar lid',''),(83505,'canopic jar','Pale stone jar with a flat bottom and shallow pear shape. The rim is flat to hold the lid. There is \'Qebhsenuef\' painted in black hieroglyphs down one side.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2635.1','Foreign Archaeology','Qebhsenuef canopic jar base',''),(83878,'canopic jar','Pale stone canopic jar lid carved in the shape of a falcon\'s head with black painted decoration.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2635.2','Foreign Archaeology','Qebhsenuef canopic jar lid',''),(83844,'canopic jar','Pale stone jar with a flat bottom and shallow pear shape. The rim is flat to hold the lid. There is \'Hapy\' painted in black hieroglyphs down one side.',1772,7782,'Thebes (?)',' 1069','New Kingdom',' -1186','H2636.1','Foreign Archaeology','Hapy canopic jar base',''),(83879,'canopic jar','Pale stone canopic jar lid carved in the shape of a baboon\'s head with black painted decoration.',1772,7782,'Thebes (?)',' -1069','New Kingdom',' -1186','H2636.2','Foreign Archaeology','Hapy canopic jar lid',''),(83846,'statue','A rectangular block of wood with a recess cut near the back for the statue with two holes for dowels. There are four rows of (illegible) hieroglyphs carved in front of the statue recess. The whole has been painted yellow, most of which has rubbed off.\n\n\nBase: H 2922\nFigure: Ha 6080',1889,0,'',' -1795','Middle Kingdom',' -1985','H2922','Foreign Archaeology','Ka statue base',''),(83729,'papyrus','Ten (10) fragments of papyrus, mounted together:\n1. 53mm*30mm, mainly black hierogylphs, some red\n2. 75mm*79mm, black hierogylphs in columns, red and yellow border\n3. 70mm*56mm, hieroglyphs in red and black in columns, red and yellow border\n4. 70mm*44mm, yellow canopy with hanging objects\n5. 63mm*60mm, hierogylphs in red and black\n6. 68mm*49mm, corner piece showing part of the white crown of Upper Egypt\n7. 56mm*43mm, hierogylphs in black\nPlus three smaller fragments with hierogylphs',1889,0,'',' -1295','New Kingdom',' -1550','H3625','Foreign Archaeology','book of the dead papyrus (fragments)',''),(79586,'wall relief','It is raised relief showing a human headed bird standing on a dish with staffs and a kneeling god. There is one column of hieroglyphs on the right and one row of hieroglyphs below.',1889,0,'',' ','Graeco-Roman',' ','H4972','Foreign Archaeology','wall relief',''),(79575,'coffin','A rectangular wooden box, black on the outside and white on the inside. The outside has a painted decoration, of registers of gods and prayers.  One side is darkened (by soot?) and the decoration is only faintly visible as lines. Isis and Nephthys at each end. Dark stain around the top edge may be a woodworm treatment: the wood is badly damaged by worm, with a (modern) repair in one corner using linen.  The floor is made of planks of wood. Traces of salting inside the base.',1772,0,'',' -550','Late Period',' -625','H5075','Foreign Archaeology','outer coffin',''),(83933,'Sculpture','A black carved wooden figure of a jackal lying down with tall pointed ears and carved eyes. The main body would have sat on top of a box or shrine, and is flat with a long tail which would have hung down from the base.',1889,0,'',' ','',' ','H5135','Foreign Archaeology','Anubis carved figure',''),(86425,'statuette','The torso of a man carved in black stone. The head and legs below the knees are missing. There are chips on its front.',1770,0,'',' -332','Late Period (?)',' -747','H405','Foreign Archaeology','Amen (?) statuette',''),(83719,'dancing wand','A fragment of green glazed pottery, eliptical in section (part of a wand used in dancing). It is decorated in brown-black paint, and both side have most of a drawing of an eye. One side also has the cartouche of the nomen of Seti I and heirogylphs of a royal title above and part of a \'grant life\' offering formula below.\nVotive to Sety I.',1770,7782,'Serabit el-Khadim, Sinai Peninsula',' -3286','New Kingdom',' -1294','H3241','Foreign Archaeology','dancing wand',''),(84660,'vessel','Curved piece of pottery, glazed in pale green inside and out. Heiroglyphs have been painted on the outside, which include some text and most of a cartouche of Rameses II.',1770,7782,'Serabit el-Khadim, Sinai Peninsula',' -1213','New Kingdom',' -1279','H3243','Foreign Archaeology','vase sherd',''),(83718,'votive plaque','A rectangular green and cream glazed votive plaque with a cat or cheetah seated on a tomb, table or altar in brown paint. The top right corner is missing and the plaque has cracked down the middle and glued back together. Signs of burning.',1770,7782,'Serabit el-Khadim, Sinai Peninsula',' -1069','New Kingdom',' -1550','H3279','Foreign Archaeology','',''),(83849,'figurine','A hollow figure of Horus seated in front of an obelisk with a flat top; the whole is on a broken base. Horus is depicted as a hawk-headed human wearing a short pleated kilt, long wig and double crown with uraeus (cobra). His arms are by his side with clenched fists, wearing bracelets around the wrist and upper arm. The throne is incised with scales and parallel lines. The obelisk is plain.',1770,7782,'Tell el-Yahudiya (Nay-ta-hut, Leontopolis, The Mound of the Jews) (?)',' -300','Ptolemaic Period (early)',' -300','Ha7677','Foreign Archaeology','Horus figurine',''),(84642,'tomb model','2 standing figures of women in a white garment, knee length with one shoulder. Their arms are attached by pegs, one holds a black and white bird, the other holds the angular basket on their heads. One woman\'s left arm is broken. Their skin is painted pale yellow, the hair is black, and the eyes are painted in black and white.\n\n\nOriginally mounted on a modern painted base (removed for new display 2007).',1742,0,'',' -1850','Old Kingdom (late) - First Intermediate Period - Middle Kingdom',' -2250','H550','Foreign Archaeology','tomb model (standing figurine)',''),(84606,'hair pin','A flat carved hair pin with a point at one end, and a bird with long legs curved on the other. Below the bird\'s legs are four carved parallel bands.',1742,0,'',' -2686','Pre-dynastic Period - Early Dynastic Period',' -5500','H1454','Foreign Archaeology','hair pin',''),(83772,'palette','A flat grey palette in the shape of a turtle. It is roughly circular in shape, with four legs with notches to indicate toes (the back left one is broken). The head has two half drilled eyes and there is a hole drilled through the palette at the edge opposite the head. The back is undecorated.',1742,7782,'Upper Egypt',' -3100','Pre-dynastic Period',' -5500','H1470','Foreign Archaeology','turtle palette',''),(84371,'dice, dice box','A tapered cylindrical tube with the bottom made from a separate piece. The top has a ridge which could have been for holding a lid. The outside (including the bottom) is decorated with parallel rings and circles surrounding dots, all incised.\n3 dice. The larger die is an even cube, and of standard layout (opposite sides add up to 7), it is clockwise (i.e. 1, 2 and 3 are read clockwise when looking at the die from an angle. The smaller die is uneven and has one bevelled and incised edge, it is of standard, anti-clockwise format. The third one is rectangular and anti-clockwise.',1742,7782,'Shurafa',' 395','Roman Period',' -30','H1966','Foreign Archaeology','dice and dice box',''),(83523,'bracelet','17 pieces of rectangular shell with mother-of-pearl lining strung together with wire through a hole at each end.',1742,0,'',' -1795','Middle Kingdom',' -1985','H3553','Foreign Archaeology','bracelet',''),(83282,'wall relief','\'Talatat\'. A sunk relief carving of two men facing right (only head and chest remain), one carries an offering tray with offering. The stone is yellow-buff and no paint remains.',1742,0,'',' -1336','New Kingdom',' -1352','Ha5255','Foreign Archaeology','wall relief',''),(85938,'shabti','Mmummiform figurine with inscription down the front. Pale green matt faience, now partly pink/light brown. Inscribed with name of Heribbastet, born of  Tasiset. Carrying hoes and basket. Bearded. Pilaster at back.',1742,0,'',' -332','Late Period',' -747','Ha5904','Foreign Archaeology','shabti',''),(84483,'tomb model','Wooden servant figurine. Striding with left foot forward and triangular arms at right angles to his body. The arms are shown bent back at the elbow, as to carry a heavy weight on the back.  A curved hook may represent a yoke for carrying buckets. The flesh has been painted dark red, the kilt white (though most is gone now), the eyes are black and white and the short modelled wig is black.',1742,0,'',' -1650','Middle Kingdom',' -2055','Ha6987','Foreign Archaeology','servant tomb figurine',''),(83734,'rake','A semicircle of wood with a cylindrical wooden handle attached through a hole. The handle has been split and wedge with a peg where it meets the blade to ensure a tight fit. The edges of the blade are rounded.',1835,0,'',' -1795','Middle Kingdom',' -1985','H1624','Foreign Archaeology','mudrake',''),(86339,'stela','Straight-sided stele with semi-circular top. There are six (6) horizontal registers of heiroglyphs. At the top there are two eyes and an ankh, on the left side of the bottom register there is a man facing right, holding a bird by its neck in his left hand. There are a few chips on the sides, the back is roughly hewn.',1835,7782,'Esna (?)',' -1650','Middle Kingdom (late)',' -2055','H175','Foreign Archaeology','stela',''),(83340,'pen','Three reed pens.\nThe longest is brown with a tapered, split nib and the other end has also been tapered, but to a flat end.\nOne is light brown with a tapered split nib (broken), and the other end is flat.\nThe smallest is brown with a tapered nib with two grooves running it.',1835,7782,'Serabit el-Khadim, Sinai Peninsula',' 600','Roman Period',' 600','H958','Foreign Archaeology','pens',''),(83658,'kohl pot','High shouldered jar with narrow neck and wide, flat rim. There is a lip at the bottom of the jar. There is a small drilled hole in the centre for kohl.',1752,0,'',' -1295','New Kingdom',' -1550','H233.1','Foreign Archaeology','kohl pot',''),(84952,'survey mark','A square-based pyramid carved from stone. The top has been flattened and is concave. The chisel marks are visible.',1835,7782,'Egypt (?)',' 395','Roman Period',' -30','H257','Foreign Archaeology','survey mark',''),(84720,'mallet','Domed mallet with straight integral handle. The base is convex and relatively smooth. There is a deep crack up one side of the mallet.',1752,0,'',' -2613','New Kingdom',' -2686','H440','Foreign Archaeology','mallet',''),(83934,'stela','A white stele with sunken relief decoration. The top register shows two eyes and a tied rope above a scene with a seated man and woman in front of an offering table and a woman and child. There are also hieroglyphs above the people\'s heads. Below are three rows of hieroglyphs and at least 8 columns.\n\n\nTranslation:\nA royal offering to Osiris the great god and to Anubis, Lord of Abydos, the Great God, Lord of the Sacred Land, that they might give invocation of offerings, bread, beer, oxen, fowl, alabaster, clothing, incense, unguent and every good and pure thing, offerings and all fruit and vegetables on which the god lives, for the ka of the sacred scribe Nebseeni, justified.  His son Samut; his son Amenemhet; his son Ahmose; his son Sennefer; his son Nebamun; his daughter Mutemweskhet.\n(Dodson, Aidan)',1835,0,'',' -1295','New Kingdom',' -1550','H509','Foreign Archaeology','stela of Nebseni',''),(80604,'jar','A large, cone-shaped pot, rough faced pottery. It is beaded rim and pointed base. There is no decoration. The rim is chipped with two cracks down either side. Slight surface abrasion - some white residue.',1859,7782,'Ab\'adiya (Hut-Sekhem, Diospolis Parva) (?)',' -3100','Pre-dynastic Period (mid)',' -5500','H552','Foreign Archaeology','jar',''),(86746,'figurine','The standing figure of a mummified man holding a crook and flail. He has a beard and a conical crown with a feather either side and a uraeus (cobra) on the front. He stands on a base with a tang underneath.',1752,0,'',' -30','Ptolemaic Period',' -332','H1022.6','Foreign Archaeology','Osiris figurine',''),(84615,'needle','Thin cylindrical needle with a point and an oval eye by a rounded end.',1752,0,'',' -525','Late Period / Predynastic (?)',' -664','H1069','Foreign Archaeology','needle',''),(83998,'amulet','Pale green amulet of the red crown of Lower Egypt with long back and curl at the front, and the space filled in inbetween (\'negative space\') where there is a hole for suspension.',1835,0,'',' -525','Late Period',' -664','H1269','Foreign Archaeology','deshert (red crown) amulet',''),(84490,'mace','Beige stone with a hole drilled throu