atter, to the left a whole oxen and an animal\'s leg. On the right there are two oblongs with long grooves and a cone. At the back there is a covered area - possibly an oven. The wall on the right has been repaired.',1859,0,'',' -1795','Middle Kingdom',' -1985','H1628','Foreign Archaeology','offering platter',''),(85859,'basket','Base of coiled basket with straight sides and indented rim for lid (missing).  Fine, narrow coils.',1859,0,'',' ','',' ','0488.TET','Foreign Archaeology','basket',''),(84194,'stela','A rectangular wooden stele with a rounded top. The front is covered in a thin layer of white plaster, over which decoration has been painted in green, blue, red, yellow and black.\nThe top register contains a winged sun disc above a scarab beetle with sun disc and two jackals with flails facing each other. The third register contains 5 standing gods (Four Sons of Ra and Isis) with Horus seated on a block throne with the donor facing to the left with offerings.\nBelow this there are three lines of hieroglyphs. Translation: \'A royal offering, an offering which Osiris, Chief of the West, the Great God, the Lord of Heaven gives, of his giving every offering, every food offering, every good and pure thing for the ka of the the Osiris, the Lady of the House Irturu, justified, mistress of reverence.\' (Dodson, Aidan)',1859,7782,'Thebes (?)',' -501','Late Period (?)',' -600','H505','Foreign Archaeology','stela of Irturu',''),(79653,'tomb model','Carved wooden boat model. The boat is flat topped and curved underneath at the bow and stern. The boat is painted white with red lines on the deck. There are seven male figures with dark red-brown skin and white garments. Six are seated figures, and is standing, and they are all fixed to the boat. There is a tall pole in the middle of the boat and a short pole (pierced at the top) at the stern.',1835,7782,'Sedment (Sidmant)',' -1985','Middle Kingdom',' -2055','H549','Foreign Archaeology','boat tomb model',''),(79598,'relief','