rrying hoes and basket.',1741,0,'',' ','Third Intermediate Period',' 1069-715 BC - 21st Dynasty - 22nd Dynasty','Ha6515','Foreign Archaeology','shabti',''),(85751,'statue','A black carved stone head with an short, ringleted wig with uraeus (cobra) at the front (damaged) which snakes in \'s\' shaped bends across the top of the head. Broken off below the neck.',1835,0,'',' -1295','New Kingdom (?)',' -1550','H5037','Foreign Archaeology','pharaoh head statue (Thutmose IV?)',''),(79533,'statuette','A red granite (quartzite) head of a man wearing a nemes headdress. There is a uraeus (cobra) on the front centre of the headdress, it snakes in \'s\' bends across the top of the head and the tail goes straight down the back of its head. The nose is damaged on the left hand side and the head of the cobra is missing. Everything below the start of the neck is missing. The head of Mentuhotep II.',1835,0,'',' -2107','Middle Kingdom',' -2008','H5038','Foreign Archaeology','statuette',''),(84613,'finger ring','Bright blue finger ring with \'U\'-shaped shank and oval bezil (cartouche) with the name of Horemheb on it.',1835,0,'',' -1295','New Kingdom',' -1323','H4928','Foreign Archaeology','finger ring',''),(84476,'amulet','Standing figure of Bes (naked) in bright blue faience. The dwarf has his hands on his hips and wears a typical plumed headdress with black decoration. He stands on a base and has a hole at the base of his headdress for suspension.',1885,0,'',' ','',' ','H4080','Foreign Archaeology','Bes amulet',''),(84477,'amulet','Standing figure of Bes (naked) in dark blue faience. The dwarf has his hands on his hips and wears a typical plumed headdress with black decoration. He stands on a base and has a hole at the base of his headdress for suspension.',1885,0,'',' ','',' ','H4081','Foreign Archaeology','Bes amulet',''),(80183,'cartonnage (mummy trappings)','Small cartonnage bust with gilt face (intended to cover a mummified body). Blue head-dress with gold, green and red decoration. Painted black eyes and eyebrows.',1885,0,'',' -100','',' -300','H4594','Foreign Archaeology','',''),(79356,'coffin','An anthropomorphic coffin lid, the head half. The face is pale and she has long hair with a winged headdress. There is a pointed collar around the neck. Outer coffin from size.',1772,0,'',' -525','Late Period',' -664','H4557','Foreign Archaeology','coffin lid',''),(79780,'funerary couch','A table with four square legs and raised sides to make a box without a top. It is a trapezium in plan, with the two sloping sides the same length. The wider parallel end has raised decoration with cobras. The painted decoration includes (along the sides) wave-like swirls in green with a yellow background and red triangles underneath. Originally thought to be a funerary couch for mummification but it is now thought more likely that it is a coffin trough in the shape of a funerary bed.',1772,0,'',' 200','Roman Period',' 200','H4590','Foreign Archaeology','funerary couch or coffin',''),(79719,'shrine (?)','A tapering shrine with a rectangular base and no lid. There is a plain, loose piece of wood in the bottom of the box. There is painted decoration on all sides. One long side has three kneeling gods with falcon\'s heads behind one kneeling man. One short end has a bird with outspread wings and a sun disc with uraeus (cobra) on its head. The other long side has jackals lying down on it.',1752,7782,'Akhmim (Khemmis Panopolis) (?)',' -395','Ptolemaic Period - Roman Period',' -332','H4554','Foreign Archaeology','shrine (?)',''),(83402,'window','A wooden door made from two stiles and four rails. There are three inserted panels. It has two integral peg hinges on one side with a slot in the centre of the other side.',1752,7782,'Kom Aushim, N.E. Faiyum',' 400','Roman Period - Byzantine Period',' 400','H4578','Foreign Archaeology','window shutter',''),(83697,'stool','Folding stool made from wood with metal joints in the middle. The seat is missing, but there is a thick black layer (unidentified) on some of the wood.',1742,7782,'Rifa, (Deir) (?)',' -1650','New Kingdom',' -2055','H4606','Foreign Archaeology','stool',''),(84218,'amulets','4 flat wax figures, 2 with broken feet and rounded heads, one with broken feet and ears (jackal headed) and one with feet and a rounded head.',1772,0,'',' 343','Third Intermediate Period - Late Period - Ptolemaic Period - Roman',' -1069','H1112','Foreign Archaeology','son of Horus amulet',''),(34272,'Quartz prism smoky','',526,9600,'Hispenthal',' ','',' ','Da7430','Palaeontology','',''),(62125,'Fossil','',526,7606,'Abereiddy Bay, nr. St. David\'s',' ','',' ','Cb5057','Palaeontology','',''),(25015,'Fossil','',526,7606,'Pont-y-Gorphwys Farm-yard, Pen blwyn, nr. Narberth',' ','',' ','Cb5060','Palaeontology','',''),(25013,'Fossil','',526,6294,'Abereiddy Bay',' ','',' ','Cb3648','Palaeontology','',''),(8934,'Linne\\\'s two-toed sloth','',94,0,'',' ','',' ','Aa770','Biology','Linne\'s two-toed sloth',''),(34284,'Rutile in quartz','',526,112,'Habira',' ','',' ','Da5632','Palaeontology','',''),(34266,'Amethyst','',526,112,'Minas Gerais',' ','',' ','Da7428','Palaeontology','',''),(34267,'Amethyst, cut and polished slice','',526,0,'',' ','',' ','Da5725','Palaeontology','',''),(84275,'jar','A pale red clay jar with a flat base and almost straight sides apart from a pinched decorated shoulder. The rim is flared and rounded. It is decorated with red slip in a geometric pattern. A section of the rim is missing.',6228,7728,'grave X71',' ','Predynastic Period',' 5500-3100 BC','H769','Foreign Archaeology','jar',''),(84216,'amulet','Pink and cream oval amulet with two lugs, on opposite sides, and a drilled lug on the top for suspension or attachment.',1889,7728,'Grave D35',' -1295','New Kingdom (?)',' -1550','H980','Foreign Archaeology','ab (heart) amulet',''),(83930,'stela','Stela of Penamun. A white-cream stone stele, rectangular with a curved top. There is an incised border around the object. The top register contains five columns of hieroglyphs and a depiction of Osiris (wearing an atef crown) seated with a figure behind him and the deceased making an offering in front of him. Below are three rows of hieroglyphs.\nTranslation:\n\'Great of Magic, Osiris Khentyamentiu: offering made by the Priest of the Great of Magic Penamun, justified. A royal offering to Osiris Khentyamentiu and to Great of Magic that they may give 1,000 of bread, [1,000 vessels] of beer, 1,000 of oxen, 1,000 of fowl, and 1,000 of every food and pure food for the ka of the Priest Penamun, true of voice.\'',1835,0,'',' -1186','New Kingdom',' -1295','H514','Foreign Archaeology','stela of Penamun',''),(83322,'foundation deposits','9 model tools made from thin metal sheet. Probably three chisels, a knife, an adze and several unidentifiable objects. All have severe corrosion except one whch has been cleaned and hierogylphs with Tuthmose III\'s name clearly inscribed (all are assumed to have his name, but some are too corroded to be sure).',1770,7728,'temple of Osiris',' -1425','New Kingdom',' -1479','H1062','Foreign Archaeology','model tools foundation deposit',''),(78645,'shabti','mummiform figurine.Pale blue shiny faience. Pilaster at back. Bearded.',1752,7728,'Grave 32',' -1550','Second Intermediate Period',' -1650','H2213.b','Foreign Archaeology','shabti',''),(78646,'shabti','mummiform figurine. Blue shiny faience. Pilaster at back. Bearded.',1752,7728,'Grave 32',' -1550','Second Intermediate Period',' -1650','H2213.c','Foreign Archaeology','shabti',''),(86316,'amulet','Blue amulet of Isis, nursing her son Horus (known as Harpocrates when Horus was a child) on her lap. The figure is crowned and seated on a throne which is decorated with incised cross-hatching. The body, in brilliant blue glaze, is from Thebes, and the head, slightly darker, from Abydos. They are stuck together to look like one figure.',1885,0,'',' ','',' 1886-11-04','H2617','Foreign Archaeology','Isis and Horus (Harpocrates) amulet',''),(84644,'statue (fragment)','Carved foot statue fragment. A carved foot wearing a sandal  (complete with toe nails, toe strap and rush detail on the sandal) and a column of incised hieroglyphs (which would have been inlaid) and a cartouche. Inscription reads; \'[… the King\'s Mother] his beloved Mut-Tuy\'. Apart from being only part of the statue the edges of the piece are chipped and the big and small toes are missing.',1859,7728,'Temple',' -1186','New Kingdom',' -1295','H2722','Foreign Archaeology','Mut tuy carved foot statue fragment',''),(78720,'shabti','Mummiform figurine. Terracotta clay. Overseer (wearing apron).',1741,0,'',' ','New Kingdom (?)',' 1550-1069 BC - 18th Dynasty - 19th Dynasty - 20th Dynasty (?)','H3635','Foreign Archaeology','shabti (overseer)',''),(84055,'necklace','A modern string of dark red roughly round beads with one large orange lozenge at the centre and one orange round bead.',1742,7728,'grave Delta 14 (D14 presumably).',' -1795','Middle Kingdom',' -1985','H1288','Foreign Archaeology','necklace',''),(83833,'figurine','Kneeling figure of a woman with a column shaped hieroglyph (of her name) on her head. She is carved from one piece of wood apart from the lower part of her right arm which is attached by a peg and is bent to her face. She has been painted white with black facial features and a blue wig. She kneels on a wooden base painted red-brown with black rectangles.',1889,0,'',' -343','Late Period',' -380','H438','Foreign Archaeology','Nephthys figurine',''),(83900,'pectoral','Dark blue-green rectangular pectoral with black painted decoration of Osiris seated with atef crown and crook and flail. He is seated in front of an offering table and a column of hieroglyphs.\nThere are 6 hole pierced diagonally, 4 on the top edge, 2 on the bottom.\n\n\nTranslation: Osiris, Lord of Eternity\n(Dodson, Aidan)',1772,0,'',' -1069','New Kingdom',' -1186','H3169','Foreign Archaeology','pectoral',''),(84195,'amulet','Blue-green faience amulet with brown patches and black birds painted on each side. One side has a vulture with outspread wings (the protection of Isis), the other has a bird (heron or akhet, the soul of Re). The overall shape is oval with a lug on either side and a loop on the top for suspension.',1889,7728,'Grave D35',' -1295','New Kingdom (?)',' -1550','H3191','Foreign Archaeology','heart amulet',''),(83720,'votive offerings','7 clay votive offerings made from rolled clay with tapering ends, folded in half, 5 are straight, 2 have the ends crossed over.',1770,7728,'grave 276, altar of Khirfu at Abydos temple',' -2494','Old Kingdom',' -2613','H1100','Foreign Archaeology','clay votive offerings',''),(84379,'finger ring','Silver ring of just over a semi-circle with a flat bezil showing a tall woman wearing a horned sun-disc. There is some green enamel (?) in the incised decoration.',1770,7728,'grave D35 (?)',' -664','New Kingdom - Third Intermediate Period - Late Period',' -1295','H983','Foreign Archaeology','Isis Hathor finger ring',''),(84612,'foundation deposit','6 pale green plain rings, 2 scarabs with no inscription and 2 rectangular tablets with a moulded inscription on one side.',1770,7728,'Aahmes Temple',' -1153','New Kingdom',' -1184','H1098','Foreign Archaeology','foundation deposit',''),(83528,'statue','A fragment of a block statue of Senaaib. It has 4 partial rows of hieroglyphs on one side and a fragment of a row on another.\nTranslation:\n\'May he give a voice offering of beer, bread, cattle, birds, alabaster [vessels], linen, incense … for the ka of the Count, Prince, Royal Sealer, High Steward Senaaib, true of voice, Lord of Dignity, born of …Heremheb [mother] …\'',1770,7728,'Osiris temple',' -1650','Middle Kingdom',' -1795','H2731','Foreign Archaeology','Senaaib block statue',''),(78611,'shabti','mummiform figurine. Pale blue-green shiny faience.\nUninscribed (Dodson 2004)',1742,0,'',' -332','Late Period',' -747','H1015.1','Foreign Archaeology','shabti',''),(78612,'shabti','mummiform figurin