on offerings, bread, beer, oxen, fowl, to Nebinefer, justified.\n(Dodson, Aidan)',1742,0,'',' 395','Ptolemaic Period - Roman Period',' -332','H2714','Foreign Archaeology','stela of Nebinefer',''),(82488,'finger ring','A glazed finger ring, divided into three openwork sections, two with decoration and between them is a seated figure of Horus the elder with a two plumes crown. The glaze is missing in places.',1742,7728,'Grave D35',' -715','Late Period',' -945','H3176','Foreign Archaeology','finger ring',''),(82852,'senet board','1 blue glazed tile with two seated men painted on the front in black.',1742,7728,'grave D6',' -1186','New Kingdom',' -1295','H3198','Foreign Archaeology','senet board',''),(82763,'senet board','1 blue glazed tile with three overlaping birds painted on the front in black.',1742,7728,'grave D6',' -1186','New Kingdom',' -1295','H3199','Foreign Archaeology','senet board',''),(82764,'senet board','1 blue glazed tile with a fish with lotus plants and zig zag water on the front in black.',1742,7728,'grave D6',' -1186','New Kingdom',' -1295','H3200','Foreign Archaeology','senet board',''),(83485,'pot','A round (globular) brown pot with a flat base and rounded rim. There is a large crack down one side.',1742,7728,'grave D226',' ','New Kingdom',' 1550-1295 BC(late)','H3343','Foreign Archaeology','pot',''),(83417,'saucer','Shallow cream saucer with a broken rounded rim. There is a small double lug at one side.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3344','Foreign Archaeology','saucer',''),(86345,'knife','Small curved knife blade, now broken in two. For linen cutting',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3345','Foreign Archaeology','linen cutting knife',''),(84544,'tweezers','Pair of tweezers made from a single piece of metal with a loop bent in the top, Curved ends and slight damage to the main part of the tweezers.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3346.1','Foreign Archaeology','tweezers',''),(84507,'tweezers','Pair of tweezers made from a single piece of metal with a loop bent in the top. One prong is broken off half way down, and the other prong has buckled and perhaps has been corroded.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3346.2','Foreign Archaeology','tweezers',''),(84472,'ear rings','Various gold pieces, including:\none earring of thin gold wire, tapering to pointed ends, one earring of thick wire, one end tapers to a point.\nRing/earring with tapering ends and a groove in the centre. One small gold ring with small balls, one plain small ring. Four gold beads.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3347','Foreign Archaeology','ear rings',''),(81239,'strainer (?)','A hollow tube with pierced holes in four fragments. It would have narrowed to a point originally.  \'Described as a tubular grater in Cemetries of Abydos\'.  Register suggests it could be a rasp or strainer for a sucking tube.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3348.1','Foreign Archaeology','strainer straw (?)',''),(81238,'ring','Plain, adjustable ring , with slightly curved profile.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3348.2','Foreign Archaeology','ring',''),(83707,'bead','Eight (8) bead spacers, rectangular with rounded ends, 6 with 10 holes, two with 6 holes although one is broken across the 6th hole.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3349','Foreign Archaeology','bead',''),(83335,'bead','A string of red (various shades) beads, rounded, cylindrical, straight, biconical or oval.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3350','Foreign Archaeology','beads',''),(84500,'bead','36 cylindrical glass beads, mostly brown/black, 3 green, 2 red.',1742,7728,'grave D226',' -1295','New Kingdom',' -1550','H3351','Foreign Archaeology','glass beads',''),(84616,'bead','Several strings of dark blue rounded beads. A string each of: yellow, cream, white, bright blue, grey and muti-coloured rounded beads.',1742,7728,'grave D226',' -1295','New Kingdom',' -1550','H3351.1','Foreign Archaeology','beads',''),(83486,'scaraboid','Almond-shaped dark blue-green scaraboid made from faience. It is pierced lengthways the underside is inscribed.\nTranslation: \'Lord of all countries\'.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3352','Foreign Archaeology','scaraboid',''),(83487,'bead','Cream coloured cowrie shells, halved and various sizes. They are strung on modern string.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3353','Foreign Archaeology','cowrie beads',''),(80620,'shabti jar','Red coloured pottery very rough at the base. There is one vertical band of yellow paint down one side for decoration. This band is outlined in black. No lid.',1742,7728,'Grave D35',' -1069','New Kingdom',' -1186','H3574','Foreign Archaeology','shabti jar',''),(83488,'mirror','Flat piece of metal in an oval shape with a tapering tang at the base.\nSome of the edges of the mirror are damaged.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3590','Foreign Archaeology','mirror',''),(80606,'bead','5 beads. 2 lozenge shaped, very dark green-blue, with chips of turquoise faience on surface. (length 16mm and length 13mm). 2 faience tube beads. 1 Buff coloured (length 17mm), 1 bluish (length 15.5mm). 1 grey stone barrel shaped (length 11mm).',1742,7728,'grave F46',' -2181','Old Kingdom',' -2345','H3643','Foreign Archaeology','bead',''),(83534,'jar','Ivory cylindrical vase with no base or top, in several pieces. Incised line around rim.',2041,7728,'grave D226',' -1295','New Kingdom',' -1550','H3895','Foreign Archaeology','jar',''),(79585,'stela','A rectangular slab of stone with a curved top. Upper register: standing Isis behind seated Osiris, before an offering table and a man and woman. Columns of hieroglyphs above. Lower register: three women and two men before an offering table with columns of hieroglyphs above. At the bottom there is one row of hieroglyphs.\n\nTranslation: Osiris Lord of Life; Isis the Mother Goddess; the ka of the Scribe of the Granary, Overseer of the estate, more beloved than anything; the Lady of the House Tintiunet, justified; the Chief Goldsmith of the Workshop of Seats, Pay, justified; the Lady of the House Heti; the Overseer of the Priests Nakhtherhkepeshef; the Lady of the House Suro; her daughter Hathor, justified.  All praise to the ka of Osiris-Khentyamentiu, may you give bread, water and breath everyday.\n(Dodson, Aidan)',1752,0,'',' -1186','New Kingdom',' -2195','H515','Foreign Archaeology','stela',''),(84724,'stela','Two registers of low sunk relief scenes and hieroglyphs.\nTop register shows the deceased, Khaemwaset, and his sister, Ast, seated in front of an offering table with two sons and a grandson presenting the offering. Bottom register shows 7 kneeling daughters with musical instruments.\nTranslation (Dodson, Aidan): \'The Osiris Khaemwaset; his sister, the Lady of the House Iset; his son Pay; his son Pawah; the son of his son Amenmose.   Her daughter Tamennefer; her daughter Wiayt; her daughter Tatisy; her daughter Nefertiry; her daughter Tanebet; her daughter Iset; her daughter Nehay.\' \nTranslation (catalogue card): \'The lady of the house Ast. The Osiris, Khaemuas. His son Pai, his son Pa-heh, the son of his son ...mes... Her daughter Em-men-nefer-ta-ra, her daughter Uaay, her daughter Ta-tchas, her daughter Nefer-auth, her daughter Tu-hebt, her daughter Ast, her daughter Ta-hay.\'',2126,7728,'grave D6',' -1069','New Kingdom',' -1295','H518','Foreign Archaeology','stela of Khaemwaset',''),(83577,'bowl','A red burnished pot with colour black inside. The bowl has a flat bottom and a convex profile with a plain rim. There are patches of black on the outside of the pot.',1859,7728,'grave X83',' -3100','Pre-dynastic Period',' -5500','H700','Foreign Archaeology','bowl',''),(86992,'arrow','An arrowhead with a diamond shaped cross-section, two barbs (one broken off) and a tang with a circular cross-section.',1835,7728,'Shuneh Fort',' -525','New Kingdom - Third Intermediate Period - Late Period',' -1186','H1065.2','Foreign Archaeology','arrowhead',''),(79824,'spindle whorl','A piece of stone, domed with a flat bottom and a hole through it. There is a chip in its side.',1752,7728,'Osiris Temenos',' -2890','Early Dynastic Period',' -3100','H1125','Foreign Archaeology','spindle whorl',''),(78644,'shabti','mummiform figurine. Blue shiny faience. Pilaster at back. Bearded.',1752,7728,'Grave 32',' -1550','Second Intermediate Period',' -1650','H2213.a','Foreign Archaeology','shabti',''),(78648,'shabti','mummiform figurine. Blue shiny faience. Pilaster at back. Bearded.',1752,7728,'Grave 32',' -1550','Second Intermediate Period',' -1650','H2213.d','Foreign Archaeology','shabti',''),(83638,'sketch','A sketch of a bird facing right (identified as a hawk on the card). It is painted on in black paint although its back follows and incised line. The rock is buff coloured and uneven apart from the surface where the bird is painted.',1752,7728,'Osiris Temenos',' -1069','New Kingdom',' -1550','H2774','Foreign Archaeology','hawk sketch',''),(84597,'amulets','11 figures of Horus as a falcon facing right and standing on a base. All are flat with modelling of the shape. There is a hole through their neck for suspension. The silver has tarnished black and some have remains of gold on the surface.',1752,7728,'grave Delta 14 (D14 presumably).',' -1795','Middle Kingdom',' -1985','H3427','Foreign Archaeology','Horus amulets',''),(83270,'bead','Roughly oval-shaped bead, with a thin layer of black metal encasing a ceramic former in the centre. The metal casing is coming away from the centre.',1752,7728,'grave Delta 14 (D14 presumably).',' -1795','Middle Kingdom',' -1985','H3428','Foreign Archaeology','bead',''),(79584,'lintel','Rectangular stone slab with three complete and one partial row of hieroglyphs. There are three large cracks and it is broken on all