 shoulder; plain loop handle, engaged curving spout; small solid arcs at join of spout and shoulder, above upper, and above and below lower handle attachments; domed cover with double solid-arc knop. Painted in coloured enamels - pink, orange, yellow, green, blue, purple, brown: around neck a shaded green-wash band below rows of brown-outlined squared rocks with two repeats of a pink and a green scalloped ?bush with blue dots, and a triple-stemmed plant with green leaves and yellow, orange and purple stylised tulips; orange, purple and blue dot-petalled flower-heads to left of tulips; outside of handle painted yellow. Green shaded band around edge of cover.',4255,11863,'',' ','',' 1935','N8349','Applied Art','',''),(121589,'jug, milk','Cream glaze over white body. Squat wide baluster shape on footrim, the upper part of body slightly convex; engaged lip, plain loop handle with small solid arc below lower attachment. Painted in coloured enamels - pink, orange, yellow, green, blue, purple, brown: around body, a narrow shaded green-wash band below rows of brown-outlined squared rocks with two repeats of a pink and a green scalloped ?bush with blue dots, and a triple-stemmed plant with green leaves and yellow, orange and purple stylised tulips; orange, purple and blue dot-petalled flower-heads to left of tulips; outside of handle painted yellow.',4255,11863,'',' ','',' 1935','N8350','Applied Art','',''),(121590,'sugar bowl','Cream glaze over white body. Bowl on short spreading foot, everted rim. Painted in coloured enamels - pink, orange, yellow, green, blue, purple, brown: inside rim, a shaded green-wash band; around bowl, shaded green-wash band below rows of brown-outlined squared rocks with two repeats of a pink and a green scalloped ?bush with blue dots, and a triple-stemmed plant with green leaves and yellow, orange and purple stylised tulips; orange, purple and blue dot-petalled flower-heads to left of tulips;',4255,11863,'',' ','',' 1935','N8351','Applied Art','',''),(121574,'coffee cup & saucer','Tulip-shape cup with vertical plain loop handle with token thumb-spur; saucer has concave sides with everted rim, small shallow well. Cream glaze over white body. Painted in coloured enamels - pink, orange, yellow, green, blue, purple, brown: inside cup rim, a shaded green-wash band; around cup, shaded green-wash band below rows of brown-outlined squared rocks with two repeats of a pink and a green scalloped ?bush with blue dots, and a triple-stemmed plant with green leaves and yellow, orange and purple stylised tulips; orange, purple and blue dot-petalled flower-heads to left of tulips; similar decoration on inner sides of saucer.',4255,11863,'',' ','',' 1935','N8354','Applied Art','',''),(126351,'mould','female figure & 2 children',4559,11863,'',' ','',' 1790-1820','N8406','Applied Art','',''),(126632,'figure: Colston boy','dressed in blue coat and hat, red hatband, belt & stockings, book in left hand',4559,11863,'',' ','',' 1880-1894','N8755','Applied Art','',''),(127419,'plate','Pratt ware.  Printed design in multi-colours: in centre, a ?Swiss knifegrinder with barrow-type pedal-operated grinder, single wheel in front, a barrel dispensing onto grinding wheel; he wears red tunic over brown shirt, green breeches, a feather in his hat; in right background a steep-roofed house with gables, lean-to a figure standing at window; two men in conversation with backs to viewer; left background a cliff, trees, building; small rocks and flowers in foreground;  all within \'beaded\' border. Curvature coloured apple green with narrow pointed geometric outer border.  On flange, band of brown foliate \'S\'-scrolls on yellow ground, separated by \'beading\' from outer band of geometric arches in yellow and brown all between two lines of gilding.',4240,11892,'',' ','',' 1860','Na1024','Applied Art','',''),(25007,'Fossil','',526,6993,'House Mountains',' ','',' ','Cb4799','Palaeontology','',''),(34237,'septarian nodule','',526,0,'',' ','',' ','Da5771','Palaeontology','',''),(160531,'Sculpture','Sculpture known as a Benin Head. Bronze head with a long neck and headwear. African features. Hollow inside. Cast using the lost wax process.\nPossibly made in Benin, by craftsperson using the same techniques as those used to make the royal bronzes, late 20th century. Purchased on ebay from Tony Hill, from Ripon, in 2010.  Bought to be used as handling object in ‘Curiosity’ gallery.',7758,0,'',' ','',' ','Eb304','Ethnography','Benin head',''),(87185,'statute','Cast ceremonial head of an Oba, from Benin City (Nigeria). Tusk holder. This head is hollow inside and was made using the \'lost-wax\' process and would have been placed on an altar to an Oba. The head is shown wearing a coral head piece and beads around the collar. Coral was highly valued by the Edo people and was only worn by royalty. The heads would serve as mediums through which descendants could ask the spirits of their ancestors for the health and prosperity of the kingdom. Rites in honour of the past Oba were directed by special priests. The ancestral shrines were and still are situated in the king\'s Palace in Benin City (in current Nigeria). The metal of brass was highly valued by the Edo people, as it was rare and expensive. When new, it would have been red and shiny, symbolising royalty and beauty, but the metal also does not corrode or rust with time, signifying the continuity of the kingship. From the eigtheenth-nineteenth centuries, tusks were often placed on the ceremonial heads. This head probably dates from 1600-1800 AD.\nThis object was given in exchange by Cranmore Ethnographical Museum, in Kent for a Raratongan head dress, from the Cook Islands, of which Bristol had two. This head may have arrived in Europe as a result of the British Punitive Expedition, in 1897, when the British took a large amount of Beninese art to Britain. Much of the material ended up on the European art market and in European museum collections.',7758,0,'',' ','',' 1701-1900','Ea7821','Ethnography','ceremonial head cast',''),(25083,'Fossil','',526,6054,'steps nr small cave on S. side of headland of Baggy Pt.',' ','',' ','Cb5094','Palaeontology','','[SS 608297'),(62444,'Fossil','',526,6054,'Venn Quarry',' ','',' ','Cb5182','Palaeontology','','[SS 608297'),(74983,'Fossil','',526,6054,'Little Haldon, Teyneworth',' ','',' ','Cb5604','Palaeontology','','[SS 608297'),(34276,'Quartz Chalcedony','',526,6054,'nr Sidmouth',' ','',' ','D2836','Palaeontology','','[SS 608297'),(25217,'sand','',526,6054,'Dawlish',' ','',' ','MT212','Palaeontology','','[SS 608297'),(34244,'Aragonite','',526,6054,'St Just',' ','',' ','MT1121','Palaeontology','','[SS 608297'),(34245,'Aragonite','',526,6054,'Ilfracombe',' ','',' ','MT1122','Palaeontology','','[SS 608297'),(150480,'Fossil','Plastercast of original specimen belonging to the British Museum (BM9NH) 49202)',6565,0,'',' ','',' ','Ce10206','Palaeontology','plesiosaur',''),(128098,'coaster, double','Two circular stands with moulded base rims and reeded, everted rims; turned wood bases; drop ring handle from scroll projection on one side of each; the two linked by a flat hook on one fitting into squared loop on the other.',4426,13076,'',' ','',' 1804-1805','Na1881','Applied Art','',''),(84749,'bowl (miniature)','Miniature shallow  brown bowl, with one handle and two projecting grip on either side of the bowl. It has no base and is undecorated.',0,0,'',' ','',' ','Ha7527','Foreign Archaeology','bowl (miniature)',''),(124547,'plate','Octagonal with circular well. Powder blue ground with reserved panels.  In centre a circle containing chinoiserie riverscape: buildings and willow on rocky shore on right; tree on left, man in boat in foreground.  Extending over flange into well: four fan-shaped reserves, those at N & S containing landscape with willow and rocks, those at E & W with building and rocks; between these, four round reserves each with single flower.\nUnderrim markings of 4 leafy sprigs.',4240,13076,'Bow',' ','',' 1760','N3966.i','Applied Art','',''),(125412,'punch bowl','',4208,12496,'',' ','',' 1724','N5949','Applied Art','',''),(120513,'shoe','Elongated with blunt toe; hollow high heel; high tongue above bow. Painted in blue on a white glaze: solid blue on outside of heels, vertical blue stripes overpainted with darker wavy line on shoe; chevron band down front.\nInscribed \' A H // 92 \' on tongue.',4225,13076,'London (perhaps)',' ','',' 1692, dated','G149.1','Applied Art','',''),(75066,'Fossil','',526,13076,'Primrose Hill, Hampstead',' ','',' ','Cb9000','Palaeontology','',''),(75067,'Fossil','',526,13076,'Primrose Hill, Hampstead',' ','',' ','Cb9002','Palaeontology','',''),(75068,'Fossil','',526,13076,'Primrose Hill, Hampstead',' ','',' ','Cb9003','Palaeontology','',''),(75069,'Fossil','',526,13076,'Primrose Hill, Hampstead',' ','',' ','Cb9004','Palaeontology','',''),(75070,'Fossil','',526,13076,'Primrose Hill, Hampstead',' ','',' ','Cb9005','Palaeontology','',''),(122741,'clock, scientific compensation','Longcase regulator clock with mercury pendulum; an extra hand shows Bristol time',3788,13076,'',' ','',' 1829','G1376','Applied Art','',''),(117392,'painting','',0,0,'',' 1915','',' 1915','K4446','Fine Art','Landscape; formerly used as a background in a Natural History display case',''),(193426,'ceramic figure: \\\'Kneeling Jackal\\\'','',6399,13076,'',' 2007','',' 2007','Na2492','Applied Art','',''),(121793,'ceramic \\\'fountain\\\'','Ceramic model for bronze drinking fountain in Castle Park.',11211,13076,'',' ','',' 1993','Na1792.1','Applied Art','',''),(126781,'tile','Square\nPainted in green lustre with all-over design of three birds amid leaves.',4240,13076,'Sands End Pottery, Fulham',' ','',' 1888-1897','N9169','Applied Art','',''),(122160,'plate','Britton shape F.  Painted in blue on a pale bluish glaze: in well, the arms of the Pewterers\' Company (Azure on a chevron or between three strykes argent, as many roses gules, stalked, budded and leaved vert) with crest (On a wreath of the colour a mount vert, thereon two arms embowed vested argent, holding in both hands erect proper a pewter dish argent) and supporters (On either side a sea-horse or with tail proper), and motto Tota me fiducia Est in Deo.\nOn flange, border of running vine with hatched leaves.\nInscribed on back: \' T // B M // 1750 \'.',4413,13076,'London (probably)',' ','',' 1750, dated','G172','Applied Art','',''),(122740,'tankard','',4391,13076,'\\London\\ (assayed in London)',' ','',' 1710-1711','G1368','Applied Art','',''),(122792,'plate','Britton shape F. Painted in blue on a pale blue glaze with bsb border: in centre, chinoiserie landscape with tall bamboo trees inside fence, and bushes on left, man in boat, four conical trees on horizon at right.\nBritton BSB border A:  Chinese double-scroll pattern alternating with pinecone and 6-petalled flower.\nThree stilt marks under rim.',4522,13076,'London; Lambeth High Street (probably)',' ','',' 1747, dated','G1971','Applied Art','',''),(122810,'plate','Britton shape F.  Painted in heavy dark blue on a pale blue-green glaze; light brown edge. A gardener digging with spade, rake leaning against tree on left; two bushes in pots, one on left, one on right.  Border extends over flange down sides of well: four shaped panels with floral motifs alternating with panels of diaper trellis overlaid with floral motifs.\nInscribed on reverse: \' E / T C / 1774 \'.',4415,13076,'London (probably)',' ','',' 1774, dated','G1993','Applied Art','',''),(122834,'dish: charger','Painted in blue, green, yellow and brown on a white glaze.  In centre, three tulips and two carnations in a 2-handled urn-shaped vase with diagonal decoration;  surrounded by border of four panels containing oak leaves and fruit pattern separated by diaper trellis panels with +-cross in each lozenge.  Blue-dash rim.',4225,13076,'London (probably)',' 1695','',' 1655','G2021','Applied Art','',''),(121821,'posset pot','Bulbous body curving in below a flaring rim; concave-tiered foot; two handles of \'8\' section with serpents, attached to pot with corkscrew curls; engaged \'S\' spout; flattened-domed cover surmounted by a four-strap crown surmounted by a ball-and-cross, with fleurs-de-lys and Maltese crosses around edge.\nPainted in blue on a white glaze: on pot, fashionable figures in landscape with stippled trees; stiff-leaf band on foot; winged angel\'s faces on cover; outlining & detailing on handles, spout and crown.',4411,13076,'London (probably)',' ','',' 1700-1720','G2138','Applied Art','',''),(121788,'plate','Britton shape F. Pale bluish glaze with pink tinge on back. Reserved decoration painted in blue, manganese black and red on a dark blue powder ground: design of twenty playing cards randomly strewn over well; on flange, four reserved flowers with sgraffito stems and leaves.',4407,13076,'London (probably)',' ','',' 1740-1765','G2221','Applied Art','',''),(123046,'caster, pepper','Vase-shaped on pedestal stepped foot with reeded edge. Reeding on shoulder which curves into neck; ogee-domed cap with finial, pierced with vertical rows of holes; rouletted decoration.',4270,13076,'\\London\\ (assayed in London)',' ','',' 1807-1808','G3698','Applied Art','',''),(123050,'sauceboat','Oval with shaped edge, front rising into wide lip; supported on three shell feet applied with shell to body.  Open double-scroll handle with leaf thumbpiece.\n\n\nEngraved under base:  \'W // H*A \'.',4396,13076,'\\London\\ (assayed in London)',' ','',' 1763-1764','G3712','Applied Art','',''),(123131,'teapot & cover','Straight-sided oval with concave shoulders; cover domed in centre and hinged at back. Straight tapered spout at steep angle; turned wood handle with thumb-piece, pinned into silver sockets; oval mushroom-shape wood knop with silver tip.\nBeading round base and rim; bright-cut engraving: oval in centre of each side with interlaced festoons above and below; row of flowers in centre; rouletted chevrons, scallops, &c, round base, on and below shoulder, round cover; two flower sprays on spout.\n\n\nEngraved in centre of one oval: \' TC \' [in script]; opposite, a lion rampant.',4396,13076,'\\London\\ (assayed in London)',' ','',' 1782-1783','G3785','Applied Art','',''),(123132,'teapot stand','Oval; raised beaded rim.  Supported on four claw-&-ball feet.\nEngraved in centre: lion rampant on a baton.\nEngraved under base: \' A+H \'.',4396,13076,'\\London\\ (assayed in London)',' ','',' 1782-1783','G3786','Applied Art','',''),(128085,'tazza','tazza',3494,13076,'',' ','',' 1619-1620','Na1855','Applied Art','',''),(126264,'candle holder: chandelier','36-branch candle holder',3494,13076,'91 Wood Street',' ','',' 1768, dated','N8196','Applied Art','',''),(128084,'ewer','Ewer. Baluster-shaped body on pedestal foot',3494,13076,'',' ','',' 1619-1620','Na1854','Applied Art','',''),(104348,'bead','bead,glass,opaque red',6172,0,'',' 1911','Ming (1368-1644) - Qing dynasty (1644 - 1911)',' 1368','N4798C','Eastern Art','',''),(126293,'spinet','',4257,13076,'',' 1730','',' 1710','N8248','Applied Art','',''),(123404,'sugar vase','Vase-shaped on pedestal foot; swing handle pierced with ovals linked by rosettes.\nCable motif round rim, sides pierced in vertical panes with scalloped border and interlaced bands below.  Simulated drapery festoons looped over four paterae (3 rosette, 1 plain) from which depend two tassels. Lower part of body fluted. Pedestal plain, foot pierced with pointed panels and circles, beaded footrim.\nBlue glass liner.',4270,13076,'',' ','',' 1776-1777','N331','Applied Art','',''),(123405,'taperstick','Shaped hexagonal base with stepped moulding and ornament at corners; plain knop with rope moulding near base of shaft, fluted knop below socket with rope-twist at top and bottom. Separate drip-pan: shaped hexagonal with corner shells.',4270,13076,'',' ','',' 1767-1768','N332','Applied Art','',''),(123406,'snuffers tray','Shaped oblong waisted in centre; flat centre area with raised moulded border, shaped at sides; three shell motifs at each end and one either side of centre.  In middle of one side, an elaborate scrolled open handle with leaf thumb-rest. Raised on four claw-and-ball feet.\nEngraved crest in centre: (?)deer on baton surmounted by coronet.',4393,13076,'',' ','',' 1758-1759','N333','Applied Art','',''),(123407,'sauceboat','Oval, raised on three hoof feet with shell knees; flying double-scroll handle at one end with acanthus thumb-rest.  Gadrooned inside rim, scalloped edge to lip.\nEngraved in centre of one side: lion rampant below two stars within scrolled lozenge surround, flowers and leaves.',4385,13076,'',' ','',' 1769-1770','N334','Applied Art','',''),(123409,'jug, cream','Pear-shape with wavy rim and flat lip; raised on three trefoil feet; thin double-scroll handle with incised thumb-rest.',4270,13076,'',' ','',' 1764-1765','N338','Applied Art','',''),(121814,'bowl','Hemispherical bowl, the upper part of the sides pierced to form twenty-six interlocking circles. Painted in blue on a pale bluish glaze: inside, within the piercing, and eight-petalled \'flower\'; in the centre, a finely-painted flower-and-leaf spray; each \'petal\' bears a lotus flower on a ground of scrolls. Circles detailed in a chain pattern.',4411,11912,'made in Dublin or London',' 1760','',' 1750','N1601','Applied Art','',''),(123842,'teapot & cover','Squat octagonal pear-shape on four cast paw feet with rosettes, feathers. Vertical ridges, convex shoulder, cast floral collar. Lid ginged at back: plain border, domed octagonal centre with leaf scrolls, flower/leaf spray finial.  Curved spout flat on top, ridged below, cast leaf scroll and diaper ornament. Scroll handle of round section, triple anthemion thumb-rest; ivory collars; cast leaf scroll and diaper ornament.\nSections of leaf/flower and diaper ornament on body; plain cartouche on each side.',4270,13076,'',' ','',' 1829-1830','N2153','Applied Art','',''),(124096,'plate','Britton shape A.  Painted in blue, red, green on off-white glaze. In centre a vertical daisy flower flanked by eight strap leaves and two \'seed pods\'.  Inner border of concentric circles; rim border of interlaced arcs.',4417,13076,'London (probably)',' 1740','',' 1720','N3185','Applied Art','',''),(124112,'plate','Britton shape A.  Painted in blue, manganese, yellow on pale greenish-blue glaze.  In centre, lady and gentleman in\n18th century costume, he with arm round her, ?singing.  Rim border of swagged acanthus leaves.',4412,13076,'London (perhaps)',' ','',' 1764, dated','N3200','Applied Art','',''),(124129,'bowl: porringer','Bulbous bowl with everted rim and one applied seven-lobed handle with heart-shaped perforation.  Glazed all over in dark blue  splashed with white tin-glaze.',4225,13076,'',' ','',' 1680-1700','N3217','Applied Art','',''),(124146,'bottle','Double-gourd shaped.  Painted in blue on white glaze.  Powder-blue ground with three eight-lobed reserves on body and three elongated reserves up neck, all containing delicately drawn flowering plants.',4407,13076,'',' ','',' 1765','N3234','Applied Art','',''),(124237,'plate','Britton shape E.  Painted in blue and blue wash on an off-white glaze.  In centre, fashionable standing couple, lady with fan, gent with stick and doffing hat; rudimentary landscape behind, tufted rocks in front.  On flange, a packed border of flower heads and scrolled leaves.',4415,13076,'',' ','',' 1696','N3364','Applied Art','',''),(124639,'plate','polychrome chinoiseries',4372,13076,'Bow',' ','',' 1750','N4058','Applied Art','',''),(124754,'sauceboat','moulded body, painted with floral sprays & green',4269,13076,'Chelsea',' ','',' 1750','N4447','Applied Art','',''),(121317,'tobacco jar in form of a bird','',4344,13076,'',' ','',' 1881, dated','N4484','Applied Art','',''),(124811,'cup, 2-handled','Straight-sided, tapering out slightly from base, everted rim; two cast scroll handles.\nChased chinoiserie decoration: Chinese lady, exotic birds and flowers, 3 ?peacocks, one walking, one swooping, one on pedestal spraying water from beak; clouds, matted ground above base & matted cartouches around handle joins.',4426,13076,'',' ','',' 1690-1691','N4519','Applied Art','',''),(125080,'dish','Moulded in shape of concave flower-head with two layers of yellow-edged petals around brown centre; green twig handle entwined with purple-spotted ribbon, two leaves and blue convolvulus flower at join, extending into spray of large light purple daisy-type flower and orange-red and dark purple small dittos with light and dark green leaves.',4269,13076,'Chelsea',' ','',' 1752-1756','N4955','Applied Art','',''),(125087,'box','Oval form with mouldings around lower edge and around cover. Body plain.\nCover engraved with coat-of-arms of the Barber-Surgeons\' Company: quartered with animal supporters, helm crest on scrollwork; the whole surmounted by a winged ?griffin;\nmotto: \' DE PRAESCIENTIA DEI \'.    Cover also bears inscription:\n\' THE GIFT OF MR STANDFAST SMITH 1769 / MR THOMAS ELLIS, THIRD TIME MASTER \'.',4387,13076,'London (probably)',' 1769','',' 1768','N5052','Applied Art','',''),(125091,'basket','Oval on oval foot with gadrooned edge; foot pierced in quatrefoils; swing handle.\nIn bottom of basket an embossed husk garland and engraved crossed flower stems.\nSides pierced in two stages: lower in geometric panels (lozenge and arrow-headed); upper with embossed husk festoons draped over rosettes and swags hanging down onto lower section. Piercing: in central two sections on either side, scales above festoon, \'C\'-scrolls either side of handle; in end sections, leaf scrolls above festoons, scales or ovals below.  Interlacing scroll and leaf edge broken by flower basket at each end and four pelicans.\nHandle: curved centre section with simple incised border, centre oval, and pierced with \'C\'-scrolls, rosettes, etc; at bottom of handle, \'S\'-scrolls with female-head terminals.',4385,13076,'',' ','',' 1772-1773','N5079','Applied Art','',''),(125094,'fuddling cup','Three baluster-shaped containers interconnecting where they touch, their double handles intertwined; each on small foot.\nOff-white glaze, no decoration.',4225,13076,'Southwark (probably)',' ','',' 1640-1700','N5101','Applied Art','',''),(125154,'coffee pot & cover','Tapered cylindrical from rounded base on moulded foot with diagonal chevron engraving. Tapered \'S\' spout leaves body just below half-way point, acanthus leaves at base and top, collar half-way. Domed cover with moulded rim, hinged above handle, vase finial.  Wood scroll handle with thumbrest, pinned into silver scrolled sockets.\nVertical panels separated by flutes; alternating flat-chased and engraved ornament: flowers  and bell-flowers, dots within cross-hatched lines, trefoil arches; similar decoration around top beneath wavy line.  On cover, radiating flutes and chased ornament: wavy line, chevron band; ditto on spout.\nOn one side, engraved crest between outstretched wings and motto DUM SPIRO SPERO.',4270,13076,'',' ','',' 1737-1738','N5401','Applied Art','',''),(121189,'tea urn on stand','',4327,13076,'\\London\\ (assayed in London)',' ','',' 1759-1760','N5450','Applied Art','',''),(125248,'clock, longcase','marquetry case: flowers, birds. Caddy top, forward-sliding hood.',4256,13076,'',' 1705','',' 1700','N5569','Applied Art','',''),(125286,'jug, cream','Squat pear shape with lip and double-scroll handle; shell pendant below lip\nBody ribbed and fluted in four sections.  In centre of each side, a crude cast assymetrical cartouche with plain centre.  Flat-chasing below rim: scroll border, radiating design, cross-hatching above cartouches; radiating design on lip and below upper handle join.  Handle has alternate vertical and horizontal scales and leaf thumbrest.\nBelow lip, an engraved crest: three animals on a baton.',4395,13076,'',' ','',' 1736-1737','N5599','Applied Art','',''),(125290,'bowl','',4395,13076,'',' ','',' 1955','N5607','Applied Art','',''),(125352,'inkstand','Boat-shaped stand on four claw-and-ball feet; raised border with beaded edge, pierced with husk band and anthemion at each end.  Along centre, three circular galleries secured by removable rod under base: beaded edges, two bands of pierced husks, bright-cutting. In each gallery a facet-cut glass bottle with silver cap: beaded edge, rouletting, variously pierced: on with leaf design (pounce), one with three round holes (quill holder), one with single round hole (inkwell).  Central gallery enclosed by four uprights curving in to support socket for taper: beaded rim.',4393,13076,'',' ','',' 1784-1785','N5806','Applied Art','',''),(125432,'scent flask','Opaque-white glass with gilded decoration.  Flattened form tapering out to shoulder, short cylindrical neck with stopper.  Front and back shallow-cut in lozenges, chamfered to panel-cut corners and narrow, flat sides.\nGilded decoration: on one face, four trefoils at each lozenge intersection, dot-encircled larger dot in centre of each lozenge; on opposite face, interlocking embellished circles enclose each lozenge, dot-encircled larger dot in centre of each lozenge. Dots on chamfers and sides; cut panels outlined , an elongated oval in each; sunbursts on shoulders; on neck, two lines between a scalloped rim and thick band. Dot-encircled larger dot on each face of stopper, top edge gilded.',4493,13076,'',' 1775','',' 1765','N6002','Applied Art','',''),(121833,'plate','Britton shape F.  Painted in blue, red, green, yellow on a pale blue glaze: in centre, a parrot perched on branch of a tree stump, flowers sprouting all round; all within a double circle; on flange, three repeats of a pine-cone with flowering stems.',4411,13076,'Lambeth High Street',' ','',' 1765-1775','N6470','Applied Art','',''),(121852,'plate','Britton shape B. Painted in blue on an off-white glaze: a windmill between two trees and before a building with smoking chimney; on flange, border of intersecting and opposing arcs with thickened crescent at each junction and dots between.',4415,13076,'London (probably)',' 1760','',' 1740','N6471','Applied Art','',''),(121916,'plate','Britton shape A. Painted in blue on a pale bluish glaze: within a broad circle, a male head-and-shoulders portrait half-turned to left, hair tied in a \'queue\', between the letters I and W, above circle, \'Esq.\', below circle \'45\'; double banded circles on flange.\nInitials identify portrait as John Wilkes; \'45\' refers to issue 45 of his magazine, the North Briton.',4413,13076,'London (probably)',' 1775','',' 1755','N6475','Applied Art','',''),(125485,'plate','Britton shape F.  Painted in blue, manganese, red, green and yellow on a pale blue-green glaze.  In centre, hexagonal \'spider\'s web\', the outer edge embellished with stylised flower buds with scrolling tendrils, a flower head in centre.  On flange, four sections of spider\'s web alternating with triple-flowered stem.',4412,13076,'Lambeth High Street',' ','',' 1790','N6478','Applied Art','',''),(122191,'plate','Britton shape F. Painted in blue and manganese purple on a pale blue glaze: within a scroll-and-quinfoil circle, a male head-and-shoulders portrait half-turned to right, wearing uniform and hair arranged as a toupee; identified on flange at bottom as \' ADMIRAL KEPPEL FOR EVER\'; inside rim, a narrow border of trellis and debased Chinese symbols.',4413,13076,'London; Lambeth (perhaps)',' 1785','',' 1779','N6490','Applied Art','',''),(121835,'plate','Britton shape E octagonal.  Painted in blue and pinkish manganese wash on a pale bluish glaze: Chinaman seated among mossy rocks within double and single circles; on flange, similar Chinaman at top left and bottom right and four mossy rocks.',4225,13076,'London (probably)',' 1700','',' 1680','N6494','Applied Art','',''),(121820,'posset pot & cover','Tall cup-shape body with straight sides curving into a waist above a flattened-dome foot; raised bead above below rim; domed cover  surmounted by a sampling cup in place of a knob; two elaborate scroll handles on pot and two more on cover. Painted in blue on a white glaze: figures and dog in landscape with ruins and stippled-foliage trees, similar scenes on cover; formal flower and scroll border reserved on blue ground below rim of pot. On foot, oval reserves each containing a flower/leaf sprig, on hatched ground; leaf scrolls on sampling cup. Handles painted solid blue.',4411,13076,'London (probably)',' 1750','',' 1730','N6632','Applied Art','',''),(121818,'bowl, butter','Bowl with tapered sides rounded into shortfoot ring, everted convex rim forms seat for cover (missing); fixed inside bowl is a tapered triangular spike.  Painted in blue with black trek on a pale bluish-green glaze: around outside, five bunches of grapes on scrolling branches; rim border of Chinese scrolls.',4411,13076,'London (probably)',' 1770','',' 1750','N6654.A','Applied Art','',''),(125574,'teapot & cover','Depressed globular shape with straight conical spout and plain \'O\'-shape handle. All-over dark-blue glaze, inside and out.',4270,13076,'',' ','',' 1770','N6655','Applied Art','',''),(122202,'dish: charger','Painted in blue, yellow, green on an off-white glaze. Standing figure of a queen identified as Queen Anne by the initials \'A R\'. She wears an open robe with zig-zag borders down open edges, five ruffles across bottom of petticoat; in  her outstretched right hand she holds a sceptre erect and in her left hand an orb. She stands between two trees with sponged foliage; foreground washed in green and overpainted with fanned-finger grasses.\nBlue-dash edge.\nBack with brownish lead glaze.',4460,13076,'perhaps Norfolk House',' 1714','',' 1702','N6678','Applied Art','',''),(125651,'sugar basket','Oval boat-shape on spreading pedestal foot; the sides in zig-zag form; reeded rim and foot; reeded swing handle in zig-zag form.',4429,13076,'',' ','',' 1795-1796','N6832','Applied Art','',''),(125727,'font, christening','Thistle-shaped bowl with flaring tri-lobed rim, on ornate pedestal foot. Tri-lobed base on three scroll feet with cabochons, pierced apron between with fox-head centre.  Elaborate border with scrolling X\'s etc; platform on which stand three young girls, drapery around waists, hair tied up, linked by the garlands they hold, leaning against, as if supporting, the central pedestal. Beaded gadrooned knop above their heads, other gadrooned & disc knops.  Base of bowl has nine ovoid protruberances with delicate scroll trophies on ridged ground. Three applied straps up sides of bowl curving round to rim to form ornamented handles each with a youth astride, with cymbals, Pan pipes, trumpet. Pointed moulding on ridged rim\n\n\nInscribed on bowl: \' TO THE HONBLE / VICTORIA ALEXANDRINA ELIZABETH CAMPBELL / From her Godmother / VICTORIA R / 6th May 1843. \'',4387,13076,'',' ','',' 1842-1843','N6963','Applied Art','',''),(125781,'teapot & cover','Inverted pear-shape on moulded circular foot. Ridged loop handle with ivory collars and scroll ends, scroll thumb-piece. Faceted  \'S\'-scrolled spout with cast anthemion leaf & flowers at base.  Flat cover hinged above handle, flat scroll ears either side of hinge; raised rose knop.\nBody divided into six sections by vertical grooves; at top of each section a flower spray; in centre section on one side, a flower garland enclosing the monogram AR below a crown.',4270,13076,'',' ','',' 1838-1839','N7022','Applied Art','',''),(125804,'funnel, wine','Bowl pierced, with gadrooned rim and shaped hook at side; flange fits into moulded base of spout; spout tapers and bends towards top.',4426,13076,'',' ','',' 1768-1769','N7077','Applied Art','',''),(125810,'mug','Slightly waisted cup on circular pedestal foot; cast double-scroll handle.\nMoulded rim; embossed decoration: opposite handle a plain cartouche within scroll borders, flowers below, eagle above its head bent down; swag of roses on either side. Recessed trefoil-headed arch in centre of both sides; in one an Eastern female wearing wide trousers, a ewer in her raised right hand, a cup in left; in other, anothr female wearing trousers & bodice, dancing; flower sway on each side of handle. Leaf branches above arches. Four applied plaquettes on foot: scroll border, seated figure playing lyre.',4395,13076,'',' ','',' 1861-1862','N7105','Applied Art','',''),(125811,'knife, fork, spoon','KNIFE: scroll borders on handle, terminating in two back-to-back cherubs; Eastern female dancing, clown\'s head below a cartouche; on lower part of blade, another female with ewer in her raised right hand, a cup in left, on matted ground.\nFORK: 4-tined; cast terminal of a dancing lade on matted ground, two back-to-back cherubs at top, face at base; on reverse, scrolled cartouche, eagle at top, bearded head below; at base of tines, a figure playing a lyre in a scrolled cartouche, a smiling face below.\nSPOON: slightly pointed oval bowl; handle same as fork.',4387,13076,'',' ','',' 1850-1851','N7106','Applied Art','',''),(123452,'plate','Circular plate, Britton shape G. Painted in blue on a pale blue glaze: rim-to-rim scene of two figures in a landscape: a female figure perched on a bank, her right arm outstretched, pointing to a ruined arch; shepherd with his \'houlette\' leans his elbows on bank; large overarching tree to right of ruin, gate and another tree to left of figures; three birds top right, fence and shrubs across foreground.',4411,13076,'London; Lambeth (perhaps)',' 1780','',' 1760','N7111','Applied Art','',''),(121938,'plate','Britton shape F. Painted in blue, red, green, yellow and manganese on a pale bluish glaze: chinoiserie garden: trellis fence zig-zags across centre; tall spindly tree in centre, flanked by two bottle-brush plants and two ferns behind fence;  two ferns in front of fence; all within a double circle; on flange, five floral festoons each with central complex flowerhead; a semi-circle and swag at each suspension point.',4412,13076,'London (probably)',' ','',' 1790','N7113','Applied Art','',''),(121937,'plate','Britton shape F. Painted in blue, red, green and yellow on a pale blue glaze: chinoiserie garden, left to right, a fern, raised terrace with balustraded steps, a tall bamboo, rectangular rocks, a fern; all within a red wavy circle; on flange, border design of scrolls interrupted by four scroll motifs with stroked wings.',4412,13076,'London (probably)',' ','',' 1780','N7115','Applied Art','',''),(125935,'tea casket containing 3 tea jars','Oblong casket on four square feet; lid ogee-domed, hinged at back with swing scroll-loop handle. Pierced silver cagework: apron around bottom; interlacing arcades on sides with relief figure groups (2 on front & back, 1 on each side) in 18th-centurycostume; musical & military trophies on lid with mask-heads, festoons, leaf-scrolls; lock in centre front with mask-head key. Interior divided into three, lis hollowed out, lined red velvet with silver braid.\nThree rectangular, straight-sided blue glass jars encased in silver cagework similar to casket; slightly-domed covers with figure finials: 2 seated males, 1 seated female',4662,13076,'',' ','',' 1771-1772','N7388','Applied Art','',''),(125938,'coffee pot & cover','Baluster-shape with ogee base on round pedestal foot with step-moulded edge and gadroon border. \'S\'-spout rises from mid-way; turned wood handle with thumbrest, pinned into silver scrolled sockets.  Domed cover hinged to handle socket; gadrooned edge, three embossed leaf swirls, flower-bud finial.\nLower part of body with embossed decoration: spiral gadroons alternating with leaf sprays, upper limit of embossing wavy with leaf/bud sprays.  Moulded spout with beading down centre and at top, acanthus at base; shell under top handle socket, two leaf sprays below rim.\n\n\nEngraved creat in centre of one side: (?)stork among reeds, motto above: LE BON TEMPS VIENDRA.',4270,13076,'',' ','',' 1770-1771','N7448','Applied Art','',''),(126007,'teapot stand','Shaped lozenge form raised on four flat cabriole feet; raised mouded edge.\nBright-cut engraving:rouletted rim, band of engraving withing moulding: alternate vertical & horizontal rosettes interspersed with circles, edges with rouletted chevron and scalloped lines.\nEngraved in centre: GSS in script within oval rouletted border, scalloped & festooned.',4429,13076,'\\London\\ (assayed in London)',' ','',' 1788-1789','N7688.ii','Applied Art','',''),(126009,'teapot & cover','Shaped straight-sided oval form with tapering straight spout from near base nd turned wood handle with thumb-piece, pinned into silver sockets; cover hinged above handle and rising to shallow dome with pineapple knop with silver leaves.\nBright-cut engraving: round top & bottom, bands of alternate vertical & horizontal rosettes interspersed with circles, edged with chevron line; two bands of circles down chamfered surfaces on each side; rouletted festoons around shoulder. Cover has gouged edge, rouletted festoons, scalloped band & circles round dome, circles below knop; scalloped band and circles around top of spout.\nEngraved in centre of one side: GSS in script within oval rouletted border, scalloped & festooned.',4429,13076,'\\London\\ (assayed in London)',' ','',' 1788-1789','N7688.i','Applied Art','',''),(126010,'tea box','Shaped straight-sided oval form with concave shoulder. Cover hinged at back, and rising to shallow dome with pineapple knop with silver leaves.\nBright-cut engraving: round top & bottom, bands of alternate vertical & horizontal rosettes interspersed with circles, edged with chevron line; two bands of circles down chamfered surfaces on each side; rouletted festoons around shoulder.  Cover has gouged edge, rouletted festoons, scalloped bands round dome, circles below knop.\nEngraved in centre of front: GSS in script within oval rouletted border, scalloped & festooned. Keyhole above.',4429,13076,'',' ','',' 1790-1791','N7689.i','Applied Art','',''),(126008,'jug, milk','Helmet-shaped on narrow-pedestal spreading into circular foot on a step-moulded square base; ribbed tall loop handle.\nMoulded rim above band of bright-cut engraving: alternate vertical & horizontal rosettes interspersed with circles, rouletted and scalloped borders. Ditto scalloped border around foor, festoon border to base.\nEngraved below lip: GSS in script within oval rouletted border, scalloped & festooned.',4429,13076,'',' ','',' 1790-1791','N7689.ii','Applied Art','',''),(126011,'cup, 2-handled','Lower part of body bulbous and heavily embossed with flowers etc in Dutch taste; upper half waisted and plain.  Two cast scroll handles; chased and matted floret where top ends attach to body.\nIn centre front an engraved shield: three horns on dotted ground (\'or 3 horns in pile gu\') [c.1800].\nEngraved under base:  \' S // R M \'  and  \' S*R \'.',4426,13076,'',' ','',' 1685-1686','N7690','Applied Art','',''),(126012,'coffee pot & cover','Vase-shaped on pedestal foot; \'S\'-spout rises from shoulder; wood scroll handle with thumbrest pinned into silver scroll sockets.  Domed cover with pointed finial hinged to upper handle socket. Foot domed in centre with embossed and chased flower festoons; stiff acanthus leaves around base of body, raised festoons of ribbon-tied flowers above; beading on shoulder; neck fluted above plain festoons.\nArea round base of spout and handle sockets richly scrolled; leaf ornament on spout; beading round rim; flower festoons on cover.\n\n\nEngraved in centre of one side:  \' R A S \' above crossed flower stems.',4270,13076,'',' ','',' 1773-1774','N7691','Applied Art','',''),(126013,'tray: salver','Circular, raised on three gadrooned feet; shaped and raised pie-crust border with gadrooned edge.\nIn centre, engraved coat-of-arms within rococo scroll borders and flowers: three squares above, ?dog under star below.',4429,13076,'',' ','',' 1769-1770','N7692','Applied Art','',''),(126014,'mug','Plain baluster form on moulded foot; reversed-double-scroll handle with scroll thumbrest.\n\n\nEngraved under base: \' 1753 \'.',4426,13076,'',' ','',' 1753-1754','N7694','Applied Art','',''),(126015,'sugar vase & cover','Ovoid body on short stem and flat circular foot. Two squared-top loop handles. Cover rises steeply in centre to a collar below small dome surmounted by plain acorn finial.\nBead moulding around rim, foot rim, collar; flower border below rim Pierced band around upper part of body: central plain round cartouche, florets in ovals, leaf scrolls; on opposite side a central floret oval, between two anthemion-within-oval, leaf scrolls.  Rouletted chevrons around foot, collar; festoons below piercing and on rim of cover; pointed panels on lower body in double lines.\nBlue glass liner.',4395,13076,'',' ','',' 1789-1790','N7695','Applied Art','',''),(126080,'box, seal','Circular, the top forming a separate cover with moulded edge.\nOn cover: the arms of Bristol in relief on a matted ground (between two unicorns, a shield on which a ship emerging from castle; crest, crossed arms holding an arrow-tongued serpent and a pair of scales; motto, VIRTUTE INDUSTRIA).\nAround sides, engraved floral meander, scrolls, bird pecking at basket of flowers, two flower urns, flower basket.',4476,13076,'',' ','',' 1759-1760','N7829','Applied Art','',''),(126123,'drinking glass: beaker','Opaque-white glass.  Tapered cylindrical shape; polished base with large chip (remains of pontil mark).\nBottom third panel cut.\nGilded decoration: gilt rim and line below; procession of four classical figures: on left of urn, male holding spear & roses; on right of urn, female holding (?)bow and pail; third figure holds dish & spear; fourth holds helmet 7 shield. Mosaic ornament on cut panels: alternate oval flower-head and cross-hatching with dots.',4493,13076,'',' ','',' 1775','N7957','Applied Art','',''),(126158,'candle holder: candelabrum','Candlestick with removable branches. Shaped square base with scroll edges, shell in centre of each side, mask-heads representing Seasons at corners; raised platform in centre with circular plinth   from which rises knopped shaft; linked circles on bottom knop, faceted centre knop, sloped shoulders below socket with acanthus and mask-heads; octagonal socket with cushion base, raised rosettes, interlaced scrolls, moulded rim.\nTwo-arm branch fits into socket: from scrolled centre, two branches scroll up and round finial curving up to octagonal sockets decorated as centre one, with petal drip-pans, alternate petals matted. The branches sheathed in scrolling leaves and flower. Swirled finial in centre with leaf scrolls, shell, flowers.\nEngraved crest on base: quartered lozenge in leaf-scroll mantling.',4393,13076,'',' ','',' 1745-1746','N7999.i','Applied Art','',''),(126159,'candle holder: candelabrum','Candlestick with removable branches. Shaped square base with scroll edges, shell in centre of each side, mask-heads representing Seasons at corners; raised platform in centre with circular plinth   from which rises knopped shaft; linked circles on bottom knop, faceted centre knop, sloped shoulders below socket with acanthus and mask-heads; octagonal socket with cushion base, raised rosettes, interlaced scrolls, moulded rim.\nTwo-arm branch fits into socket: from scrolled centre, two branches scroll up and round finial curving up to octagonal sockets decorated as centre one, with petal drip-pans, alternate petals matted. The branches sheathed in scrolling leaves and flower. Swirled finial in centre with leaf scrolls, shell, flowers.\nEngraved crest on base: quartered lozenge in leaf-scroll mantling.',4662,13076,'',' ','',' 1745-1746','N7999.ii','Applied Art','',''),(126186,'cup, standing, & cover','Ovoid bowl on pedestal circular foot rising to a plain flattish centre; large 4-lobed swelling at base of pedestal tapering to a plain knop below inverted acorn knop; flat knop below cup.\nCover slightly domed in centre, surmounted by standing figure of draped putto reading a book.\nCast ornament: beading round foot and cover rim, band of lilies etc around foot; four relief figures of crouched girls on base. Two cartouches on acorn knop, 1 with monogram \' GH \'; two ovals on bowl within Maltese cross borders: in one, relief scene of Christ with children; in other, the raised legend: \' TO GEORGE HOLT / 3RD DECEMBER 1869 / WITH THE / LOVE AND BLESSING / OF HIS GRANDMOTHER / EMMA HOLT. \'  Flowers and strapwork over rest of body; on cover, three bands of floral meander on matted ground.',4656,13076,'\\London\\ (assayed in London)',' ','',' 1869-1870','N8032','Applied Art','',''),(126203,'spurs, a pair','Semi-oval form with projecting spur at rounded end onclosing the steel rowel. Round knob at each end; around one is fitted an oblong silver buckle with steel prong; other one would receive leather strap (missing).',4393,13076,'',' ','',' 1790','N8089','Applied Art','',''),(126206,'ladle, punch','Oval deep bowl with shaped edge, a lip at each side.  Chased and embossed decoration: flowers under lips, \'v\'-shaped stylised leaf at base of handle and opposite, with four inverted \'v\'-ridges between.\nWhalebone handle, twisted at upper end, pinned into silver socket; silver tip.',4426,13076,'',' ','',' 1759-1760','N8092','Applied Art','',''),(121861,'tureen, sauce, & cover','Oval-section body on oval pedestal foot; two high-loop handles. Cover has flat edge rising to dome in centre; urn finial with foliate top.\nReeded rim with three cross ties on each side, above rouletted line and border of gouged diagonal ovals each suspending a four-dot drop; row of beading around foot.  Upper terminals of handles of leaf-form, upper part reeded, with two inside and one outside kicks. Rouletted & gouged border around edge of cover; scalloped rouletted line around base of finial.\nEngraved stag\'s head armorial on body and cover.',4385,13076,'',' ','',' 1782-1783','N8174','Applied Art','',''),(126262,'soup tureen, cover & stand','Oval tureen with two reeded loop handles, raised on four tall scroll feet, leaf ornament entwined with ribbon on front.  COVER domed in centre with oval finial.  STAND oval with scroll-over handles at ends; domed centre oval with sunken centre, dished surround in which tureen feet stand.\nEmbossed and applied relief ornament - tureen: stiff acanthus on lower part with more lively leaves above feet; guilloche band above beading below beaded rim; guilloche has plain ribbons enclosing alternate flowers on matted ground.  COVER: plain concave border rising to beaded ridge, stiff acanthus on dome; beading round edge of central oval with acanthus, leaves & flower centre on finial.  STAND: beaded rim, acanthus on handles & rosettes at ends os scrolls; plain border, guilloche band, plain dished area, stiff acanthus on dome & central free-standing flower with closed centre & rows of petals.\n\n\nEngraved crest in centre front of cover: raised arm clasping dagger.',4385,13076,'',' ','',' 1776-1777','N8193','Applied Art','',''),(121819,'flower holder: wall pocket','Ovoid bowl of semi-circular section above a narrow waisted section above a double graduated convex moulding ending in a collared terminal. Painted in blue on on a pale blue glaze: a Chinaman in a fenced garden with bamboo and flowering plants and overhanging rocks; flowers and rocks on waisted section; the base mouldings solid blue.',4411,13076,'London; Lambeth (probably)',' 1760','',' 1740','N8472','Applied Art','',''),(126462,'coffee pot & cover','Tapering octagonal form heavily moulded at base on spreading octagonal foot;  slightly concave shoulder; high-domed cover with flattened onion finial, hinged above double-scroll handle with thumb-rest, ivory collars.  \'S\'-scroll spout rises vertically with flourish at top.\nChased decoration: on foot, cover, top of handle, spout: trefoil-headed arches, quatrefoils on matted ground. Each facet of body has a sunken round-headed panel chased with Corinthian columns at sides, scalloped arches. In centre panel on each side, an elongated shield cartouche, one engraved: cockerel within buckled border inscribed: COMMIT THY WORK TO GOD.  In side panels, mother-and-child, king on pedestals.  Curved indentation in sides of spout. Scalloped edge to cover.',4656,13076,'',' ','',' 1847-1848','N8555','Applied Art','',''),(126645,'tea casket & contents','Casket containing tea jar, sugar basket, 12 teaspoons, mote spoon, sugar tongs.\nCASKET: leather-covered rectangular wood box lined with red velvet trimmed with silver braid, raised on 4 silver claw-&-ball feet, silver lock plate, hinges and squared loop handle on cover which is hinged at back & has ogee-moulded sides; interior compartmented.\nJAR:  inverted pear shape on circular foot; domed cover with gadrooned finial & rim; all-over spiral scrolled gadrooning.\nBASKET:  oval on oval foot, swing handle; pierced sides - lines of embossed beading between alternate pierced patterns; \'C\'-scroll rim; serpents at ends of handle.\n12 TEASPOONS:  pointed oval bowl, gadrooned; double-scroll stem.\nSUGAR TONGS:  scissor type with scroll arms, ring finger holes, shell ends.',4429,13076,'',' ','',' 1759-1760','N8773','Applied Art','',''),(126646,'dish: charger','Royal Yacht.  Painted in blue, dark red, green, yellow, brown on off-white glaze.  Central scene: on left a yacht flying the St George\'s Cross, the Lord High Admiral\'s pennant and other unidentified flags; on right, domed church and other buildings, trees;  sun shines in sky.  Border: six paired oakleaves all facing same direction, an apple within each pair, pyramid of ?grapes between.\nFootrim pierced for suspension.',4225,13076,'London (probably)',' 1688','',' 1648','N8774','Applied Art','',''),(126683,'teapot','Depressed melon shape on shaped circular foot; thick loop handle with scroll thumb-piece and bone insulating collars, the upper terminal shell-shaped.  Ridged shallow-\'S\'-curved spout at 45 degree angle to body.  Slightly domed cover hinged above handle with raised flower/leaf knop.\n\n\nEngraved in centre of one side: \'  A.G.L. \'',4656,13076,'',' ','',' 1825-1826','N8970','Applied Art','',''),(126761,'cup: beaker','Cylindrical form with flared rim; on concave foot; engraved strapwork\nEngraved inscription: RICD TOWGOOD / …',4391,13076,'',' ','',' 1629-1630','N9130','Applied Art','',''),(126839,'bowl','Open bowl on foot.  Straight-sided bowl tapering sharply in from rim to ogee junction with cylindrical slightly tapered foot.  Half-spherical hollow at base of bowl; throwing marks.       \nMatt white glaze, lightly pitted; band of manganese bronze pigment over rim, dripping onto glaze.  Glaze wiped off bottom 5mm of foot.',4627,13076,'',' ','',' 1979','N9375','Applied Art','',''),(127149,'teakettle on stand','Kettle: inverted pear-shape, curved spout; domed cover hinged at side, pineapple finial, chased floral garland and border; swing handle, leaf-ornamented double-scroll uprights, top sandwiched between mother-of-pearl insulating strips with centre floret. Upper part of body & spout heavily embossed with flowers and scrolls; shell motifs at base of handle. In centre of each side, a rococo cartouche engraved with coats-of-arms: front, halved with sheep\'s heads and crosses; opposite, (shield soldered in) cross between outstretched wings (this crest also on lamp).\nStand: three scroll legs, leaf ornament on knees, shell feet, linked by flower swags; collar with wavy edge above cast flowers, leaves, scrolls.  Separate spirit-lamp supported in centre on three brackets from the legs: plain lid with narrow chimney; lamp engraved with flower swags and geometrical pattern on shoulder.',4429,13076,'',' ','',' 1749-1750','Na435','Applied Art','',''),(127655,'decanter & stopper','Opaque-white glass.  Sugar-loaf form. Decorated in gilding in the manner of James Giles: swags, paterae',4493,13076,'London (probably)',' 1785','',' 1765','Na1367','Applied Art','',''),(128093,'teapot & cover','Rectangular with rounded corners, slumped in centre, raised on four ball feet; tapering square spout from base of pot; squared wood handle with scroll thumbrest, pinned into silver sockets; concave shoulder below a raised rectangular centre with square-domed cover hinged above handle, wood oval mushroom knob.\nHorizontal reeding on upper part of body; bright-cut engraving: floral/leaf festoons on body, rouletted line in centre of reeding and below shoulder; band of paired leaves, rouletting on shoulder; gadrooned rim; rouletted scallops around cover.',4270,13076,'',' ','',' 1813-1814','Na1876','Applied Art','',''),(128094,'salver','Circular, raised on four hoof feet; shaped and raised piecrust border.\nIn centre an engraved crest: a seated hound.',4393,13076,'',' ','',' 1732-1733','Na1877','Applied Art','',''),(128095,'taperstick','Hexagonal section: domed foot with moulded edge, two moulded knops in stem, socket with moulding top and bottom and circular inside.',4270,13076,'',' ','',' 1723-1724','Na1878','Applied Art','',''),(128096,'taperstick','Octagonal section: step-moulded base with wavy edge; octagonal stem with plain knop near base, gadrooned knops below socket which has rounded moulding at top and bottom.\nEngraved under foot:  \' WT \'.',4393,13076,'',' ','',' 1736-1737','Na1879','Applied Art','',''),(128097,'pap boat','Boat-shaped on flat base, pouring lip.\nSlight hammered finish.\nEngraved under base: \' A*B \'.',4393,13076,'',' ','',' 1746-1747','Na1880','Applied Art','',''),(128174,'mug','painted in underglaze blue with stylised landscape; handle of silver form.',4372,13076,'Bow',' ','',' 1747-1752','Na2037','Applied Art','',''),(128175,'teapot & cover','painted in underglaze bright blue with \'banana tree, fence & stork\' pattern.',4372,13076,'Bow',' ','',' 1747-1752','Na2038','Applied Art','',''),(128176,'teapot & cover','enamelled in Kakiemon colours with red-dragon-and-tiger pattern.',4403,13076,'Chelsea',' ','',' 1750-1752','Na2039','Applied Art','',''),(128177,'vase','enamelled in Kakiemon colours with \'banded hedge\' pattern.',4403,13076,'Bow',' ','',' 1750-1752','Na2040','Applied Art','',''),(128178,'dish','rococo-moulded reserves on rim painted with fable scenes attrib.to J.H.O\'Neale; centre enamelled with sprays of European flowers.',4269,13076,'Chelsea',' ','',' 1755','Na2041','Applied Art','',''),(128346,'caster, pepper','',4385,13076,'',' ','',' 1850-1851','Na2229','Applied Art','',''),(121909,'tea box','Rectangular section with cut corners. Step-moulded base; raised round-headed panels on all four sides; top edge convex-moulded with groove on three sides to take sliding cover; cover is flat with raised central collar over which fits a domed octagonal cap with finial.\nEngraved on one side with a coat-of-arms: two [?]lions passant within baroque mantling, shell crest; on opposite side, demi horse rising from a crown.\nEngraved under base: \' AxH   Pr 27=17=0\'.',4429,13076,'',' ','',' 1723-1724','Na2313','Applied Art','',''),(121664,'Argyle','Vase-shaped on circular pedestal foot with rounded steps down to reeded edge; reeded rim. Straight, tapered spout. Ivory handle with thumb piece. Cover rises to steep dome with acorn finial; round-stepped edge. Inside a tapered, straight-sided hot-water container with tight-fitting cap.',4385,13076,'',' ','',' 1786-1787','Na2314','Applied Art','',''),(121797,'marrow scoop','Central shaft with short, wide oval-ended scoop at one end and longer, narrow oval-ended scoop at opposite end.\nEngraved on back: \' T:S // ML // 1771 \'',4385,13076,'\\London\\ (assayed in London)',' ','',' 1762-1763','Na2333','Applied Art','',''),(121837,'jar, ointment','',4225,13076,'London; Lambeth (perhaps)',' ','',' 1670-1700','N5727','Applied Art','',''),(123834,'drinking glass: goblet','',4588,13076,'Whitefriars',' ','',' ','N2144','Applied Art','',''),(121915,'plate','Britton shape F.  Painted in blue on a pale bluish glaze: a balloon flight: two men wearing hats seated, rowing, in gondola below a balloon, two flags; below them, a landscape with two houses, a tree on left and on right, two lines of fencing with shrubs; hills in background; three flights of birds.  Narrow diaper border inside rim.',4413,13076,'London (probably)',' 1795','',' 1775','G2914','Applied Art','',''),(122874,'tankard','Slightly-tapered cylindrical body moulded at top and bottom.  Thick loop handle scrolling out at base with shield-shaped lower terminal.  Flat cover, central portion raised, moulded rim at front, hinged to handle with cast scroll thumb-piece.\nEngraved on front: \' John Haythorn\'s gift for his // Admittence into the Company of // Glovers & Whitethawers.John Cross Master // in the year of our Lord 1686 \'',4391,13076,'\\London\\ (assayed in London)',' ','',' 1684-1685','G2196','Applied Art','',''),(127135,'cruet','Oval, boat-shaped stand on four curved strap feet; four faceted  bottles with silver mounts, faceted pointed stoppers. Stand - beaded rim, gadrooned scroll-over ends, beading on feet. Four circular galleries slot into stand, secured by rod beneath. Galleries have ring at base and top joined by three flat pillars on stepped base with fluted lower half and Ionic capitals; beaded rim, rouletting round top and bottom.  Bottles - 10-sided, alternate edges cut; silver mounts with everted rims and incised lines; stoppers faceted and cut as bottles. One stopper has a silver base with long spoon attached. Stoppers of different sizes.',4385,13076,'\\London\\ (assayed in London)',' ','',' 1786-1787','G794','Applied Art','',''),(122578,'scent bottle','Opaque-white glass withg gilded decoration; gold cap.\nFlattened elliptical shape with panel-cut side edges and narrow flat sides; short screw-threaded neck with stopper.\nGilded decoration: on side one, pagoda between trees, birds above, boulders below; on side two, an urn with husk swags within an elliptical husk surround. On sides, lozenge pattern and within each panel an oval dot within double oval lines; semi flower head on each shoulder; gilt detailing on stopper.\nDomed cylindrical cap; engraved flower head on top, band of stylised husks between two scalloped lines.',4493,13076,'London (probably)',' ','',' ','G561','Applied Art','',''),(126997,'cup, standing','Ovoid bowl on stem with beaded collar; rounded-stepped foot with beaded edge.\nEngraved on bowl: floral garland on rectangular ground, inscription within:\n\n\n\'Finis Coronat Opus.//BURKE & CRUGER,//Declared duly Elected for//the CITY of BRISTOL by//the Upright decision//of a Committee of the//House of Commons//February 20th 1775.\'\n\n\nOpposite, \'TW\' in elaborate script, below a crest: eagle with outspread wings, a garland in beak.',4391,13076,'',' ','',' 1774-1775','Na186','Applied Art','',''),(126033,'jug, milk','Depressed globular form on moulded circular foot.  Flat loop handle with acanthus thumb-rest; broad lip engaging with bulbous part of body. Plain circular rim moulding extends across lip.\nEmbossed decoration: roses, flowers, leaves, etc; handle cast with flowers & leaf. In centre of one side, a plain area engraved with a crest: lion holding an axe.',4270,13076,'',' ','',' 1826-1827','N7711','Applied Art','',''),(126028,'teething stick','Asymmetrical coral stick mounted in hexagonal silver shaft with scalloped lower edge; moulded knop links shaft to whistle of square section with concave-canted corners; crudely engraved decoration on back of whistle, also loop and ring for attachment to child\'s clothing. Three bells depend from knop, anothr three from scrolled loops at top of shaft.\nEngraved monogram below shaped hole in whistle: \' I M \'.',4393,13076,'',' ','',' 1775','N7793','Applied Art','',''),(126114,'sugar tongs','Spring tongs with round, concave ends, sprung end with shaped edges.\nBright-cut engraving: waved grooves on ends, thin zig-zag around edges, chevron along centre of each arm to oval at top outlined with zig-zag and chevron.\nEngraved in centre of sprung end: \' EL \'',4429,13076,'',' ','',' 1785','N7924','Applied Art','',''),(122770,'cup, 2-handled','Straight-sided with everted rim & rounded base on moulded foot; 2 cast scroll handles. Spiral alternate gadrooning/fluting on foot & lower part of body.\nBelow rim an embossed rope-twist band between two rows of stamped trefoils. In centre front embossed baroque cartouche extending over gadrooning & rope-twist: scrolls, leaves, fish-scales; in central oval a coat-of-arms with horse supporters, eagle crest & motto \' LOVE AS BRETHREN \' [later].\nEngraved on back: \' Presented as a Token of esteem by the aged & Orphan Society // of Coopers, to Mr Saml Stone for his attentive Services // to the Society. // Instituted in Bristol. Feby 4th 1806. \'',4426,13076,'\\London\\ (assayed in London)',' ','',' 1713-1714','G1863','Applied Art','',''),(2660,'Galapagos Giant Tortoise','',33,0,'',' ','',' ','A4047','Biology','Galapagos Giant Tortoise',''),(85670,'net sinker (?)','A piece of shaped stone, roughly cylindrical with a domed ends and a grooves around the cylinder at either end.',1835,0,'',' -715','Third Intermediate Period',' -818','H2189.1','Foreign Archaeology','net sinker (?)',''),(79479,'spindle whorl','A conical piece of stone with a flat top and bottom and a hole through it. There are five vertical grooves along the outside of the whorl.',1752,0,'',' -715','Third Intermediate Period',' -818','H3887','Foreign Archaeology','spindle whorl',''),(32360,'Corundum','',526,12039,'Arendal',' ','',' ','MT1119','Palaeontology','',''),(74831,'Fossil','',526,5432,'nr Whitby',' ','',' ','Cb5329','Palaeontology','',''),(74929,'Fossil','',526,0,'',' ','',' ','Cb5259','Palaeontology','',''),(74861,'Nilsonia compta (Phillips) Bronn and Elatides con','',526,5432,'[Prob. Cayton Bay, nr. Whitby]',' ','',' ','Cb5328','Palaeontology','',''),(74765,'Fossil','',526,5432,'Whitby',' ','',' ','Cb5345','Palaeontology','',''),(62133,'Fossil','',526,5432,'Scarborough',' ','',' ','Cb5412','Palaeontology','',''),(74743,'Fossil','',526,5432,'Runswick Bay nr Whitby',' ','',' ','Cb5250','Palaeontology','',''),(126690,'dish','Squared dish with rounded corners and shaped edge.\nGreen ground reserving central roundel painted with spray of pink roses within gilt circle, and border of pink roses and buds entwined around a 2 gilt lines enclosing line of gilt dots; wide gilt line surround to green ground, narrow gilt line below gilt dentil rim.',4240,12091,'',' ','',' 1795','N8982','Applied Art','',''),(124199,'jug','Inverted egg-shaped body tapering into pedestal foot, narrow neck with collar flaring into raised lip with wavy edge, high S-shaped handle rising up from rim and terminating in Egyptian mask head.\nHeavily gilt over dark green ground:  on body, tooled vertical stripes with running interlace enclosing white enamel \'jewels\' alternating with vertical floral meanders; stiff acanthus springing from line of white \'jewels\' above foot; on neck & foot crossing leaf branches tied with bows, flower heads between; band of running ovals outside gilt beading on foot rim; raised scale pattern on collar, gilt dots on lip merging into solid gilding; line of beading down handle, mask head detailed in red.',4240,12091,'',' ','',' 1890-1900','N3293','Applied Art','',''),(122937,'jug','Cylindrical neck with moulded rim and deep lip extending down to shoulder; body swells out and then down and in to everted foot.  Scroll handle with thumb rest.\nPainted in underglaze blue and overglaze red, green and gilding with all-over Imari-type design of flowers, leaves and scrolling branches tising from three \'hollow rocks\'.  Inside rim and on shoulder a band on gilt scrolls on blue between gilt lines; gilt line around foot; gilt detailing on handle.',4240,12091,'Derby (probably)',' ','',' 1820','G2936','Applied Art','',''),(125166,'mug','Straight-sided cylindrical mug with wishbone handle. Rectangular panel painted in brown monochrome with rural scene: tree on right from behind which a dog emerges stalking a pheasant in centre foreground. Gilt ivy festoons below rim with