emaic Period',' 332','H3481.2','Foreign Archaeology','plummet amulet',''),(80732,'amulet','A green and brown faience amulet in the shape of an isosceles triangle. The glaze has decayed and is now \'crinkled\' blue with brown accretions. The back is plain cream coloured.',1772,0,'',' -30','Ptolemaic Period',' 332','H3481.3','Foreign Archaeology','plummet amulet',''),(84223,'amulet','Green and brown faience amulet with a moulded front and flat back. It is the profile of a standing male with a baboon head, holding an object. The glaze has decayed and is now matt and pitted.',1772,0,'',' 2030','Ptolemaic Period',' -332','H3483','Foreign Archaeology','Hapy (son of Horus) amulet',''),(83678,'offering platter','Oval shaped pottery platter, with one end straight and the other end is broken. There is a ridge modelled near the flat end. The section at the broken end has three modelled pieces, food offerings: an ox head and some cakes or vegetables. The broken end would have contained a spout for libations. With the object there are three small bowls containing offerings of grain.',1752,0,'',' -1795','Middle Kingdom',' -2055','H473','Foreign Archaeology','offering platter',''),(84668,'wall relief','Bas relief of a man and woman facing to the right and a smaller person (or statue) facing to the left, on top of various object. In three pieces within its mount.\nTransliteration: \'smer uat shent (or shennet)\'. Translation: The sole companion Shenet (Dodson, Aidan).',2126,0,'',' -2055','First Intermediate Period',' -2181','H486','Foreign Archaeology','wall relief',''),(84662,'drum','Inscribed stone drum. A roughly cylindrical piece of pale-buff stone with slightly tapering edges and one end has been chipped. There is an insciption in a rectangle on one side \'Shenkhnema\'.\n\n\nTranslation: The protection for Khnemi\n(Dodson, Aidan)',1752,0,'',' -1985','First Intermediate Period - Middle Kingdom',' -2181','H492','Foreign Archaeology','inscribed drum',''),(82125,'bead network (?)','Green faience tube beads with brown accretions.',1752,0,'',' -30','Ptolemaic Period',' -332','H1941.2','Foreign Archaeology','bead network (?)',''),(80410,'tablet','Inscribed tablet to Adu/ Idu II. Irregular shape (roughly square). Five columns of incised hieroglyphs. These include a monkey, various birds, a snake, mounds, circles, a person, a foot and papyrus.',1891,7792,'doorway (?)',' -2181','Old Kingdom',' -2345','H516','Foreign Archaeology','inscribed tablet to Adu II',''),(79530,'wall relief','A piece of carved stone with a flat front. The decoration is four columns of sunk relief (incomplete).\nTranslation (with other pieces): \'[…] Sealer, governor of the estate, the sole companion […] whose good name is Idu [may he] be granted a good burial in the western necropolis […] in reverence before the great god, lord of the west, his follower [in his] pure places [..]\'',1835,7792,'tomb',' -2181','Old Kingdom',' -2345','H490','Foreign Archaeology','wall relief',''),(146133,'core','Obsidian core.',3475,1443,'Island, Lake of Magdalene',' ','',' ','E5021','Ethnography','',''),(154262,'figurine','Standing female figure holding a bowl in the left hand. Buff pottery, painted in brown with a decorative pattern round mouth, nose, eyes, breasts, and lower part of body from waist to tops of legs. There is a painted red band around the waist. Decoration imitates tattoos or painted decoration. Broken in several places and repaired.',7758,1443,'Mound of Guadalupe, Etzalan',' ','',' ','Ea8100','Ethnography','',''),(154252,'club','\'Pineapple head\' club, also known as a \"Totokia\" or battle hammer. Incised decoration. \nClubs of this type were used to drive a hole into an enemy\'s skull. Used by the warrior class set up to protect the chief and their lands from widespread warfare.',7758,0,'',' ','',' ','Ea8559','Ethnography','',''),(146447,'Drinking Vessel','Small four chambered jar with strap handle.',6228,0,'',' ','',' ','Ea7349','Ethnography','',''),(79837,'natron','Pale b