LA)suggests that this is a Ramesside coffin board, recycled in the Third Intermediate Period. It is full and arched, in keeping with a 20th Dynasty date. The iconography on the mummy board is much later than the style of construction.',1886,7742,'From an intrusive burial in tomb 7 in the temple of Nebhepetre Mentuhotep., Deir el Bahari',' 1050','Third Intermediate Period',' 1050','Ha7386.1039','Foreign Archaeology','mummy board',''),(116361,'painting','',3782,0,'',' ','',' 1878','K864','Fine Art','The Bride of Lammermoor',''),(79677,'coffin','An antropomorphic coffin base. It has a yellow background with columns of hieroglyphs and the profiles of figures on the sides. The inside has a red background with large figures including a scarab at the head.\nEvidence (provided by Kara Cooney, UCLA)suggests that this is a Ramesside coffin, recycled in the Third Intermediate Period. The decoration quality inside the case is much poorer than that of the lid and mummy board. No evidence of black pitch.',1886,7742,'From an intrusive burial in tomb 7 in the temple of Nebhepetre Mentuhotep., Deir el Bahari',' 1050','Third Intermediate Period',' 1050','Ha7386.1037','Foreign Archaeology','coffin base',''),(79579,'coffin','An antropomorphic coffin lid with raised, crossed arms and a modelled face with separate beard. It has a yellow background with a painted beaded collar around the chest and neck with a winged scarab in the centre. He has long, black hair and beard; the hair has painted decoration at the bottom of the hair and on top of the head. Feet are missing. \n\nEvidence (provided by Kara Cooney, UCLA)suggests that this is a Ramesside coffin, recycled in the Third Intermediate Period. There are high forearms on the lid, a high belly and a depression between the legs. The holes for amulets were filled in on the hands (although this has fallen out of the right hand). The arms are highly modelled and reminiscent of Ramesside period arms. The underside of the lid shows sizable pieces of native wood and no traces of black pitch. The right lappet (bottom of wig) has a divot on the far right corner, but it has been decorated into the divot, as if chiseled down, damaged, changed then redecorated. These lappets are very narrow and may have been modified from a black wig. The ears are very poorly carved, as if added or fixed. They changed the headdress and added the ears in plaster or wood, perhaps when they changed a headdress from a wig.',1886,7742,'From an intrusive burial in tomb 7 in the temple of Nebhepetre Mentuhotep., Deir el Bahari',' 1050','Third Intermediate Period',' 1050','Ha7386.1038','Foreign Archaeology','coffin lid',''),(83532,'coffin','The anthropomorphic lid of the coffin, in the shape of a mummified female. The background is painted yellow. Highly decorated, mainly green, red and yellow. Her long hair is blue-green with bands and wings at the top. There are applied three-dimensional hands. There are large semi-circles around her chest, representing beaded collars. The lower torso and legs are covered with scenes and hieroglyphs. \nThe coffin is dedicated to Lady A-tiu-Mut (Amut).',1752,0,'',' -910','Third Intermediate Period',' -950','H4633.1','Foreign Archaeology','coffin lid of the Lady Amut',''),(116666,'painting','',3782,0,'',' 1876','',' 1854','K1493','Fine Art','The Guarded Bower',''),(116281,'drawing/watercolour','',3782,0,'',' 1866','',' 1866','K719','Fine Art','Titania - \'A Midsummer Night\'s Dream\'',''),(102913,'robe','Ct-vest, lady\'s: chaogua.  Silk, kesi etc. on satin ground.  Main panels: white ground decd. in poly. silk & Au., front with 2 dragons rampant on each side, back with 2 confronted and 1 full frontal, above mtn. & waves; edged with black silk, gilt studs. Red silk lining & borders.',3028,0,'',' 1725','Qing dynasty, Yongzheng reign (1723-35)',' 1725','N7102','Eastern Art','',''),(104426,'box','Box, oblong. Lacquer, on wood. Exterior black, with mother-of-pearl inlay: ground of 6-pointed stars, ogival p