d turquoise blossoms, yellow and green fruit and a yellow bird, on the other side green and brown prunus branch with red blossoms with yellow fruit, and a white and turquoise bird. The two branches are separated by a blue crescent moon on each side. The base bears and underglaze six-character reign mark of the Xuande emperor with the cyclical date for 1433 AD (Xuande kui chou nian zao) but is probably not of the period.',3264,0,'',' 1644','Ming dynasty (1368-1644)',' 1620','N5368','Eastern Art','',''),(102882,'candlestick','Vase or candle holder with inverted lip bows for mouth, cylindrical neck, domed body, and three scalloped feet on a convex base. Made of porcelain with underglaze blue decorations. On the lip there are three foils and petals, on the body there are four roundels of Arabic script separated by four foliate scrolls above leaves. The inscription reads \"preserve our faith from danger\" in the Persian language. On the base there is a genuine six-character reign mark of the Zhengde emperor in a double circle in underglaze blue.',3362,0,'',' 1521','Ming dynasty, Zhengde reign (1506-21)',' 1506','Or1983.10.01','Eastern Art','',''),(125129,'teapot & cover','moulded leaf design; green and yellow glaze',4270,11948,'',' ','',' ','N5302','Applied Art','',''),(121824,'bottle, water','Globular body curving into narrow neck with pan top below an everted rim; short foot rim. Painted in Fazackerley colours: yellow, brown, green, purple on a pale blue glaze: two crane-type birds facing each other over a chick between oak-leaved trees; a butterfly at base of neck; on opposite side, a single bird with open beak.',4411,12166,'Liverpool (probably)',' ','',' 1750-1760','N4884','Applied Art','',''),(121677,'table, side','Carved and gilded pinewood. Four legs in the form of winged Herms terminating in scrolls, the front two set at an angle and sloping in towards base; X-form stretchers of foliate scrolls, the central join surmounted by a female head wreathed with flowers.\nPlain concave frieze from which depend carved scrolls, shell motif in centre of front, leaf in centre of sides. Strings of leaves and grapes along the frieze with stems of gilded wire.  Egg-and-dart moulding around front and sides of top; rabet contains slab of green and black marble (Verde Antico).\nUnderside of frame painted yellow.',4392,7421,'Italy (probably)',' ','',' 1800-1899','N5982','Applied Art','',''),(122363,'table, side','Carved and gilded pinewood. Four scrolled legs set at an angle, carved leaf on knees and feet; scroll-under feet on quatrefoil base; X-form stretchers entwined with carved foliage; centre join forms a fifth foot surmounted by scrolled-over leaf.\nFrieze between egg-&-dart moulding above and oval-motif moulding below, with applied string of leaves.  At centre-front a lion\'s head mask with curly mane; leafy branches depend from frieze, floral festoons draped around front legs and across front.\nSlab of purple-and-white marble with moulded front and sides.\nUnderside of frame painted yellow.',4392,7421,'Italy (probably)',' ','',' 1800-1899','N5983','Applied Art','',''),(121842,'coffee pot (no cover)','urn-shaped on pedestal foot',4330,0,'',' ','',' 1788-1798','N5322','Applied Art','',''),(121883,'jar & cover','',4330,12496,'',' ','',' 1802','N8274','Applied Art','',''),(127169,'jug','upper third dark-blue-glazed',4258,12496,'',' ','',' 1900','Na535','Applied Art','',''),(126389,'cup, 2-handled, & cover','Campana-shaped body on circular pedestal foot; thick reeded 3-sided horizontal handle on lower part of body rising from satyr masks and with acanthus centres; everted ovolo rim. Ogee-domed cover.\nLower part of body decorated with acanthus leaves and cup-like flowers; on main area, applied classical figures in Bacchic scene: with lyre, tambourine, ?harp, pipes; the men in tiger skins, one drunken & has dropped his cup.  Vine/grape meander frieze, beaded rim; fluted foot, gadrooned collar below body.  Band of stylised leaves & flowers on