ing','',3462,0,'',' ','',' 1822','K2654','Fine Art','A Scene in Leigh Woods',''),(117046,'painting','',3462,0,'',' ','',' 1822','K2655','Fine Art','View of the Avon Gorge',''),(125297,'sauceboat','blue-painted decoration',4396,12082,'',' ','',' 1755-1760','N3787','Applied Art','',''),(122979,'pipe','red glass pipe',4484,0,'',' ','',' 1830-1900','G3417','Applied Art','',''),(104414,'bowl','Shallow bowl on circular footring, made of porcelain with underglaze blue decorations of two five-clawed dragons amongst clouds. Just below the rim there is a genuine six-character reign mark of the Xuande emperor.',8855,0,'',' 1435','Ming dynasty, Xuande reign (1426-35)',' 1426','N5373','Eastern Art','dice bowl',''),(9313,'Animal','Rhino mount',343,0,'',' ','',' ','Aa3287','Biology','Sumatran rhinoceros',''),(125146,'mug','Cylindrical, tapering upwards to rim; moulded handle in form of animal head grasping lower part in its mouth.\nOverglaze rransfer-printed: to left of handle, heads of George VI and Elizabeth facing their right, crown above, GVIR below, St George on horseback slaying dragon and elephant supporters, rose, shamrock, thistle all above inscription: \'CORONATION KING GEORGE & QUEEN ELIZABETH\'.  Opposite, the Royal arms.  \'MAY 1937\' in red below rim.  Blue line inside rim, black and red detailing on handle.',4240,11948,'',' ','',' 1937','N5351','Applied Art','',''),(125422,'bottle','Blue glass, gilt decoration in style of James Giles',4302,13076,'London (probably)',' ','',' 1770','N5972','Applied Art','',''),(117014,'painting','',3494,0,'',' 1695','',' 1655','K2419','Fine Art','A Music Party',''),(147131,'Painting','Man in purple with drum and lion dancers, blue braid surround.',7557,9869,'',' ','',' 1820-1900','Or2004.189','Eastern Art','',''),(117011,'painting','',3494,0,'',' 1690','',' 1630','K2420','Fine Art','Cattle and Herdsmen in a Hilly Landscape',''),(117016,'painting','',3494,0,'',' 1680','',' 1640','K2421','Fine Art','River in Spate',''),(104512,'dish','Porcelain dish with yellow and green overglaze enamels (seperated by incised lines) depicting a crane and a phoenix amongst clouds on the inside of the dish and the outside of the rim. The base bears the authentic six-character reign mark of the Jiajing emperor in underglaze blue.',3264,0,'',' 1566','Ming dynasty, Jiajing reign (1522-66)',' 1522','N5800','Eastern Art','',''),(125788,'cup, standing','Ovoid bowl tapering up from stem, on circular slightly domed foot.  Serpent wound around stem, a butterfly perched on foot.\nEngraved decoration: geometric border, hatched scroll and anthemion design on bowl with plain oval cartouche edged with Vitruvian scroll. Vitruvian scroll around base of stem, alternate trefoils and triangles on interlaced scallops around edge of foot.',4656,13076,'',' ','',' 1866-1867','N7053','Applied Art','',''),(225519,'time-based media','Video installation with urethane and epoxy resin model',11210,0,'',' 2009','',' 2009','K6468','Fine Art','Lydda Airport',''),(10375,'Gannet','',358,676,'Crantock Beach, Newquay, Cornwall',' ','',' 1968-1976','Ab4225','Biology','Northern Gannet','[SW 7960] [Crantock]'),(77883,'map','1581 map of Bristol (\'Brightstowe\') by Joris Hoefnagle.',1689,0,'',' ','',' ','M5277','Historic Maps','',''),(83841,'stele','Creamy-white rectangular stele with carved decoration on one side. It shows a man facing right on a papyrus boat with animal bow and stern. The man is smelling a lotus flower and is standing before some flora and animal heads. There is a row of hieroglyphs above his head. His skin is painted red-brown.\n\n\nTranslation:\nA royal offering to Osiris Lord of Busiris, Khentyamentiu, Lord of Abydos; invocation - offerings of bread and beer for the revered one, Nekhtiqer, justified.\n(Dodson, Aidan)',1742,7779,'grave W47',' -1985','Middle Kingdom',' -2055','H3126','Foreign Archaeology','stele of Nekhti-qer',''),(187256,'painting','Large painting of the Delhi Durbar of 1903, a state occasion which marked the declaration of King Edward VII and Queen Alexandra as Emperor and Empress of India. Procession of British officials and Indian Maharajas on elephants passing the Jami Masjid or Friday Mosque. Huge crowds of Indian and British people attending the event are depicted. Oil on canvas.',3794,0,'',' 1907','',' 1907','2002/156/001','British Empire & Commonwealth Museum','The State Entry into Delhi',''),(10266,'Orang-utan','',379,0,'',' ','',' 1867-1924 (circa)','Ab3790','Biology','Orang-utan',''),(146117,'relief','Large relief showing a king and his attendant. \nOriginally the relief would have been brightly painted and displayed in the King\'s palace to reinforce his legitimacy as ruler.\nThere is a band of writing running across the relief. This text was the same or very similar on each relief and is therefore called the Standard Inscription. The Standard Inscription begins by tracing Ashur-nasir-pal II\'s lineage back three generations and recounts his military victories, defines the boundaries of his empire, tells how he founded Kalhu, and built the palace.',3823,2,'Palace of Ashurnasirpal II',' -878','',' -880','H795','Foreign Archaeology','Assyrian reliefs',''),(85428,'bird remains','A mummified hawk. Wrapped in dark brown linen. The bandages are missing from the front part of the head, some feathers and a broken beak are visible as well as the head. The tail and feet protrude from the end, including feathers.',1770,0,'',' ','',' ','Ha6360','Foreign Archaeology','hawk mummy',''),(126122,'inkstand','Rectangular platformon flat bearers running diagonally from front corners to meet centre back; a candlesocket at each corner linked by twisted \'rope\' balustrade. Attached to the stand are an inkwell and a shallow bowl in which sits a loose flattened ball-shape pounce pot, the top perforated.\nPainted in blue, manganese-purple and a green wash on a pale bluish glaze: blue and manganese detailing on balustrade, swagged border with pendants around neck of pot; inside bowl, a bird above \'RC // 1685 // desem ye 3\'; on pounce pot, green-wash bands and lines and \'1685 // R C\'.',4528,12496,'Brislington',' ','',' 1685','N7956','Applied Art','',''),(197064,'Animal','Lynx skull from Ab4458.2. Canine teeth with the specimen but unattached, and plaque on carnassials. Whole skeleton, unarticulated remains in storage. Canine teeth are present in box with the rest of the skeleton.',101,0,'',' ','',' 2014-11-04','Ab4458.2','Biology','Canadian lynx',''),(11318,'Pochard','',113,676,'Whiteladies Road, Bristol (opposite BBC)',' ','',' 1976','Ad3747','Biology','Pochard','ST 578 736'),(10385,'American mink','',386,676,'River Avill, Dunster, Somerset',' ','',' 1969','Ab4237','Biology','American mink','[SS 99 43] (Dunster)'),(80025,'figurine','Head and neck of a female terracotta figurine. She is finely moulded with \"melon\" style hair: hair parted vertically with plaits and worn in a looped top-knot. She wears circular earings.',0,9830,'',' -200','',' -300','H2784','Foreign Archaeology','figurine head',''),(81769,'shabti','A mummified figure of a man with crossed arms and long hair. It is blue-green and has dark blue painted decoration including a column of hieroglyphs down its front. Inscribed \'Sehedj, the Osiris, Pentaweret.\' (He of the great Lady) (Dodson 2006)',1741,0,'',' ','New Kingdom',' 1186-1069 BC - 20th Dynasty','Ha7692','Foreign Archaeology','shabti',''),(81663,'shabti','A figure of a mummified man with crossed arms holding  2 hoes, false beard and long hair. Where the glaze remains it is green and is otherwise cream coloured. It has a plain back pilaster. No inscription (Dodson 2006)',1741,0,'',' ','Late Period',' ','Ha7695','Foreign Archaeology','shabti',''),(84024,'scarab','Bright blue green scarab with two separate wings, all with incised decoration. The scarab has five holes, four for connecting the wings and the wings have three holes.',1772,0,'',' -30','Ptolemaic Period',' -332','Ha7708','Foreign Archaeology','winged scarab',''),(82087,'scarab (heart)','A dark green oval bead, carved top and sides as a scarab beetle. The base has rows of incised hieroglyphs. It is broken at the front.\n\n\nTranslation:',1772,0,'',' -1186','New Kingdom (?)',' -1295','Ha7707','Foreign Archaeology','scarab (heart)',''),(84023,'amulet','Ka and ba bird amulet. Two birds side by side on the same base. Made from dark green faience. The birds have incised feathers and modelled features, although the head of the left one is missing. Their long incised wigs and claws can be seen.',1889,0,'',' -30','Late Period - Ptolemaic Period (?)',' -747','Ha7711','Foreign Archaeology','ka and ba bird amulet',''),(81661,'amulet','A standing figure of a woman in a long dress with a cat\'s head. One arm is across her waist (with a basket on the arm and aegis in her hand), the other is up (holding a sistrum). She stands on a base with a tang at the bottom. It has corrosion.',1859,0,'',' -525','Late Period',' -664','Ha7699','Foreign Archaeology','Bast amulet',''),(10396,'Barn Owl','',388,676,'Ashford, near Barnstaple, North Devon',' ','',' 1976','Ab4250','Biology','Barn-Owl','SS 535 345'),(126638,'biscuit group','rectangular plaque with rose, dahlia etc; in ornate gilt frame',4239,0,'',' ','',' 1840','N8761','Applied Art','',''),(86601,'vessel','Buff coloured clay aryballos with no base, a globular body leading into a short neck and a circular opening with a wide rimmed opening. It has a short straight upright handle covering the length of the neck. The bottom is decorated with concentric circular bands of black and red and one side of the body depicts four warriors holding circular shields and spears. Some details are incised on. There is black fluting leading up to the neck and concentric bands on the top of the rim. Around the edge of the rim there is a black dotted motif repeated. the handle has some thick black horizontal bands.',6228,7905,'Corinth (?)',' -549','',' -576','R444/1936','Foreign Archaeology','Corinthian \'warrior\' aryballos',''),(85865,'vessel','Athenian  black gloss plemochoe. It has a circular base, a pedestal like stem, leading into an lentoid body on top with a lid. The stem and most of the body is black apart from the base which is left the red colour of the clay. The edge of the opening and the lid is decorated with intricate bands of geometric patterns of lines dots, thin and thick concentric circular black bands. The lid has a raised dome shaped knob, painted mostly black on the top.',6228,7842,'',' -500','',' -510','Fa559','Foreign Archaeology','Black gloss plemochoe',''),(120542,'figure group: beehive and birds','hawthorn tree with bird leaning towards nest with fledglings; bee hive with bees',4239,12496,'Temple Back',' ','',' 1849','G247','Applied Art','',''),(80391,'amphora','Athenian black figure panathenaic, non prize amphora. It has a circular base leading into a regular body with a wide neck and the remains of a black painted rim. It has two black painted looped handles attached from the top to the body on opposite sides. The bottom third is painted black. Black-figure panel decoration on the body: on one side there is the goddess Athena with aegis (cuirass), helmet, shield, represented striding forward aggressively, brandishing her spear, flanked on either side by a Little Owl perched on a tall column. On the other side there are two boxers fighting, flanked by their \'trainers\' with a thong or a taenia in their hands. On each side of the neck of the amphora there is a palmette chain in plain black gloss with red on the cordon below.',6228,7905,'Athens (?)',' -499','',' -511','Fa560','Foreign Archaeology','Attic black figure Panathenaic, non-prize amphora',''),(126320,'vase: the \\\'Raby\\\' vase','Tall 2-handled lidded vase with applied highly modelled flowers all over; painted',4239,12496,'',' 1850','',' 1840','N8278','Applied Art','',''),(85872,'water jar','Attic black-figure hydria (water jar) with a thick circular base, the body leading out into a wide rimmed quite tall neck with a rimmed opening. It has two small looped handles on opposite sides of the body, and a raised looped handle with two pointed projections on either side. It is moulded with a line in the centre. The outside is black apart from a scene covering a panel on the body on one side. \nThe scene depicts two black archers framing and facing a central figure of a hoplite (warrior). A fourth figure, black as well, is on the background, behind the hoplite and turns to the right. The archer on the left holds a bow in his left hand and a club in the right, a sword and a quiver on his shoulder. The archer on the right carries a club, a sword at the hip and the quiver on his back. The hoplite wears a helmet and a shield with snake device. The inscriptions next to the archers are just graphic signs, without any linguistic meaning.\nIn the Greek mythical world the image of the black archers is associated with the epical figure of Memnon, the hoplite at the centre of the scene. He is the Ethiopian king, son of Eos, the goddess of the dawn, and Tithonos, a Trojan prince. The myths tells that Memnon brought an army of 20,000 Ethiopian to Troy\'s defence against the Greeks. \nThe shoulder of the vase is decorated with a scene that shows the judgment of Paris, one of the events that led up to the Trojan War. Hermes leads the three goddesses Aphrodite, Athena and Hera to Paris seated on a stool for his judgment in the contest for the golden apple.',6228,7905,'Athens',' -499','',' -551','H801','Foreign Archaeology','Attic black figure hydria',''),(116557,'painting','',3782,0,'',' ','',' 1893','K1248','Fine Art','Unconscious Rivals',''),(8939,'Common brushtail possum','',290,0,'',' ','',' 1839-1963','Aa777','Biology','Common brushtail possum',''),(116752,'painting','',3494,0,'',' ','',' circa 1515','K1647','Fine Art','Portrait of Margaret of Austria',''),(123880,'table','baluster supports, inlaid frieze',3494,0,'',' ','',' 1630-1680','N2300','Applied Art','',''),(116748,'