of a female terracotta clay figurine. She is finely moulded with her hair parted in lobes and worn in bun at the nape of the neck. She wears circular earings. Traces of white slip',0,0,'',' -200','',' -300','H4003','Foreign Archaeology','figurine head',''),(116275,'painting','',3462,0,'',' ','',' 1803','K593','Fine Art','View of the Avon and Hotwells showing the foundations for Windsor Terrace',''),(85862,'wine jar','Attic black figure clay oinochoe with a trefoil mouth, a globular body with short and wide neck, and a ring foot. It has a vertical band handle attached from the rim to the middle of the body. It has a black glazed surface apart from a scene painted on black figure style one side. This depicts the hunters’ return with dogs, lagobolon (the throwing stick for hunting) and their killed hare, greeted by a bearded older man. Details are incised and overpainted in purple. One of the dog is in white overpainted.The top of the scene has a repeated lotus buds decoration around the top. \nThis wine jug has been attributed to Amasis, famous Greek vase painter of the second half of the 6th century BC.',6228,0,'',' -539','',' -541','H803','Foreign Archaeology','oinochoe',''),(103808,'vase','vase,yu hu chun ping,ovoid body,conical mouth,porc,incised floral decn,ying qing glaze.',3165,0,'',' 1368','Southern Song (1127-1279) - Yuan dynasty (1279-1368)',' 1127','N2576','Eastern Art','',''),(122796,'tea jar','Upright rectangular shape with canted corners and short cylindrical neck.  Painted in blue on a pale bluish glaze with bsb.  On front and back: Chinaman with stick under willow tree in fenced garden; Chinaman with parasol in garden;  on ends: floral sprays; on canted corners: BSB with central pinecone between 5-trefoil-petalled flower and many-petalled daisy.  Inscribed around neck:  \' ANN SCOTT 1763 \'.',4522,0,'',' ','',' 1763, dated','G1976','Applied Art','',''),(79908,'bowl (miniature)','Pale orange, undecorated, clay bowl with two folded handles on either side.  It has a deep hole in the centre and a rim around the outside. It is mounted on a pedestal base.',0,0,'',' ','',' ','Fa8','Foreign Archaeology','pedestal bowl (miniature)',''),(125812,'plate','Octagonal plate, Britton shape \'G\'.\nPainted in blue on a pale blue glaze: in centre, a seated Chinese lady fishing watched by another from an arbour; narrow rim border of shaped lozenges alternating with petals; second narrow border on sides of well of diaper alternating with flower-heads.\n\nHerbal-sprig underrim markings.',4406,12166,'Liverpool (probably)',' 1770','',' 1750','N7108','Applied Art','',''),(121786,'dish','Buff body.\nBritton shape F.  \nPainted in blue on a pale bluish glaze with an edge-to-edge view of Vauxhall Gardens: tree-lined avenue ending in temple, domed rotunda on right, four fashionably-dressed figures in foreground.',4406,13076,'London (probably)',' ','',' 1755-1775','N3781','Applied Art','',''),(127190,'punch bowl','Buff body.\nPainted in blue on a white glaze.  Exterior: landscape with standing man pointing at man on horseback, a walled settlement with tower, a country villa, two men walking together, one carrying a jar on his head.  Interior: \'A MIDNIGHT MODERN CONVERSATION\' after William Hogarth; grapevine border; Brown rim edge.',4406,12166,'Liverpool (probably)',' ','',' ','Na616','Applied Art','',''),(121787,'punch bowl','Buff body.\nDeep bowl with tapered sides on short pedestal foot, the foot with convex sides. Painted in blue on a pale bluish glaze.\nExterior has four scenes separated by garlanded columns: five men around a table with punchbowl, glasses and pipes; lady and gentlemen toasting each other in a country setting with church; a swordsman attacking a defender, sailing ship on left, fort on right; lady seated on hillock beneath a bower. Interior painted with two empty chairs and a table set with a punchbowl similar to G1690, glasses, candlestick; five flower sprays below rim.',4406,12496,'Bristol, Redcliffe Back',' ','',' 1743','G1690','Applied Art','',''),(122867,'bowl','Buff body.\nPainted in blue on a pale blue glaze.  Exterior: procession of parents and 12 children walking towards a church in a landscape. Interior: a seated hen with chick on her back, eleven other chicks some drinking from a dish; acanthus leaf scroll border with shell cartouche at 12 o\'clock and initials \'B // W M // 1759\'.',4406,12496,'Bristol (probably)',' ','',' 1759, dated','G2155','Applied Art','',''),(85871,'water jar','Attic Red figure hydria with rolled lip, globular body that passes into the shoulder, and the shoulder into the neck, in a continuous curve. Two horizontal handles attached on the body and a vertical handle from the base of the neck to the shoulder. Black glazed, with reserved rim and rim vertical edge decorated with ovules, band of palmette at the base of the neck. One one side of the body  there is a scene depicting three female figures. One stands in the centre clad in a robe. The other two are seated on opposite sides facing her, each holding one hand out. One woman holds a cup. There is a robe (taenia) suspended above one of the woman\'s head and a mirror behind the other woman\'s head. There is a band of meander pattern underneath their feet.',0,7842,'',' -429','',' -441','H4631','Foreign Archaeology','Red figure hydria or kalpis',''),(85869,'bottle','Black figure shoulder-lekythos  with disc foot,  broad body leading into a narrow neck with a wide rim around the small circular opening at the top.It has a small looped handle  on one side of the neck. Rim, handle and the bottom two thirds of the body are  black glazed.  Decoration of palmettes and circles on shoulder. Main scene on the body depicts three male and two female figures as well as the mytical figure of the Minotaur (half man and half bull monster) In the centre of the scene is  rapresented the myth of Theseus killing the Minotaur with a sword. On either side there are female figures stood clad in robes, behind them male figures, one holding a staff.. The first figure on the right  is Ariadne holding a ball of string.',0,7842,'',' -500','',' -525','H804','Foreign Archaeology','Attic black figure lekythos',''),(80388,'wine jug','Attic black figure oinochoe (shape I) with globular squat body with flattened shoulder, concave offset neck,  trefoil mouth, raised ribbon handle attached from  rim to shoulder and a flaring ring foot. Lip, handle, neck and back of body are all black, ivy leaves decoration on neck. Reserved panel in front with main design, horizontal row of tongues at top. The figured scene depicts a kneeling hoplite (warrior) in the centre with shield and helmet, flanked on either side by two horsemen holding spears. On one edge there is a robed figure stood holding a spear. Accessories are in white and purple overpainted. The inscriptions next to the hoplite and the horsemen are just graphic signs, without any linguistic meaning.',0,7842,'',' -499','',' -526','H806','Foreign Archaeology','Attic black figure oinochoe',''),(86596,'wine jug','Attic black figure oinochoe (shape II) with globular body with flattened shoulder, offset neck,  trefoil mouth, high ribbon handle attached from rim to shoulder and an echinus foot. Lip, handle, neck and back of body all black. The figured scene is black on a red panel, with border of ivy leaves on sides, above vertical lines, meander on the neck. The scene is concentrated on the front of the vase and depicts the contest of Heracles with Amazons: Heracles to right, with lion\'s skin over a short chiton, and quiver at side, brandishing club in right hand, seizes an Amazon, who falls back on one knee to left; she wears high-crested helmet with cheek-pieces, cuirass, short chiton, spear, and shield with device of two eagles. Behind her is a Greek fully armed (Telamon?), attacking her with spear, on his shield the device of a lion. Behind Heracles is another Amazon running away to left, looking back; she wears a Phrygian helmet with high peak, short chiton and quiver. Accessories are in white and purple overpainted, Amazons\' flesh is white overpainted.',0,7842,'',' -499','',' -526','H805','Foreign Archaeology','Attic black figure oinochoe',''),(85870,'amphora','Attic black figure neck-amphora, with ovoid body tapering to the disc foot. Raised fillet at the junction of body and the cylindrical neck. Echinus profile to exterior of rim, interior with concave groove, top flat. Two black glazed vertical handles on opposite sides attached from the body to the neck. The neck is decorated with reflected palmette chain, alternating red and black tongues on top of shoulder. Broad black band on lower body and rays ascending from base. Beneath handles pattern of curves and spirals ending in lotus bud and palmette.Design of main scenes is black with white and red paint for accessories. The figured scene on one side of the amphora depicts the departure of the warriors, showing 2 warriors in chariot with two horses seen from the front. The two horses turn their heads inwards. One of the men is bearded and bareheaded (the charioteer), the other wears a corinthian helmet (the warrior). The chariot is flanked  by two attendants: a nude male figure holding a spear on one side and a female figure  holding a spear on the other side.\nThe other side of the vase shows three bearded men, one standing in the middle  clad in a robe playing a kithara  flanked by two seated figures on folding stools clad in robes holding sticks.',0,7842,'',' -499','',' -526','H802','Foreign Archaeology','Attic black figure amphora',''),(80385,'plate','Red figure terracotta clay fish plate  with a raised pedestal base and a plate with a thick rimmed overlapping edge. There is  a central concave depression which has a waved motif decoration around the central hole. The red figure decotation of the plate depicts  three large fishes. Two are the same, with a complete fin along their backs and one underneath. The other fish has one fin on the back and one near its tail and underneath it. The details are painted in black and white paint. The eyes are painted with a black circle surrounded by a white circle. The bodies are decorated with lines, semi circles and dots. The design is surrounded by a repeated dotted motif around the edge of the plate. The overlapping edge has a repeated leaf design around the edge. The underside has several concentric circles and bands.',0,7916,'',' -320','Hellenistic Period',' -360','Fa558','Foreign Archaeology','fish plate',''),(84759,'figurine','Female terracotta figure, \"second attic style\", hollow-moulded with a hand-made back. The figure is standing on a square open base wearing a peplos (garment pinned on both shoulder) with long overfall and  both arms by her sides and visible feet. She has a headband and centrally parted hair waving round forhead. White slip decoration and traces of red paint on peplos, mouth, headband and on the base.',0,7905,'Athens (?)',' -440','',' -450','Fa56','Foreign Archaeology','figurine',''),(84848,'drinking vessel','Attic stemmed cup (type C) with concave lip, shallow bowl, two horizontal handles rising to the level of rim, short stout stem and torus foot. Black glazed with handle panel, exterior edge of foot and resting surface reserved. On the floor of the bowl reserved circle enclosing red figure of of nude athlete with strigil/ binding his hands for boxing?',0,0,'',' -474','',' -526','Fa557','Foreign Archaeology','kylix',''),(80393,'drinking vessel','Attic stemmed cup with plain rim, shallow bowl, two horizontal handles rising to the level of rim, short stem concave in profile and foot-plate with wide stand-ring. Fillet at the junction of the bowl and stem. Black glazed with exterior edge of foot and resting surface reserved. On the floor of the bowl tondo reserved with Gorgoneion (Gorgon\'s head).',0,7905,'Athens (?)',' -500','',' -520','H814','Foreign Archaeology','kylix (cup)',''),(80387,'cup','Attic broad drinking cup-skyphos (also called \'pinchbase\' cup) with concave lip set off sharply from the body, two horizontal handles set on the wall and rise up just above the rim. Short stem and heavy foot. On inside and outside lip, handle and foot black glazed. Narrow band below the rim inside, handle panel, edge of foot and resting surface reserved. On each side of the body black figure decoration depicting a quadriga driven by a full-draped figure and attended by two other figures flanked by palmette motif.',0,7842,'',' -470','',' -500','R302/1938','Foreign Archaeology','cup-skyphos',''),(86595,'bottle','Attic black figure shoulder-lekythos (oil bottle) with disc foot, broad body leading into a narrow neck with a wide rim around the small circular opening at the top. It has a small looped handle  on one side of the neck. Rim, handle and tlower part of the body are  black glazed. On shoulder decoration of vertical strokes and chain of lotus. On one side of the body there is the main scene above a repeated lotus frieze, depicting Theseus killing the minotaur, flanked on either side by two female figures facing the centre scene, dressed in robes and holding vine. At their backs there are Doric columns. Details are in red overpainted',0,7842,'',' -449','',' -501','H807','Foreign Archaeology','Attic black figure lekythos',''),(85864,'bottle','White ground lekythos with cylindrical body and disc foot, narrow neck,  deep mouth and broad lip. One looped handle is attached on one side of the neck. Mouth, handle, bottom quarter of the body and foot are black glazed. Decoration on surface very worn. Neck and shoulder have orange slip and black palmette decoration on shoulder. On body traces of a standing female figure applied against a background of white slip. There are traces of a meander pattern above the figure.',0,0,'',' ','',' ','H4936','Foreign Archaeology','White ground lekythos',''),(86597,'vessel','Apulian red-figure column krater decorated with double row of dots framing each panel, band of tongues above and weavy pattern below, the neck with a garland of ivy with berries and floral motifs, rays around the rim with double row of dots on the overhang, the handle-plates with palmettes. Panel on the belly depicts a profile female head decorated with added white paint on both sides.  Each head has hair dressed in a beribboned kekryphalos (hair net) with a radiate stephane (headband or diadem), curls falling at the ear, wearing a pendant earring and beaded necklace.',0,7935,'',' -299','',' -326','H4653','Foreign Archaeology','Apulian, red-figure ,column krater',''),(86602,'oil-unguent pot','Shallow black-glazed askos with disc foot, thin body with dome-shaped top, spout with widely flaring mouth and averarching handle from mouth to other side of wall. The top of the body is ribbed with a small raised dot at the centre top..',0,0,'',' -301','',' -400','H1253','Foreign Archaeology','Black gloss askos',''),(79845,'jug','Geometric mug with circular mouth, cylindrocal neck, squat lentoid body and flat base. Strap vertical handle attached on the rim and shoulder. Dull black-brownish gloss on the body, neck reserved with decoration of horizontal lines and rows of dots.',0,0,'',' -699','',' -701','H4287','Foreign Archaeology','jug',''),(86598,'vessel','Corinthian round aryballos, type C flat-bottomed, with globular body, short neck, disc mouth, vertical ribbon handle and  ring foot. Decoration of black tongues on rim and shoulder. The handle is decorated with a thick zigzag black lined design. The body is decorated with a large griffin and a panther covering most of the body.  Details are incised on and overpainted in red, and there are rosettes motifs in field, interspersed between the creatures.',0,0,'',' -570','',' -590','R1308/1936','Foreign Archaeology','Corinthian round, flat-bottomed, aryballos',''),(85868,'vessel','Corinthian kothon or exaleiptron: bowl with vertically in-turned rim, tubular body tapering slightly to a low foot-ring, Flat horizontal reflex handle attached to the body. Linear white style decoration: black, purple and white tongues on shoulder, below horizontal brown lines and double dot band, horizontal brown line lower body and concentric circles underside foot. Hanging rim and inside black glazed.',0,8675,'',' -500','',' -550','R305/1938','Foreign Archaeology','kothon',''),(79948,'vessel, vessel lid','Tripod pyxis with projecting rim and concave sides on three  support.Decoration of bands of varying width in red and brown glaze, most of each support reserved. Inside concentric red circles on the floor. \nGently sloping lid with flange underneath and moulded knob in shape of a truncated cone, flat-topped. Lid is decorated with concentric red bands.',0,8675,'',' 550','',' 590','H1203','Foreign Archaeology','Corinthian tripod pyxis with lid',''),(80065,'vessel, vessel lid','Pyxis with concave sides, flat base and two small horizontal handles attached to the rim. Linear decoration of band-and-dot style in brown and red glaze, mostly worn: at rim horizontal continuous zigzag, below double dotted band between wide red band and brown lines, small triangles round base. Interior decorated with concentric bands on the wall and floor, glaze mostly worn. Underside base reserved. Flat lid with short flange underneath decorated with concentric brown and red bands.',0,8675,'',' -570','',' -600','H1209.A&B','Foreign Archaeology','pyxis',''),(79992,'vessel','Round aryballos with flat disk mouth, short neck, vertical band handles and round base. Decoration with brown and purple paint: concentric circles on mouth, irregular band on edge, tongues on shoulder and and circles on bottom. Horizontal lines above and below the main frieze. Siren with head turned to left and extended wings. Face, breast  and middle part of the wings  are decorated in red, details incised.',0,8675,'',' -549','',' -576','H4010','Foreign Archaeology','Corinthian round aryballos',''),(80262,'vessel','Round aryballos with flat disk mouth, short neck and round base. Decoration with black and red paint: tongues alternately balck and red on mouth and shoulder, zigzag pattern on edge, horizontal lines above and below the main frieze which depicts 4 padded dancers (komasts) and a siren with extended wings. Face and upper  body of dancers, face and breast of siren in red, red bands on wings. Filling ornaments of rosettes  incised and painted in black and red. On the base central star motif surrounded by volutes. Neck and rim restored, handle missing',0,12496,'Host Street / Lewins Mead, St Bartholomew\'s Hospital, Layer GAX',' -569','',' -591','Fa549','Foreign Archaeology','aryballos',''),(80269,'drinking vessel','Silhouette animal style kotyle. It has a small flaring base leading into a deep cup with tapering walls and two  horizontal handles on the top. Long wavy stripes in handle zone, horizontal lines and bands above and below the frieze depicting crude animals and dot fillers. Concentric circles on underfoot, inside glazed. Paint is black-brown, partly worn especially inside.',0,8675,'',' -550','',' -570','Fa569','Foreign Archaeology','Corinthian kotyle/ skyphos',''),(84774,'vessel','Corinthian \'warrior\' round aryballos. Flat disk mouth, short neck and round base. Decoration of concentric bands in brownish paint on  mouth, shoulder and base,  line on the edge of the mouth. Horizontal lines on the vertical handle.  Body decorated with a row of 4 marching oplites (warriors) with helmet and shield. Shield decorated with overpaint red, dot rosettes motif in field. Details are incised on.',0,8675,'',' -549','',' -571','H4011','Foreign Archaeology','Corinthian \'warrior\' round aryballos',''),(10623,'Eurasian common shrew','',101,12496,'woods, Leigh Woods, Bristol',' ','',' 1964-1984','Ad1938','Biology','Eurasian common shrew','ST 554 739'),(10566,'Eurasian water shrew','',403,12496,'Leigh Woods [Bristol]',' ','',' 1964-1984','Ad359','Biology','Eurasian water shrew','ST 554 739'),(10622,'Eurasian pygmy shrew','',101,12496,'[woo