INSERT INTO `OBJECTS` VALUES (62067,'Fossil','',526,5432,'Scalby Ness, Scarborough',' ','',' ','Cb5330','Palaeontology','',''),(62173,'Fossil','',526,5432,'Scalby Ness, Scarborough',' ','',' ','Cb5331','Palaeontology','',''),(103857,'box','Lidded rectangular box with indented corners. Made of porcelain with underglaze blue decorations of classic Ming dragons and lingzhi fungus above rocks and waves, with the character shou \"long life\" in a 4-bracketed cartouche. The base bears the genuine six-character reign mark of the Jiajing emperor. One of a pair with N2627.',3110,0,'',' 1566','Ming dynasty, Jiajing reign (1522-66)',' 1522','N2628','Eastern Art','',''),(120627,'jug, cream','Moulded scrolled pedestal base, plain but for a pendant wreath of polychrome flowers in the moulded cartouches on each side and a lake line around base, lake detailing in lip and handle.',4271,12496,'',' ','',' 1770-1780','G451','Applied Art','',''),(25021,'Fossil','',526,6298,'Nant Brook, Hendy Bank, nr Llandrindod Wells',' ','',' ','Cb5056','Palaeontology','',''),(26308,'Fossil','',526,6298,'Middle Quarry, Llanfawr (SO 06566173).',' ','',' ','Cd4812','Palaeontology','',''),(121962,'ring','gold & diamonds',4443,0,'',' ','',' 1866','Na977','Applied Art','',''),(167420,'teapot & cover','\n\n\nEngraved inscription: \'Presented // TO // Mr Thomas Davies, // by the // TOBACCO & SNUFF // Manufacturers // of Bristol in testimony // of his // FIDELITY & ZEAL // in promoting their interests // on all occasions. // Jany 1835.\'',4387,13076,'',' 1834','',' 1833','Na2470.1','Applied Art','',''),(167421,'coffee pot & cover','\n\n\nEngraved inscription: \'Presented // TO // Mr Thomas Davies, // by the // TOBACCO & SNUFF // Manufacturers // of Bristol in testimony // of his // FIDELITY & ZEAL // in promoting their interests // on all occasions. // Jany 1835.\'',4387,13076,'',' 1833','',' 1832','Na2470.2','Applied Art','',''),(167422,'milk jug','',4387,13076,'',' 1833','',' 1832','Na2470.3','Applied Art','',''),(167423,'sugar bowl','',4387,13076,'',' 1833','',' 1832','Na2470.4','Applied Art','',''),(84398,'coffin','Lid of the Egyptian coffin of Paty-hewty, or Pedi-tehuty. Light brown painted base, highly decorative with figures and heiroglyphs. The hair has red and black stripes about 5mm thick. Colours of the decoration are mainly black and red with bits of green. A few small cracks on the head. One deep crack on the chest 400mm long (approx). Thin crack across the waist, and on the side. Feet are missing.',1772,7782,'Meir',' -350','Late Period',' -550','H4308','Foreign Archaeology','coffin lid',''),(104415,'vase','Meiping (\'plum vase\'), probably used to store alcoholic drink. Made of porcelain with underglaze blue decoration of immortals and servants (one carrying a qin zither) in a landcape with clouds. The vessel would originally have had a cover, which is now lost.',3362,0,'',' 1464','Ming dynasty, Tianshun reign (1457-64)',' 1457','N5374','Eastern Art','wine-storage jar',''),(123074,'skewer: hatelet','',4385,13076,'\\London\\ (assayed in London)',' ','',' 1799-1800','G3732','Applied Art','',''),(84479,'figurine','Carved wooden figure, almost standing, with arms by his side. Harpocrates (the god Horus as a child) amulet. The bottom of his legs and the details of the face are missing, and the whole object is severely cracked along the grain of the wood.',1885,7731,'H5-652',' ','',' ','H5223','Foreign Archaeology','Harpocrates (Horus as a child) amulet',''),(122909,'flower holder: vase','Opaque-white glass.',4493,0,'',' ','',' ','G2456','Applied Art','',''),(122908,'flower holder: vase','Opaque-white glass; enamelled butterflies.',4493,0,'',' ','',' ','G2455','Applied Art','',''),(146136,'incense burner','Incense burner/ funerary urn.',6228,0,'',' ','',' ','E5073','Ethnography','',''),(117723,'tool/material','a small artist\'s watercolour box, containing various tablets of watercolour and three ceramic dishes',0,0,'',' 1860','',' 1840','N1654','Fine Art','Watercolour Box',''),(126128,'bowl','decorated with marbled slips',4558,11948,'',' ','',' 1840','N7970.i','Applied Art','',''),(121180,'figure: \\\'Grief\\\'','',4263,0,'',' 1780','',' 1775','G3149','Applied Art','','');
